INSERT INTO `faq` (`id`, `question`, `answer`) VALUES
	(1, 'What is Media Toolbox Online?', 'Media Toolbox Online is an easy to use, all in one online tools portal putting in one place all that is needed in order to find and download media over the internet, featuring an intuitive "e-commerce" style interface allowing users to browse through channels and item pages just as if they were looking for something in a store. Media Toolbox Online provides indexes and data bases, promoted and featured tools and software, bonus media and more.'),
	(2, 'What can I do with Media Toolbox Online?', 'You will be able to use the MTO service to search data bases and download content, videos, audio, images etc. In addition you will get access to promoted and affiliated software, cool and useful tools for Social and media consumption and Bonus content; all updating constantly.'),
	(4, 'Are you a legal service?', 'Yes we are. We are absolutely a 100% legal service and we respect both our customers and other sources in the web. Furthermore, we resent copyright infringement and believe that artists and developers deserve proper compensation for their hard work. All though we have no control over content available through 3rd party sources on the web, we urge our customers to download their content from legal sources and create a better online community. '),
	(8, 'Why do you need my payment details?', 'First of all, our service promotes the policy of "premium membership to everyone" by means of affordable low cost subscription (as low as 1.99$ a month!) and therefore we are a paid service. Our approach is all about continuous access to our ever updating interface with the added value of high quality and high speed server infrastructure for blazing fast downloads; malware free and ad free experience, and more. In addition, your payment details are also required in order to conduct the verification process of your account (to protect you and the other members), and to validate additional details such as your address in cases of limited distribution rights. We fully understand if you are concerned about entering your credit card / bank details. However, during the registration your personal data is encrypted by the latest 256 bit state-of-the-art technology and will be kept strictly confidential. All accounts come with a 3 day trial period, which means that within the first 3 days you may try out our service and cancel any time if you are not satisfied. If you do not cancel your account within the first 3 days of your membership you will be charged the price for the plan you chose upon registration. '),
	(5, 'Can I try out your service?', 'Yes, all accounts come with a 3 day trial period, which means that within the first 3 days you may try out our service and cancel anytime if you are not satisfied. If you do not cancel your account within the first 3 days of your membership, you will be charged the price of the plan you chose upon registration. You may choose a different plan (if available) or cancel your account at anytime in the members\' area. If for any reason, you are not completely satisfied with our service, simply log in to your members\' area, browse to the support interface and submit a cancellation request within the trial period and you won\'t be charged (excluding registration and processing fees if applicable).'),
	(6, 'How do I get started?', 'Getting started is as easy as 1, 2, 3: Sign up, Download and install the required software, browse the index, Data base or search engine to find your content.'),
	(7, 'Can I try out your service?', 'Of course! We offer trial programs for a limited period of 3 days in which you can try out the service without obligation and cancel anytime if you are not satisfied. The trial programs are available through a fixed low cost payment of 1.99$ and through additional special promotional offers/coupons from time to time. If you do not cancel your account within the first 3 days of your membership, you will be charged the price for the plan you chose upon registration. You may choose a different plan (if available) or cancel your account at any time in the members\' area. If from some reason you are not completely satisfied with our service, simply log on in to your members\' area, and you can submit your cancellation request at the "manage account" page or through our support interface within 3 days after your registration and you won\'t be charged.'),
	(9, 'Does Media Toolbox Online protect my privacy?', 'Media Toolbox Online protects your privacy by offering free SSL encryption with every account. Encryption helps protect your privacy and can even assist with circumventing bandwidth throttling from your ISP. Best of all, it’s free! Media Toolbox Online will never sell or share your personal information with third parties. Click on “Privacy Policy” at the bottom of the Media Toolbox Online website for more information.'),
	(10, 'What are my membership benefits?', 'Being a member, you are automatically provided with an access to any downloads available. This is to be managed by the search and download desktop application; an exclusive software, that allows you to proceed with search and downloading of the latest files. You will also get unlimited access to our tools and software, indexes, featured products and more. All, in a hassle free protected environment.'),
	(11, 'What kind of download speeds should I expect?', 'Download speeds vary greatly, depending on your connection speed, computer specifications and ISP\'s bandwidth allocation. The low side, if you have dial-up, would be around 4-5kb/s, while broadband access comes in at around 2000kb/s. Some users even download as high as 3000kb/s!'),
	(12, 'Are there any per-download fees coming after my membership activation?', 'No. Once you become a member there are no limits to the number of your downloads, neither there are per download charges.'),
	(13, 'Are there any per-download fees coming after my membership activation?', 'No. Once you become a member there are no limits to the number of your downloads, neither there are per download charges.'),
	(14, 'What happens if I have a problem with any aspects of the service?', 'Our support service is available around the clock 24 hours, 7 days a week. If you have any technical or general issues at all, feel free to login to your account and create a support ticket. From there, one of our customer service representatives will assist you to the best of their abilities in order to give you a satisfactory result. WE DO NOT MAKE PROMISES WE CAN\'T KEEP.....');
