INSERT INTO `page` (`id`, `alias`, `title`, `content`, `is_premium_content`) VALUES
	(1, 'about', 'About', '<p>Media Toolbox Online was created by internet users for internet users, in order to enhance and improve the\r\n	consumption and usage of media and content on the web. Our team has put together an intuitive ever developing and\r\n	ever updating portal in order to bring together the best in the online media world, all for a better experience and\r\n	better and smarter media consumers.</p>\r\n\r\n<p>Media Toolbox Online was founded on 3 guiding principles:\r\n</p><ul>\r\n	<li>Support and endorsement of legal media usage on the web – We take copyright infringement very seriously and\r\n		believe that artists and developers deserve compensation for their hard work; therefore we do not support illegal\r\n		distribution of copyrighted materials and urge you to do the same.</li>\r\n	<li>Providing tools and guidelines to users who seek to enhance their online experience and web usage, by developing\r\n		toolsets of our own, indexing of legal featured and free software, and promoting affiliate software from our\r\n		partners; all in order to increase your capabilities social tools and web utilities, giving you hours of fun, and\r\n		even save you money with an awesome coupon generator!!!</li>\r\n	<li>Always strive to improve – we aim at providing the best service and experience out there, and in that note we\r\n		manage an efficient and effective costumer service, conduct our operation based on customer feedback, get the feel\r\n		of is needed and work to provide it.</li>\r\n</ul>\r\n<p></p>\r\n<p>Our work is never done; we are always fixed on getting the best of the web to our users, either by developing unique\r\n	products, locating cool and useful software, creating tutorials or finding new affiliate programs to provide even\r\n	more content to our users. Whether it\'s through extensive testing of our clients and products, or through customer\r\n	feedback, Media Toolbox Online will always be improving its service. We view our customers as partners, and consider\r\n	them to be a valuable resource in our ongoing improvement process</p>\r\n\r\n<p>Our success is tied to your happiness and your input is a key to making sure we are spending resources on\r\n	improvements and developments which are actually needed. There is no “feature cabal” at Media Toolbox Online\r\n	arbitrarily deciding what features we develop. We value your ideas, welcome your comments, and incorporate your\r\n	suggestions at every point of our development process.</p>\r\n\r\n\r\n<p>We have a lot of plans for how to make our service even better in the future with new features and interfaces, and we\r\n	welcome you to stick around and stay with us to see what\'s coming.</p>\r\n<p>\r\n	Enjoy!<br>\r\n	The Media Toolbox Online team\r\n</p>\r\n', 0),
	(3, 'disclaimer', 'Terms and Conditions', '<p>This website and the "Media Toolbox Online" service is made available to you by Roadpass Ltd ("Roadpass"). Your access to and use of this Site is strictly subject to these Terms and Conditions of Use. By accessing this Site, the user ("YOU") agrees to be unconditionally bound by these Terms and Conditions of Use. Roadpass Ltd may, at any time and at its sole discretion, modify this Site or these Terms and Conditions of Use, including, without limitation, the Privacy Policy, with or without notice. Such modifications will be effective immediately upon posting. You agree to review these Terms and Conditions of Use periodically and your continued use of this Site following such modifications will indicate your acceptance of these modified Terms and Conditions of Use. If you do not agree to these Terms and Conditions of Use or to any modification thereof, you must immediately stop using this Site and/or immediately cancel your subscription, if applicable. This agreement constitutes your agreement with Roadpass Ltd. for your membership to the service provided by the website (the "service"), with respect to your use of the service. You must agree to abide by all of the terms and conditions contained in this agreement in order to become or to remain an authorized user of the service. As used in this agreement, the terms: "the company", "we", and "us", refers to "Roadpass" Ltd. or any successor or assign of Roadpass Ltd.</p><p>Please read the following terms and conditions carefully, as they form the agreement between Roadpass Ltd. and you (the user). If you do not agree to these terms and conditions, you may not use the service and should not proceed to register. By using the service you are agreeing to be bound by this agreement, including all its amendments.</p><h3>Subscription</h3><p>To subscribe to the "Media Toolbox Online" Online Service (the "Service"), you must provide Roadpass Ltd. with your complete name, e-mail address and credit or debit card number (the card you selected hereinafter referred to as your "Payment Card"), Or an alternative method of payment, as may be utilized by the service from time to time. The Service requires an Internet connection and will operate only on the hardware and software platforms specified on this Site. It is your responsibility to ensure that you have the appropriate software, hardware and an Internet connection to operate the Service. Roadpass Ltd. reserves the right to cease supporting any hardware or software platform at any time, with or without notice.</p><h3>Terms of use</h3><p>When registering to the service you will be asked to submit a valid payment method (i.e credit card). The charges on your card will occur according to the subscription plan/program chosen by you at the time of registration. When choosing a fixed price plan (according to the time periods specified in the registration form), there will be a onetime charge (payment in advance – to be charged with correspondence to the date of registration) to your card and you will not be re-billed. For example, a fixed one year membership to the service will be billed in a onetime charge representing the monthly membership rate times 12 months, and the amount charged to you is based on your choice of package and charged to the account of your choice. When choosing a monthly membership with a recurring charge, then, a recurring charge will be applied/charged to your credit card according to the package/payment program chosen by you at the time of registration. Bare in mind that by requesting a monthly membership, you agree and authorize Roadpass and/or its agent to charge your payment card the periodic membership fee (plus applicable taxes), corresponding to the membership plan you have selected (e.g. 1 month, 2 months, 3 months, 6 months, 12 months) on each periodic anniversary date of that plan (corresponding to the calendar date of your subscription), until your membership to the service is terminated or cancelled as herein provided. For example, if you have subscribed to a monthly membership and your paid membership began on January 5th, your periodic anniversary date shall be th 5th day of each following month, and your payment card will be charged for the applicable periodic monthly membership fee on that date of each following month. If you purchased a three (3) month plan, your periodic anniversary date shall be the 5th day of every following three (3) months, in the same format. If your periodic anniversary date falls on a date that is not contained in your anniversary month (such as the 31st day of a month), then your charge will occur on the 1st day of the following month. No copies of charge slips evidencing the recurring charges of the monthly membership fee will be provided. By registering and submitting your payment card details to purchase a monthly membership plan, you agree to pay the applicable periodic membership fees (plus applicable taxes) in accordance with your payment card issuer agreement. You also authorize Roadpass to charge your payment card for any other charges you may incur associated with your online membership to the service.</p><p></p><p>You are solely responsible for any and all fees charged to your Payment Card by the relevant issuer, bank, or financial institution, including, but not limited to, membership, overdraft, insufficient funds and over the credit limit fees. Bare in mind that Roadpass is required to charge you for all applicable taxes, including, without limitation, any applicable state, provincial, federal and local taxes.&nbsp;</p><p>Purchase is done securely through our authorized sales processing agent. Your information will be transmitted through Secure Socket Layer (SSL) software to ensure your information is private. You will receive unlimited access to our support resources, unlimited downloads of all programs located within our site and unlimited technical support contact with our staff.</p>RoadPass Ltd. reserves the right to offer and promote additional products/features from time to time and during the registration process, and to change the subscription plans and or rates from time to time, including limited time promotional offers at its sole discretion.<p></p><h3>Payment Card Verification</h3><p>When submitting a payment method to ensure your subscription fee transaction, the approval of your membership plan (according to the plan chosen by you at the time of subscription) will require to run a verification process in order to ensure the validity and origin of the payment card and its details. The verification process is utilized among other things in order to confirm your user\'s details and origin (in case of geographic location limited product rights), ensure your payment capabilities and prevent frauds. The verification process is done upon approval of your membership/registration form.</p><h3>Pending Charge</h3><div>You authorize Roadpass to place a pending charge on your Payment Card when you become a member, and prior to each subsequent periodic charge. Pending charges are used to verify your billing address and the validity of your Payment Card. They are temporary (typically three (3) to seven (7) days in length) and will not be converted into an actual charge to you. Pending charges, while pending, will, however, reduce the available amount of credit or debit capacity on your Payment Card in the amount of ONE DOLLAR ($1.00) per pending charge.</div><h3>Payment Card Expiration</h3><p>If your Payment Card reaches its original expiration date, your failure to cancel your Online membership to the service shall constitute authorization for Roadpass to continue billing that Payment Card. If your Payment Card for any reason will not accept charges for any periodic membership fee, you have a period of nine (9) days from the date that your Payment Card was declined to make your Payment Card information valid by either rectifying the issue with the Payment Card issuer or providing new Payment Card information by visiting the support section of the service and informing the support team. If Roadpass is able to charge your Payment Card (existing or new, if you have provided new Payment Card information,) during the abovementioned nine (9) day period and any past due Online service membership fees are paid, then the service\'s Online benefits will continue uninterrupted and this Payment Card will be used to charge the applicable periodic membership fee for each consecutive renewal period until your Online membership to the service is cancelled (your original anniversary date will still apply). If Roadpass is unable to charge your Payment Card (existing or new, if you have provided new Payment Card information), within the abovementioned nine (9) day period, then your Online membership to the service will be indefinitely suspended beginning on the tenth (10th) day from the date your Payment Card was initially declined. During a period of thirty (30) days immediately following the suspension of your membership, Roadpass may attempt to charge the Payment Card for the periodic membership fee. If the overdue charge is accepted, then your Online benefits of the service will be reinstated as of the date the charge is accepted in full. Such charge date will then become your new periodic anniversary date and the Payment Card will be used to charge the applicable periodic membership fee for each consecutive renewal period until your &nbsp;Online membership to the service is terminated or cancelled.</p><p>The Online membership term (to the service) commences on the date you sign up for the service\'s Online membership and is valid with renewals until termination or cancellation as outlined below (the "Membership Term").&nbsp;</p><h3>Right to use</h3><div>Your right to use the Service is subject to any limitations, conditions and restrictions established by us from time to time, in our sole discretion. We may alter, suspend or discontinue any aspect of the Service at any time, including the availability of any Service feature, database or content. We may also impose limits on certain features and aspects of the Service or restrict your access to parts or all of the Service without notice or liability</div><h3>Purchasing by a minor / persons under the age of 18</h3><p>All materials, including graphic files, audio files, video files, movies, text, hyperlinks, interlinks, search engines, and other content that Roadpass and/or its affiliates and subsidiaries make generally available (the "Site Content") or make available only to registered users of this Site pursuant to a fee-based license in virtue of the "Content" section below (the "Content"), are intended only for persons over the age of eighteen (18). As such, in order to register for the Service and/or obtain any of the Content available through the Service, you hereby represent and warrant that you are eighteen (18) years of age or older.&nbsp;</p><p>For the protection of our users, it is our policy not to sell to minors. If you are under the legal age of majority and wish to purchase the service from our online site, please have a parent or legal guardian make the purchase for you. You represent, warrant and covenant that you are at least 18 years old.</p><h3>No warranties</h3><div>The Service is distributed on an "as is" basis. We do not warrant that this Service will be uninterrupted or error-free. There may be delays, omissions, and interruptions in the availability of the Service. Where permitted by law, you acknowledge that the service is provided without any warranties of any kind whatsoever either express or implied, including but not limited to the implied warranties of merchantability and fitness for a particular purpose. You acknowledge that use of the Service is at your own risk. We do not represent or endorse the accuracy or reliability of any software, programs, advice, opinion, statement or other information displayed, uploaded or distributed through the service, our partners or any user of the service or any other person or entity. You acknowledge that any reliance upon any such opinion, download, advice, statement or information shall be at your sole risk. Your continued use of the service now, or following the posting of notice of any changes in this Agreement, will constitute a binding acceptance by you of this Agreement, or any subsequent modifications.</div><h3>Legal use of the service</h3><div>It will be your responsibility to use the products provided through this service in a legal manner, respecting all laws, including copyright infringement laws and any other law applicable to your use of the service (with relation to permitted personal/residential use only). Roadpass Ltd. and the "service" provided declines all responsibility related to your use of the software and services provided. You agree and acknowledge that you shall not acquire any ownership rights by downloading any Retained Content from the Service, and the license granted to you as set forth in these Terms and Conditions of Use does not transfer or grant any ownership rights to you, nor act as waiver any rights of Roadpass, its licensors or the copyright owners with respect to any Retained Content, If made available. You may not re-sell, re-distribute, sublicense or otherwise transfer any right or license in the Retained Content, or use the Retained Content in any manner other than as set forth above or as otherwise stated on the Site at the time you purchased the Retained Content. Any additional usage rules set forth on the Site shall become part of, and are incorporated into, these Terms and Conditions of Use.</div><h3>Free/low payment trials and Evaluation periods</h3><p>From time to time, Roadpass may offer a trial period for the Service to first-time customers, these trial period will be made available to the user either as a "free trial" or a low payment trial period at the sole discretion of the company and in any method that the company sees fit. Unless otherwise specified, this offer is limited to one (1) trial subscription per household and/or Payment Card. When such an offer is made, at the time of registration for your trial period, your Payment Card will be authorized for payment in correspondence to the duration of Service requested plus applicable taxes, though in case a free trial, your Payment Card will not be charged for the duration of the free trial period. Other terms of free trial/trial offers, including the duration of the free trial/trial offers, may vary. Specific details of your free trial/trial offer not covered in these Terms and Conditions of Use will be explained on the web page you will be directed to prior to beginning the membership process or as part of the membership process. Your trial period begins on the day you sign up for the Service, not the day you first access Download Content.</p><p>UPON COMPLETION OF THE FREE TRIAL OR A PAID TRIAL PERIOD, YOUR SUBSCRIPTION WILL RENEW AUTOMATICALLY UNDER THE ONE (1) MONTH/FIXED PAYMENT SUBSCRIPTION PLAN (IN CORRESPONDENCE TO THE TERMS OF THE FREE TRIAL/TRIAL OFFER), REGARDLESS OF THE LENGTH OF YOUR FREE TRIAL/TRIAL PERIOD. The first (1st) day following the expiration of your trial period will be your anniversary date for billing purposes during your Membership Term. Your Payment Card will be charged the recurring monthly membership fees and any applicable sales tax on the day following the expiration of your free trial period, unless you have chosen to cancel your subscription prior to the conclusion of the free trial period. YOU MUST CANCEL YOUR SUBSCRIPTION PRIOR TO THE END OF THE TRIAL OFFER PERIOD TO AVOID ADDITIONAL CHARGES TO YOUR PAYMENT CARD. You will not receive any notification from the service at the expiration of your trial period. Please note the expiration date of your trial period for your records.</p><p>During the trial period, you will receive the benefits of the Service as stated on the terms of the trial period. Membership may be cancelled or modified at any time prior to the end of your trial period by contacting the support team and submitting a cancellation request through the online support interface. Please note that online cancellations are subject to a 0.99$ service fee. Any plan changes made to your account prior to the end of your trial period will nullify the remainder of your trial period and you will be charged for the new plan you have selected.</p><h3>Promotional Offers</h3><div>From time to time, Roadpass may offer a reduced membership fee for the Service for a specified promotional period, to first-time or other selected customers. If you are taking advantage of an introductory promotional offer for new customers, at the time of registration for the Service, your Payment Card will be charged the promotional price plus applicable taxes for the promotional period. For all promotional offers, you agree that any such reduced price is only valid for the specified promotional period, and that the regular applicable periodic membership fee plus applicable taxes will be charged to your Payment Card for each automatic renewal following the end of the promotional period. Terms of the promotional offer, including the promotional price and the duration of the promotional price, may vary from time to time. The details of any offer not covered in these Terms and Conditions of Use will be explained on the web page you will be directed to prior to beginning the membership process or as part of the membership subscription process.</div><h3>Price and Availability</h3><div>The Service and any other products and services offered or referred to on this Site are subject to the availability of such products and services. Furthermore, the availability for purchase or rental of product types or individual products is subject to change by Roadpass, in its sole discretion, at any time without notice. Contemplation of certain product types 