	(10, 'pricing', 'Pricing and Programs', '\r\n\r\n<p>Media Toolbox Online is a paid service. We currently offer a fixed "standard premium" plan to members, comprising of\r\n	a relatively low cost monthly payment. We think of all of our members as premium members and in that note, we\r\n	maintain a solid, high speed and high quality server infrastructure and web platforms in order to provide our\r\n	members with a high download speeds, ad-free, and-malware free environment. In addition, all of the featured\r\n	software and tools are available to our members with no extra costs.</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<table>\r\n	<tbody>\r\n<tr><td></td></tr>\r\n<tr>\r\n		<td>\r\n			<h4>1 "Standard premium" plan:</h4>\r\n\r\n\r\n\r\n\r\n			<p>1.99$ Trial + membership fee of 1.99$ per/month 23.88$ per/year (<span style="font-size: x-small;">onetime payment upon activation</span>)</p>\r\n\r\n\r\n\r\n\r\n			<p>You will receive unlimited access to our support resources, indexes and data-base; unlimited downloads of\r\n				all programs located within our site and unlimited technical support contact with our staff.</p>\r\n\r\n\r\n\r\n\r\n			<p>\r\n				Service includes the following key features and benefits:\r\n			</p><ul>\r\n				<li>Top level security</li>\r\n				<li>Free and unlimited access to products</li>\r\n				<li>Unlimited downloads with no download fee</li>\r\n				<li>Blazing fast download speed</li>\r\n				<li>No spyware</li>\r\n				<li>No malware</li>\r\n				<li>No Viruses</li>\r\n				<li>No ads</li>\r\n			</ul>\r\n			<p></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n			<p><span style="font-size: x-small;">Disclaimer: Accounts come with a 3 day trial period, which means that within the first 3 days you may try\r\n				out our service and cancel anytime if you are not satisfied. If you do not cancel your account within\r\n				the first 3 days of your membership, you will be charged the price of the plan you chose upon\r\n				registration. You may choose a different plan (if available) or cancel your account at anytime in the\r\n				members\' area. If for any reason, you are not completely satisfied with our service, simply log in to\r\n				your members\' area, browse to the support interface and submit a cancellation request within the trial\r\n				period and you won\'t be charged (excluding registration and processing fees if applicable, standard rate\r\n				for online cancellation fee is 0.99$)</span></p>\r\n		</td>\r\n	</tr>\r\n</tbody></table>\r\n\r\n\r\n\r\n\r\n<h5><span style="font-weight: bold;">Important Notice: Your privacy and security is our primary concern</span></h5>\r\n<p>Purchase is done securely through our authorized sales processing agent. Your information will be transmitted through\r\n	Secure Socket Layer (SSL) software to ensure your information is private. We take additional measures to protect\r\n	your information and make sure that it will not be available to any 3rd parties. For additional information please\r\n	refer to our "privacy" page.</p>\r\n', 0);
