	(152, 'Black Fist (1975)', '&quot;To make money, a Los Angeles street-fighter goes to work for gangsters. &quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/5KtEC4JZS4g?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/5KtEC4JZS4g?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(153, 'Harvie Krumpet (2003)', '&quot;Life is easy for some people; Harvie Krumpet is not one of them. This surprisingly heart-warming film tells the story of Harvie\'s journey from childhood in Poland to old age in Australia, and the string of incessant bad luck that follows him throughout. Written and directed by Adam Elliot, and narrated by Geoffrey Rush, &quot;Harvie Krumpet&quot; won the 2003 Academy Award for Best Animated Short.&quot;', NULL, 0, 0, '', '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/ouyVS6HOFeo&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><embed src="http://www.youtube.com/v/ouyVS6HOFeo&hl=en&fs=1" type="application/x-shockwave-flash" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(155, 'Animal Crackers (1930)', '&quot;Captain Spaulding, the noted explorer, returns from Africa and attends  a gala party held by Mrs. Rittenhouse. A painting displayed at that  party is stolen, and the Marxes help recover it. Well, maybe \'help\'  isn\'t quite the word I was looking for--this is the Marx Brothers,  after all...&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=6627557277654360838" allowfullscreen="true" flashvars="fs=true">'),
	(156, 'At War with the Army (1950)', '&quot;Alvin Corwin is low man on the totem pole, and goes from one mishap to another at an army training camp in World War II.&quot; -imdb.com', NULL, 0, 0, NULL, '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" width="580" height="476" id="viddler_2bfa10a1"><param name="movie" value="http://www.viddler.com/player/2bfa10a1/" /><param name="allowScriptAccess" value="always" /><param name="allowFullScreen" value="true" /><embed src="http://www.viddler.com/player/2bfa10a1/" width="580" height="476" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" name="viddler_2bfa10a1"></embed></object>'),
	(157, 'Blind Husbands (1919)', '&quot;Three sideshow performers leave their lives of captivity and become  &quot;The Unholy Three.&quot; Echo the ventriloquist assumes the role of a kindly  old grandmother who runs a bird shop. Tweedledee, the &quot;twenty inch  man,&quot; becomes her grandbaby, and Hercules is their assistant. Soon an  incredible crime wave is launched from their little store.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=8942946153097450422&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(158, 'Andalusian Dog, The (Un chien andalou) (1929)', '       &quot;Un Chien Andalou remains a startling artifact suggesting ways in which film can express the subconscious. The result of Luis Bunuel\'s collaboration with Salvador Dali, the 17-minute, 1929 film was designed expressly to shock and provoke. Opening with the canonical eyeball-slashing sequence and divided into baffling \'chapters\', this is a work of art obsessed with religion, lust, decay, violence, and death. Un Chien Andalou isn\'t simply one of the great works of the surrealist movement, but a segment of cinematic DNA that irrevocably altered the aesthetics of film.&quot; -amazon.com (Ryan Boudinot)     ', NULL, 0, 0, NULL, '<object type="application/x-shockwave-flash" data="http://zappinternet.com/v/danPvuMpaX" height="476" width="580"><param name="movie" value="http://zappinternet.com/v/danPvuMpaX" /><param name="allowFullScreen" value="true" /></object>'),
	(159, 'Battleship Potemkin (1925)', '&quot;Based on the historical events the movie tells the story of a riot at the battleship Potemkin. What started as a protest strike when the crew was given rotten meat for dinner ended in a riot. The sailors raised the red flag and tried to ignite the revolution in their home port Odessa.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1630669376406423668" allowfullscreen="true" flashvars="fs=true">'),
	(160, 'Bucket of Blood, A (1959)', '&quot;Walter Paisley, nerdish waiter at a Bohemian cafe, is jealous of the  talent (and popularity) of its various artistic regulars. But after  accidentally killing his landlady\'s cat and covering the body in  plaster to hide the evidence, he is acclaimed as a brilliant sculptor -  but his new-found friends want to see more of his work. Lacking any  artistic talent whatsoever, Walter has to resort to similar methods to  produce new work, and soon people start mysteriously disappearing...&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-6303474703905238262" allowfullscreen="true" flashvars="fs=true">'),
	(161, 'Corpse Vanishes, The (1942)', '&quot;Dr. Lorenz, a mad scientist, wants to keep his elderly wife young. He  does this by kidnapping young females and extracting fluid from them.  He then injects this fluid into his wife. What a diabolical guy!&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=3385531772619278477" allowfullscreen="true" flashvars="fs=true">'),
	(162, 'Dementia 13 (1963)', '&quot;John Haloran has a fatal heart attack, but his wife Louise won\'t get  any of the inheritance when Lady Haloran dies if John is dead. Louise  forges a letter from John to convince the rest of his family he\'s been  called to New York on important business, and goes to his Irish  ancestral home, Castle Haloran, to meet the family and look for a way  to ensure a cut of the loot. Seven years earlier John\'s sister Kathleen  was drowned in the pond, and the Halorans enact a morbid ritual in  remembrance. Secrets shroud the sister\'s demise, and soon the family  and guests begin experiencing an attrition problem.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=8487800124892418620" allowfullscreen="true" flashvars="fs=true">'),
	(163, 'Animal Farm (1999)', '&quot;A satire of Stalinist Russia, Animal Farm tells of the revolt of the animals of Manor Farm against their human masters. Led by the pigs Snowball (Lenin) and Napoleon (Stalin), the animals attempt to create a utopian society. Soon, however, Napoleon gets a taste for power, drives out Snowball, and establishes a totalitarian regime as brutal and corrupt as any human society. Manor Farm becomes a world where all animals are equal--but some are more equal than others.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-9153412213802919416" allowfullscreen="true" flashvars="fs=true">'),
	(164, ' Big Cat, The (1949)', '&quot;1933. A city boy arrives in his late mother\'s birthplace to discover the locals have been pestered by drought, old fights and a cougar. He turns out to be pivotal in all of these.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=1994631084769014545" allowfullscreen="true" flashvars="fs=true">'),
	(165, 'Close My Eyes (1991)', '&quot;After some years of tension, Richard begins a sexual relationship with his sister Natalie. Now married, the relationship proves dangerously obsessional. Their private intensity (&amp; working class origins) contrast with the middle-class, inhibited, stuffy public scenes we see in the Richmond world into which Natalie has moved with her marriage. As the guilt and intensity of the siblings increases we seem to be heading for disaster, a forboding which increases when Natalie\'s husband Sinclair finds out.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-1695810713031748991&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(166, 'Delta of Venus (1995)', '&quot;A struggling American writer (England) and a fellow American expatriate (Mandylor) begin a sordid affair among the chaos and discord of 1940 Paris, France on the brink of World War II.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=7397719492880177056&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(167, 'To the Limit (1995)', '&quot;Colette is an attractive ex-CIA agent seeking revenge against a ruthless villan and his organization of trained assasins for the murder of her husband while the man is also after mobster Frank Di Vinci for his own personal reasons. It isn\'t long before the paths of both Colette and Frank meet whom they share the same vendetta against the same man and they reluctnaly try to co-operate with each other to bring him down.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-2193345591703304158&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(168, 'Animal Farm (1999)', '&quot;A satire of Stalinist Russia, Animal Farm tells of the revolt of the animals of Manor Farm against their human masters. Led by the pigs Snowball (Lenin) and Napoleon (Stalin), the animals attempt to create a utopian society. Soon, however, Napoleon gets a taste for power, drives out Snowball, and establishes a totalitarian regime as brutal and corrupt as any human society. Manor Farm becomes a world where all animals are equal--but some are more equal than others.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-9153412213802919416" allowfullscreen="true" flashvars="fs=true">'),
	(169, 'Jack and the Beanstalk (1952)', '&quot;Abbott &amp; Costello\'s version of the famous fairy tale, about a young boy who trades the family cow for magic beans.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/w30miI9Vgw0?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/w30miI9Vgw0?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(170, 'Attack of the Giant Leeches (1959)', '&quot;In a community nearby a swamp, a local dweller sees a couple of giant  monsters but nobody believes on his words. Later, the cuckold Dave  Walker (Bruno Ve Sota) finds his slut wife Liz Walker (Yvette Vickers)  cheating him with his friend Cal Moulton (Michael Emmett). He chases  the couple through the swamp, and forces them to jump into the water.  The leeches attack them, and the shocked Dave is arrested, accused of  murder. Two other locals decide to look for the bodies of Liz and Cal  to get the prize of US$ 50.00 per body, and also vanish in the swamp.  Finally, Sheriff Steve Benton (Ken Clark) organizes a patrol to  investigate the caves under the swamp, finding the lethal giant leeches.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/NM0cT0BoZg0?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/NM0cT0BoZg0?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(171, ' Bat, The (1959)', '&quot;Mystery writer Cornelia Van Gorder has rented a country house called \'The Oaks\', which not long ago had been the scene of some murders committed by a strange and violent criminal known as \'The Bat\'. Meanwhile, the house\'s owner, bank president John Fleming, has recently embezzled one million dollars in securities, and has hidden the proceeds in the house, but he is killed before he can retrieve the money. Thus the lonely country house soon becomes the site of many mysterious and dangerous activities.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-751559762608142797" allowfullscreen="true" flashvars="fs=true">'),
	(172, 'Beast of Yucca Flats, The (1961)', '&quot;A defecting Russian scientist is transformed by an atomic test into a  hulking monster, Tor Johnson, of course. Not much else except some  people are killed, boys get lost, and a rabbit sniffs Tor\'s corpse.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=4913900592490278110" allowfullscreen="true" flashvars="fs=true">'),
	(173, 'Beware! The Blob (1972)', '&quot;The Blob returns--more outrageous than ever in this 1972 sequel to the popular sci-fi classic! Plenty of familiar faces, including Larry Hagman (who also directed), Burgess Meredith, Dick Van Patten, Robert Walker and Shelly Berman, add to the fun. A geologist (Godfrey Cambridge) unwittingly brings home an unusual frozen piece of debris from the North Pole. But when it accidentally thaws, the hungrier-than-ever blood-red Blob comes to life again, consuming nearly everyone in its path and terrorizing the town.Can this bizarre creature ever be stopped? &quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/NZUYo1EySUE&hl=en_GB&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/NZUYo1EySUE&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(174, 'ABC\'s of Sex Education for Trainable Persons, The (1975)', '&quot;A 70\'s training film for people who need to teach sex ed. classess to the mentally disabled. A great clip.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-2987243478639579087&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(175, 'Boys Beware (1961)', '&quot;Anti-homosexual film targeted at teenage boys, urging them to avoid encounters with potential molesters.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=6328986021541085902" allowfullscreen="true" flashvars="fs=true">'),
	(176, 'At War with the Army (1950)', '&quot;Alvin Corwin is low man on the totem pole, and goes from one mishap to another at an army training camp in World War II.&quot; -imdb.com', NULL, 0, 0, NULL, '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" width="580" height="476" id="viddler_2bfa10a1"><param name="movie" value="http://www.viddler.com/player/2bfa10a1/" /><param name="allowScriptAccess" value="always" /><param name="allowFullScreen" value="true" /><embed src="http://www.viddler.com/player/2bfa10a1/" width="580" height="476" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" name="viddler_2bfa10a1"></embed></object>'),
	(177, 'Captain EO (1986)', '&quot;Captain EO is a 3-D film formerly shown at Disney theme parks.     	The film stars Michael Jackson. It was directed by Francis Ford Coppola, executive-produced by George Lucas ...&quot;     	&quot;The movie tells the story of Captain EO and the ragtag crew of his spaceship on a mission to deliver a gift to a wicked alien queen, the Supreme Leader, on her home world of rotting, twisted metal and steaming vents. Captain EO\'s alien crew consists of his small flying sidekick Fuzzball, the double-headed navigator and pilot Idee and Odee, robotic security officer Major Domo, a small robot Minor Domo (who fits like a module into Major Domo), and the clumsy elephant-like shipmate Hooter (Tony Cox) who always manages to blunder the crew\'s missions.&quot; -wikipedia     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/AstW05bDiQU&hl=en&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/AstW05bDiQU&hl=en&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(178, 'Help! (1965)', '&quot;The Beatles second film has an obscure Asian cult that believes in  human sacrifice after Ringo who has accidentally put on the victim\'s  ceremonial ring. He is pursued by the cult, a pair of mad scientists,  and a member of a side cult that no longer believes in human sacrifice  and the London police who are trying to help.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-2243298924020075723" allowfullscreen="true" flashvars="fs=true">'),
	(179, 'Inspector General, The (1949)', '&quot;An illiterate stooge in a traveling medicine show wanders into a strange town and is picked up on a vagrancy charge. The town\'s corrupt officials mistake him for the inspector general whom they think is traveling in disguise. Fearing he will discover they\'ve been pocketing tax money, they make several bungled attempts to kill him.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/pKYIWWmplb8?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/pKYIWWmplb8?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(180, 'Jack and the Beanstalk (1952)', '&quot;Abbott &amp; Costello\'s version of the famous fairy tale, about a young boy who trades the family cow for magic beans.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/w30miI9Vgw0?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/w30miI9Vgw0?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(181, 'Rudolph, the Red-Nosed Reindeer (1964)', '       If it doesn\'t play, watch in on Google Video       &quot;Sam the snowman tells us the story of a young red-nosed reindeer who, after being ousted from the reindeer games because of his beaming honker, teams up with Hermey, an elf who wants to be a dentist, and Yukon Cornelius, the prospector. They run into the Abominable Snowman and find a whole island of misfit toys. Rudoph vows to see if he can get Santa to help the toys, and he goes back to the North Pole on Christmas Eve. But Santa\'s sleigh is fogged in. But when Santa looks over Rudolph, he gets a very bright idea...  &quot; -imdb.com     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=http://video.google.com/videoplay?docid=-7226220443648270051&ei=fkpISe3ULaKy2gKp1-zqBQ&q" allowfullscreen="true" flashvars="fs=true">'),
	(182, 'Bat, The (1959)', '&quot;Mystery writer Cornelia Van Gorder has rented a country house called \'The Oaks\', which not long ago had been the scene of some murders committed by a strange and violent criminal known as \'The Bat\'. Meanwhile, the house\'s owner, bank president John Fleming, has recently embezzled one million dollars in securities, and has hidden the proceeds in the house, but he is killed before he can retrieve the money. Thus the lonely country house soon becomes the site of many mysterious and dangerous activities.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-751559762608142797" allowfullscreen="true" flashvars="fs=true">'),
	(183, 'Death of a President (2006)', '&quot;Years afte rthe assassination of President George W. Bush in Chicago,  an investigative documentary examines that as-yet-unsolved crime.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-383900990793045743" allowfullscreen="true" flashvars="fs=true">'),
	(184, 'Deep Red  (1975)', '&quot;A psychic who can read minds picks up the thoughts of a murderer in the audience and soon becomes a victim. An English pianist gets involved in solving the murders, but finds many of his avenues of inquiry cut off by new murders, and he begins to wonder how the murderer can track his movements so closely.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=3752593742062730106" allowfullscreen="true" flashvars="fs=true">'),
	(185, 'Doomed to Die (1940)', '&quot;Shipping magnate Cyrus Wentworth, downcast over a disaster to his ocean liner \'Wentworth Castle\' (carrying, oddly enough, an illicit shipment of Chinese bonds) is shot in his office...at the very moment of kicking out his daughter\'s fiance Dick Fleming. Of course, Captain Street arrests Dick, but reporter Bobbie Logan, the attractive thorn in Street\'s side, is so convinced he\'s wrong that she enlists the help of detective James Lee Wong to find the real killer.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-8032947232763520710" allowfullscreen="true" flashvars="fs=true">'),
	(186, 'Close My Eyes (1991)', '&quot;After some years of tension, Richard begins a sexual relationship with his sister Natalie. Now married, the relationship proves dangerously obsessional. Their private intensity (&amp; working class origins) contrast with the middle-class, inhibited, stuffy public scenes we see in the Richmond world into which Natalie has moved with her marriage. As the guilt and intensity of the siblings increases we seem to be heading for disaster, a forboding which increases when Natalie\'s husband Sinclair finds out.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-1695810713031748991&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(187, 'His Girl Friday (1940)', '&quot;Hildy Johnson has divorced Walter Burns and visits his office to tell him that she is engaged to another man and that they are going to get married the day after. Walter Burns can\'t let that happen and frames the other man, Bruce Baldwin, for a lot of stuff getting him into trouble all the time, while he tries to steer Hildy back into her old job as his employee (editor of his newspaper).&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" align="middle" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=6759515366249007357" allowscriptaccess="sameDomain" quality="best" bgcolor="#ffffff" scale="noScale" wmode="window" salign="TL"  flashvars="playerMode=embedded">'),
	(188, 'Andalusian Dog, The (Un chien andalou) (1929)', '       &quot;Un Chien Andalou remains a startling artifact suggesting ways in which film can express the subconscious. The result of Luis Bunuel\'s collaboration with Salvador Dali, the 17-minute, 1929 film was designed expressly to shock and provoke. Opening with the canonical eyeball-slashing sequence and divided into baffling \'chapters\', this is a work of art obsessed with religion, lust, decay, violence, and death. Un Chien Andalou isn\'t simply one of the great works of the surrealist movement, but a segment of cinematic DNA that irrevocably altered the aesthetics of film.&quot; -amazon.com (Ryan Boudinot)     ', NULL, 0, 0, NULL, '<object type="application/x-shockwave-flash" data="http://zappinternet.com/v/danPvuMpaX" height="476" width="580"><param name="movie" value="http://zappinternet.com/v/danPvuMpaX" /><param name="allowFullScreen" value="true" /></object>'),
	(189, 'Beast of Yucca Flats, The (1961)', '&quot;A defecting Russian scientist is transformed by an atomic test into a  hulking monster, Tor Johnson, of course. Not much else except some  people are killed, boys get lost, and a rabbit sniffs Tor\'s corpse.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=4913900592490278110" allowfullscreen="true" flashvars="fs=true">'),
	(190, 'Beware! The Blob (1972)', '&quot;The Blob returns--more outrageous than ever in this 1972 sequel to the popular sci-fi classic! Plenty of familiar faces, including Larry Hagman (who also directed), Burgess Meredith, Dick Van Patten, Robert Walker and Shelly Berman, add to the fun. A geologist (Godfrey Cambridge) unwittingly brings home an unusual frozen piece of debris from the North Pole. But when it accidentally thaws, the hungrier-than-ever blood-red Blob comes to life again, consuming nearly everyone in its path and terrorizing the town.Can this bizarre creature ever be stopped? &quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/NZUYo1EySUE&hl=en_GB&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/NZUYo1EySUE&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(191, 'Battleship Potemkin (1925)', '&quot;Based on the historical events the movie tells the story of a riot at the battleship Potemkin. What started as a protest strike when the crew was given rotten meat for dinner ended in a riot. The sailors raised the red flag and tried to ignite the revolution in their home port Odessa.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1630669376406423668" allowfullscreen="true" flashvars="fs=true">'),
	(192, 'Battle of Midway (1942)', '&quot;On June 4-6, 1942, a large Japanese force attempted to capture Midway  Island in the North Pacific, but was defeated by U.S. forces with a  loss ratio of 4:1 in favor of the Americans. On hand was a crew of  naval photographers directed by John Ford; their documentary footage  was edited together with narration by Hollywood actors. The film covers  the attack on Midway, some limited aerial footage, the search for  survivors, and aftermath of the battle.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=5084883018678341617" allowfullscreen="true" flashvars="fs=true">'),
	(193, 'British Intelligence (1940)', '&quot;During WWI pretty German master spy Helene von Lorbeer is sent undercover to London to live with the family of a high-placed British official where she is to rendezvous with the butler Valdar, also a spy, and help him transmit secret war plans back to Germany.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=3277210412346158570" allowfullscreen="true" flashvars="fs=true">'),
	(194, 'Carter\'s Army (1970)', '&quot;A redneck officer is put in charge of a squad of black troops charged with taking an important bridge from the Nazis.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/GiCvapr492o?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/GiCvapr492o?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(195, ' Belle Starr Story, The (1968)', '&quot;Abused and dominated by men in her youth, Belle Starr now out-rides, out-smokes, out-shoots, and out-gambles them as she makes her way around the Old West, usually wearing male garb. One man who\'s her equal is Larry Blackie with whom she has an on-again, off-again relationship which is often argumentative and sometimes violent. Together they become involved in a robbery which goes awry. Belle has to rescue Larry and though he\'s grateful, he now wants to go his own way. However, he expresses the hope that someday they\'ll once more cross paths and then ... who knows?&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-6600671793105103930" allowfullscreen="true" flashvars="fs=true">'),
	(196, 'Boot Hill (1969)', '&quot;Honey Fisher has become a powerful man in this small Western town that has grown up around gold-prospecting fields. Fisher and his gang have managed, through swindling, murder, and terror, to gain leases on the important gold-yielding land in the area. A state commissioner comes to town to review the leases, which are crucial to Fisher\'s power. Cat Stevens and Hutch Bessy join forces with circus performers and townsfolk led by Stevens\' friend Finch to fight against Fisher and his henchmen.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/ilsrxf_piFw?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/ilsrxf_piFw?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(197, 'Deadwood \'76 (1965)', '&quot;A young drifter is mistaken for Billy the Kid. The concequences prove deadly.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-6311359084843683338" allowfullscreen="true" flashvars="fs=true">'),
	(198, 'Andalusian Dog, The (Un chien andalou) (1929)', '       &quot;Un Chien Andalou remains a startling artifact suggesting ways in which film can express the subconscious. The result of Luis Bunuel\'s collaboration with Salvador Dali, the 17-minute, 1929 film was designed expressly to shock and provoke. Opening with the canonical eyeball-slashing sequence and divided into baffling \'chapters\', this is a work of art obsessed with religion, lust, decay, violence, and death. Un Chien Andalou isn\'t simply one of the great works of the surrealist movement, but a segment of cinematic DNA that irrevocably altered the aesthetics of film.&quot; -amazon.com (Ryan Boudinot)     ', NULL, 0, 0, NULL, '<object type="application/x-shockwave-flash" data="http://zappinternet.com/v/danPvuMpaX" height="476" width="580"><param name="movie" value="http://zappinternet.com/v/danPvuMpaX" /><param name="allowFullScreen" value="true" /></object>'),
	(199, 'Blinky&trade; (2010)', ' 		  Watch Blinky on Vimeo 		  &quot;Soon every home will have a robot helper.  		  Don\'t worry.  		  It\'s perfectly safe.&quot;       ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.traileraddict.com/emd/36933"><param name="allowscriptaccess" value="always"></param><param name="wmode" value="transparent"></param><param name="allowfullscreen" value="true"></param><embed src="http://www.traileraddict.com/emd/36933" type="application/x-shockwave-flash" wmode="transparent" allowfullscreen="true" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(200, 'Body # 82 (2005)', '&quot;A science fiction student short about a lonely survivor living in a bombshelter after a nuclear holocaust. He is searching for his next healthy body. He has perfected the art of switching souls so that he may cheat death. All hope seems lost as he feels the pain of radiation poisoning, then he finds a little girl and her creepy doll. Horror. Shot on 16mm film. Lots of puss and vommit. a student short film by ethan rublee. 20 minutes long.&quot;', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=1483917692291406339&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(201, '10-7 for Life (1995)', '&quot;10&ndash;7 for Life is a funny, raw and occasionally violent chronicle of the last two weeks of Carol Banks\'s career as a cop in Parkdale, Toronto. Exploring the contrasts and absurdities of patrolling the streets, the film looks at everything from the now-almost-routine gang shootings to a colleague\'s shocking murder, while also capturing what Banks describes as &quot;baby-sitting&quot; &ndash; officers trying to help people who can\'t look after themselves. Filmed by Carol\'s sister, Cindy Banks, this film offers a rare inside look at a police force struggling to cope with an increasingly violent city, and an intimate portrait of one burnt-out cop who has to get out for her own peace of mind.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476">'),
	(202, '10 MPH (2007)', '       &quot;10 MPH is a comical documentary that follows a pair of aspiring filmmakers as they quit their jobs and turn a friend\'s ludicrous idea into a movie. The impulsive purchase of a two-wheeled Segway scooter sets this story in motion when the two friends decide to travel from Seattle to Boston at 10 MPH in an attempt to change their lives forever... What ensues is a road trip like none other with a haphazard cast of characters you could only find on a zany 100-day trek through America\'s back roads. Each poignant story the two friends discover along the way inspires a craving inside to go out and do that thing you\'re supposed to do.&quot;       PLEASE SUPPORT OUR FILM, CLICK HERE: http://www.10mph.com/ourstage -\r\n         We\'ll get $1 for our next film and you will get a FREE iTunes download of 10 MPH.\r\n       Thank you -- Hunter &amp; Josh     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/DdR41fe9Zeg&rel=1"></param><param name="wmode" value="transparent"></param><embed src="http://www.youtube.com/v/DdR41fe9Zeg&rel=1" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476"></embed></object>'),
	(203, ' Agony of Jimmy Quinlan, The (1978)', '&quot;This documentary follows Jimmy Quinlan, one of some 5000 men and women who have abandoned their jobs and families to live in the streets and alleys in Montreal. This film, a powerful portrayal of life on skid row, tells of Jimmy\'s \'agonies,\' especially his attempt to get off the bottle. It\'s something he\'s tried before and will probably have to try again.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always" autostart="false" autoplay="false" flashvars="mID=IDOBJ266&width=516&height=337&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2008/agony-jimmy-large.jpg&autostart=false&autoplay=false&showWarningMessages=true&warningMessage=mature&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL266&embeddedMode=true">'),
	(204, 'Almost Real: Connecting in a Wired World (2002)', '&quot;This documentary presents a few individuals for whom the Internet has become a way to connect with like-minded souls in surprising ways: a cyber punk based on an anti-aircraft rig in the English Channel who operates a rogue Web server, a monk developing &quot;wireless prayer technology,&quot; a &quot;gamer&quot; who re-creates himself in an online game, a retired couple living in an Internet-controlled seniors\' complex and a divorc&eacute;e who exchanges vows online with a man she\'s never met. &quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowscriptaccess="always" allowfullscreen="true" flashvars="mID=IDOBJ315&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/Almost-Real_big.jpg&width=516&height=337&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&embeddedMode=true">'),
	(205, 'American Drug War: The Last White Hope (2007)', '       &quot;The War on Drugs has become the longest and most costly war in American history, the question has become, how much more can the country endure? Inspired by the death of four family members from &quot;legal drugs&quot; Texas filmmaker Kevin Booth sets out to discover why the Drug War has become such a big failure. Three and a half years in the making the film follows gang members, former DEA agents, CIA officers, narcotics officers, judges, politicians, prisoners and celebrities. Most notably the film befriends Freeway Ricky Ross; the man many accuse for starting the Crack epidemic, who after being arrested discovered that his cocaine source had been working for the CIA. AMERICAN DRUG WAR shows how money, power and greed have corrupted not just dope fiends but an entire government. More importantly, it shows what can be done about it. This is not some \'pro-drug\' stoner film, but a collection of expert testimonials from the ground troops on the front lines of the drug war, the ones who are fighting it and the ones who are living it.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-8231634812734884936&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(206, 'Anarchism in America (1983)', '       &quot;A colorful and provocative survey of anarchism in America, the film attempts to dispel popular misconceptions and trace the historical development of the movement. The film explores the movement both as a native American philosophy stemming from 19th century American traditions of individualism, and as a foreign ideology brought to America by immigrants. The film features rare archival footage and interviews with significant personalities in anarchist history including Murray Boochkin and Karl Hess, and also live performance footage of the Dead Kennedys.&quot; -imdb.com ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/p/A9A8175C7D4C744E?version=3&hl=en_US&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/p/A9A8175C7D4C744E?version=3&hl=en_US&fs=1" type="application/x-shockwave-flash" width="580" height="476" allowscriptaccess="always" allowfullscreen="true"></embed></object>'),
	(207, 'Beat This!: A Hip Hop History (1984)', '&quot;Beat This: A Hip-Hop History is a 1984 BBC documentary film about hip-hop culture, directed by Dick Fontaine.[1] The cast includes Afrika Bambaataa, DJ Kool Herc &mdash; the film includes footage from Herc\'s original dance parties &mdash; The Cold Crush Brothers, Jazzy Jay, Brim Fuentes, and The Dynamic Rockers.[2] It is narrated by Imhotep Gary Byrd.[3][4] Originally part of the Arena television series, it was among the first crop of documentaries about hip-hop.&quot; -wikipedia', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=3972671039973659170&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(208, 'Becoming 13 (2006)', '&quot;This smart documentary dares to explore the increasingly intimidating terrain of girlhood by following three 12 year-olds over the period of one year. As these girls move from childhood to maturity it\'s clear that peer pressure is an important influence, but as the films shows, the greatest influence in a young girl\'s life is family. Filmmaker Victoria King\'s creative approach, including the use of \'diary-cam\' footage, not only follows the girls but allows them to question the world in their own voices. Ultimately, the film reveals the complexities of being 12, both satisfying our curiousity and inviting us to ask, \'What happens next?\'&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always" autostart="false" autoplay="false" flashvars="mID=IDOBJ8951&bufferTime=10&width=580&height=476&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/becoming-13_big.jpg&autostart=false&autoplay=false&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL8951&embeddedMode=true">'),
	(209, 'Bumfights: A Video Too Far (2004)', '     	Watch the rest on YouTube     	&quot;Documentary about the controversial BUMFIGHTS: A CAUSE FOR CONCERN phenomena. It covers the video itself, as well as the copycat cases that followed.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/Y5zky5fE_uE?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/Y5zky5fE_uE?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(210, 'Carts of Darkness (2008)', '&quot;Murray Siple\'s feature-length documentary follows a group of homeless men who have combined bottle picking with the extreme sport of racing shopping carts down the steep hills of North Vancouver. This subculture depicts street life as much more than the stereotypes portrayed in mainstream media. The film takes a deep look into the lives of the men who race carts, the adversity they face and the appeal of cart racing despite the risk. Shot in high-definition and featuring tracks from Black Mountain, Ladyhawk, Vetiver, Bison, and Alan Boyd of Little Sparta.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowscriptaccess="always" allowfullscreen="true" autostart="false" flashvars="mID=IDOBJ1351&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/cod-tv-big.jpg&width=516&height=337&autostart=false&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&embeddedMode=true">'),
	(211, 'Ctrl Alt Shift (2009)', '&quot;Ctrl Alt shift is a documentary that explores VJ culture. Looking at VJing, Audio Visual works and live performance cinema. The documentary was filmed in various locations within the U.K including London, Leeds, Bloc music festival, Cornwall and more!&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"> 			<param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="movie" value="http://vimeo.com/moogaloop.swf?clip_id=4676745&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=1&amp;show_portrait=0&amp;color=&amp;fullscreen=1" /><embed src="http://vimeo.com/moogaloop.swf?clip_id=4676745&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=1&amp;show_portrait=0&amp;color=&amp;fullscreen=1" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(212, 'Exit Through the Gift Shop (2010)', '&quot;Banksy is a graffiti artist with a global reputation whose work can be seen on walls from post-hurricane New Orleans to the separation barrier on the Palestinian West Bank. Fiercely guarding his anonymity to avoid prosecution Banksy has so far resisted all attempts to be captured on film. Exit Through the Gift Shop tells the incredible true story of how an eccentric French shop keeper turned documentary maker attempted to locate and befriend Banksy only to have the artist turn the camera back on its owner. The film contains exclusive footage of Banksy Shepard Fairey Invader and many of the worlds most infamous graffiti artists at work on walls and in interview. As Banksy describes it &quot;Its basically the story of how one man set out to film the un-filmable. And failed&quot;&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.tagtele.com/v/69728"></param><param name="wmode" value="transparent"></param><embed src="http://www.tagtele.com/v/69728" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476"></embed></object>'),
	(213, 'Flipping the World: Drugs Through a Blue Lens (2000)', '&quot;Inspired by the hit documentary Through a Blue Lens, Flipping the World is an honest look at the world of youth and drug addiction, as told by those who have been there. Seven culturally diverse high school students meet with members of the Odd Squad ', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476">'),
	(214, 'Freshest Kids, The (2002)', '       Watch the rest on YouTube       &quot;Breaking... Born at Kool D.J. Herc\'s House parties in the early \'70s,  catapulted to a worldwide phenomenon in the \'80s, and now experiencing  its latest gravity-defying incarnation as a thriving underground  movement, \'The Freshest Kids\' brings to you the illest B-Boying this  planet has ever witnessed. Over two hours of hardcore breaking gives  you an all-access pass to the underground world of B-Boys spanning the  last 25+ years. See and hear the early history via rare archival  footage and exclusive interviews with The Nigga Twins, Spy (the man  with 1000 moves), Rock Steady Crew icons Crazy Legs and Ken Swift, The  New York City Breakers, Mr. Wiggles, Styelements and the world\'s most  innovative B-boys of the next generation along with hip-hop legends  Kool D.J. Herc, Afrika Bambaataa, KRS-One, Mos Def and many more as  they come together to reveal for the first time the most comprehensive  history of B-Boying, its evolution and its place within hip-hop culture  and beyond. These are The Freshest Kids and this is their story!&quot; -imdb.com ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/Uizp9UYdKKw?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/Uizp9UYdKKw?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(215, 'Frontline - Growing Up Online (2008)', '&quot;In Growing Up Online, FRONTLINE takes viewers inside the very public private worlds that kids are creating online, raising important questions about how the Internet is transforming childhood. \'The Internet and the digital world was something that belonged to adults, and now it\'s something that really is the province of teenagers,\' says C.J. Pascoe, a postdoctoral scholar with the University of California, Berkeley\'s Digital Youth Research project.&quot;', NULL, 0, 0, NULL, '<object width = "580" height = "476" > <param name = "movie" value = "http://www-tc.pbs.org/video/media/swf/PBSPlayer.swf" > </param><param name="flashvars" value="video=1082076027&player=viral&end=0" /> <param name="allowFullScreen" value="true"></param> <param name = "allowscriptaccess" value = "always" > </param><param name="wmode" value="transparent"></param><embed src="http://www-tc.pbs.org/video/media/swf/PBSPlayer.swf" flashvars="video=1082076027&player=viral&end=0" type="application/x-shockwave-flash" allowscriptaccess="always" wmode="transparent" allowfullscreen="true" width="580" height="476" bgcolor="#000000"></embed></object>'),
	(216, 'Frontline - Sex Slaves (2005)', '&quot;Sex Slaves is a gripping documentary expose inside the global sex trade in women from the former Soviet Bloc. The film takes viewers into the shadowy, multi-billion dollar world of sex trafficking. Part cinema verit&eacute;, part investigation, Sex Slaves puts a human face on this most inhuman of contemporary issues. From the villages of Moldova and Ukraine, to underground brothels and discotheques in Turkey where many women are trafficked and forced into prostitution, we witness first-hand the brutal world of white sex slavery.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=456480507747515257" allowfullscreen="true" flashvars="fs=true">'),
	(217, ' Godfather and the Mob, The (2006)', '&quot;The untold story of the real life Mafia&rsquo;s involvement in the making of Coppola&rsquo;s &lsquo;The Godfather&rsquo;&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=5468395812563230682" allowfullscreen="true" flashvars="fs=true">'),
	(218, 'Hitman Hart: Wrestling with Shadows (1998)', '&quot;In this feature-length documentary, director Paul Jay was given unprecedented access to the world of Bret Hart and pro wrestling as his camera followed Bret \'the Hitman\' Hart for one year. Going behind the tightly guarded walls of wrestling\'s spectacle and theatre, the film explores the meaning of today\'s wrestling morality plays. As fantasy crosses into real life, the true story of Bret Hart\'s struggle with Vince McMahon, the legendary owner of the WWF, is revealed. Hitman Hart: Wrestling with Shadows climaxes with the tale of the biggest double-cross in pro wrestling.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always" autostart="false" autoplay="false" flashvars="mID=IDOBJ4591&bufferTime=10&width=580&height=476&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/HitmanHart_Big.jpg&autostart=false&autoplay=false&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL4591&embeddedMode=true">'),
	(219, 'Hofmann\'s Potion (2002)', '&quot;Discovered in 1943 by Swiss chemist Albert Hofmann, D-lysergic acid diethylamide (or LSD) was first used by researchers as a powerful tool to help unlock the mysteries of the human mind. It was considered an effective tool to treat alcoholism and drug addiction; it was also used to better understand the nature of schizophrenia and other mental illnesses. (Much of that pioneering research was done by a team of researchers based in Saskatchewan.) While researchers were determining the medical benefits of LSD, others &mdash; like Aldous Huxley and Timothy Leary&mdash; promoted the drug as a powerful tool for self-understanding.&quot; -documentarychannel.ca', NULL, 0, 0, NULL, '<object classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="580" height="476" id="player" align="middle"> <param name="allowScriptAccess" value="always" /> <param name="movie" value="http://www.clipfish.de/videoplayer.swf?as=0&videoid=MTMwODU3M3wyNDQ2MzQ3&r=1&c=0067B3" />   <param name="quality" value="high" /> <param name="bgcolor" value="#0067B3" /> <param name="allowFullScreen" value="true" /> <embed src="http://www.clipfish.de/videoplayer.swf?as=0&videoid=MTMwODU3M3wyNDQ2MzQ3&r=1&c=0067B3" quality="high" bgcolor="#0067B3" width="580" height="476" name="player" align="middle" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer"></embed> </object>'),
	(220, 'Hooligans (2006)', '       Watch the rest on YouTube       &quot;Panorama carries out an undercover investigation into previously unreported hooligan violence at World Cup 2006.&quot;     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/OOTGe12Wu0U&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><embed src="http://www.youtube.com/v/OOTGe12Wu0U&hl=en&fs=1" type="application/x-shockwave-flash" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(221, 'Ice Age - Crystal Meth Addicts (2005)', '&quot;Its cheap, highly addictive and ultra-powerful. &quot;Ice&quot;, or crystal methamphetamine, is now more popular than heroin. It plays havoc with the minds and the bodies of addicts, filling emergency wards with dangerous, psychotic patients. But little is known about the long term effects of the drug or even how to treat the addiction. And health services are not prepared for the chaos ice has just started to unleash. This weeks documentary reports on the hidden epidemic. &quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/h9zXLrKcHXI?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/h9zXLrKcHXI?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(222, ' Iceman: Confessions of a Mafia Hitman, The (1992)', '&quot;While leading the life of a happy family man in the New Jersey suburbs Richard Kuklinski was also living a bizarre double-life as a Mafia hit man. Kuklinski tells first hand how he brutally murdered men at close range dismembered and disposed of them before returning home to his family. This film offers extraordinary insight into the cold-heart of a killer.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=5740692213665972395" allowfullscreen="true" flashvars="fs=true">'),
	(223, 'Infamy (2005)', '&quot;A feature-length documentary about graffiti culture as told through the experiences of six well-known graffiti writers and a graffiti buffer.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=3431856308290741123&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(224, 'Jump Britain (2005)', '&quot;Last year a team of French Free Runners captivated Londoners when they scaled some of the city\'s most famous landmarks from the Albert Hall to HMS Belfast for Channel 4\'s Jump London . This time they\'ve decided to take on the whole country in a new project that ranges from Edinburgh to Cardiff. Free Running, or Le Parkour, involves literally leaping from roof to roof in a death-defying, yet beautiful, series of jumps, slides and somersaults. It is a discipline combining an extraordinary athleticism and lack of fear - created by Sebastien Foucan and his friends - that has spread across the world. Foucan sees Free Running as more than a spectacle, it is a way of life, with a spiritual dimension plucked from popular culture and allowing an escape from everyday reality. For Jump Britain , Foucan and his team are joined by members of the burgeoning UK Parkour scene as they tackle some of the UK\'s most iconic sites [...]&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-5901806041431700202" allowfullscreen="true" flashvars="fs=true">'),
	(225, ' Ken and Barbie Killers, The', '&quot;Paul Bernado and Karla Homolka were Canadian serial killers who attracted worldwide media attention when they were convicted of raping and murdering teenage girls, including Karla\'s own sister, Tammy Homolka.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-3249569926766395099" allowfullscreen="true" flashvars="fs=true">'),
	(226, 'Level Zero (2009)', '     	Watch the trailer    	  &quot;A documentary about Alameda County EMS... \'Level Zero\'. With over 110,000 calls for 911 in this system annually, an extremely busy system with a progressive medicine being the role model for many communities throughout the country. With over 1.5 million people living in Alameda, EMS serve and protect the citizens in their most critical hour. These are the faces that will bring you comfort as you dial 911. There is a sense of duty that is only surpassed by the passion to serve. It is because of this that the County of Alameda has become the premiere place for Paramedics and EMT\'s to hone their skills and gain experience necessary to be successful in EMS. This story will share the real lives of those in service and their impact on the community they serve.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="movie" value="http://www.vimeo.com/moogaloop.swf?clip_id=4901024&amp;server=www.vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00adef&amp;fullscreen=1" /><embed src="http://www.vimeo.com/moogaloop.swf?clip_id=4901024&amp;server=www.vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00adef&amp;fullscreen=1" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(227, 'Living with Michael Jackson: A Tonight Special (2003)', '     	Watch the rest on YouTube     	&quot;Martin Bashir conducts a rare interview with Michael Jackson and is given unprecedented access to the reclusive performer\'s private life.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/1OQj0fv0nsg?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/1OQj0fv0nsg?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(228, 'Medicating Kids (2001)', '&quot;In \'Medicating Kids,\' FRONTLINE examines the dramatic increase in the prescription of behavior-modifying drugs for children. Are these medications really necessary--and safe--for young children, or merely a harried nation\'s quick fix for annoying, yet age-appropriate, behavior?&quot;', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.nl/googleplayer.swf?docid=-9055413814104510828&hl=nl&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(229, 'Man Who Ate His Lover, The (2004)', ' 		  &quot;The true story of two men and their encounter with each other. One is a German, who is also a cannibal. The other man is from Berlin, who\'s fetish is to be eaten and killed. They meet up on the Internet, and rendezvous in Germany at the cannibal\'s mansion. There, the willing-victim is drugged up on painkillers. The cannibal then removes the willing-victim\'s penis while video-taping the incident. The penis is split down the middle for the two to eat; first trying the penis raw, then cooking it. After the willing-victim has bled to death, the cannibal puts his corpse in a bath for ten hours, then uses the corpse\'s meat for food.&quot; ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/p/DECAFC519AAFD05E?version=3&hl=en_US&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/p/DECAFC519AAFD05E?version=3&hl=en_US&fs=1" type="application/x-shockwave-flash" width="580" height="476" allowscriptaccess="always" allowfullscreen="true"></embed></object>'),
	(230, 'Never Get Busted Again 1: Traffic Stops (2007)', '     	Watch the rest on YouTube     	&quot;Watch Barry Cooper, a former police officer in Texas focusing on narcotics interdiction for eight years, teach you exactly what you need to know to stay out of jail. With over 800 felony and misdemeanor narcotics arrests, DEA Training, and extensive experience with K-9 drug dogs, Barry\'s friendly, plain spoken and honest attitude makes it easy and entertaining for you to LEARN WHAT YOU NEED TO KNOW. Much of this information has never been seen by the public before and this is the first time it has all been available from a single source.     	- Watch real footage of Barry making marijuana arrests\r\n     		- Learn secret drug enforcement tactics\r\n     		- Avoid narcotics profiling\r\n     		- Conceal your stash plus, do coffee grinds really work?\r\n     		- How to fool K9\'s every time\r\n     		- Search and seizure law made easy\r\n     		- How Police can tell when you\'re lying\r\n     		- 90 Plus Minutes of one-on-one training!&quot;     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/ypdLv0hldvo?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/ypdLv0hldvo?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(231, 'Rhyme &amp; Reason (1997)', '&quot;A study in the world of hip-hop, done mostly with interviews, in order  to see why it is as popular as it is today and what the future holds.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=6821011409594651929" allowfullscreen="true" flashvars="fs=true">'),
	(232, 'RiP! A Remix Manifesto (2008)', '&quot;Immerse yourself in the energetic, innovative and potentially illegal world of mash-up media with RiP: A remix manifesto. Let web activist Brett Gaylor and musician Greg Gillis, better known as Girl Talk, serve as your digital tour guides on a probing investigation into how culture builds upon culture in the information age.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowscriptaccess="always" allowfullscreen="true" flashvars="mID=IDOBJ12743&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2010/rip_remix_tv_big2.jpg&width=516&height=337&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&embeddedMode=true">'),
	(233, 'Ross Kemp on Gangs - Jamaica (2007)', '       Watch the rest on YouTube       &quot;Ross Kemp looks at the gang violence in Kingstown, Jamaica and examines the political history involved.&quot; ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/UqyIQmFC2M0?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/UqyIQmFC2M0?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(234, 'Ross Kemp on Gangs - Moscow (2006)', '&quot;Ross uncovers the extent to which the Nazi, or National Socialist,  groups are gaining power in Russia: it would seem that at best the  police turn a blind eye to racism, at worse actively endorse it. And  Ross meets one Member of Parliament who openly promotes Nazi ideology.  Ross joins one Neo Nazi group during their training and through a  series of tests -which include him being set on fire - he gains their  trust. They invite him back to their secret headquarters where he meets  some seriously disturbing individuals and uncovers the heart of their  violent organisation.&quot;', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=4784767647228050785&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(235, 'Ross Kemp on Gangs - Orange County (2006)', '&quot;Ross Kemp investigates Public Enemy No. 1 and the Neonazi Skinheads of Orange County, CA.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-6674599107070769895" allowfullscreen="true" flashvars="fs=true">'),
	(236, 'Ross Kemp on Gangs - Poland (2006)', '&quot;Ross Kemp investigates Neo-nazi football Hooligans in Poland.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=8831046128904338535" allowfullscreen="true" flashvars="fs=true">'),
	(237, 'Ross Kemp on Gangs - San Salvador', '&quot;Starting  in San Salvador the smallest, most densely populated and most dangerous  country in Central America, Ross immerses himself in the dangerous  world of the Mara Salvatruchaor MS13gang. &ldquo;El Salvador has a level of  violence that far exceeds any other country I&rsquo;ve been to.&rdquo; says Ross,  &ldquo;There are on average 11 murders a day in a country with a population  smaller than London.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=4221922153764278699" allowfullscreen="true" flashvars="fs=true">'),
	(238, 'Sexy Inc. Our Children Under Influence (2007)', '&quot;Sophie Bissonnette\'s documentary analyzes the hypersexualization of our environment and its noxious effects on young people. Psychologists, teachers and school nurses criticize the unhealthy culture surrounding our children, where marketing and advertising are targeting younger and younger audiences and bombarding them with sexual and sexist images. Sexy Inc. suggests various ways of countering hypersexualization and the eroticization of childhood and invites us to rally against this worrying phenomenon.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always" autostart="false" autoplay="false" flashvars="mID=IDOBJ10041&bufferTime=10&width=580&height=476&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/sexy-inc-tv-big.jpg&autostart=false&autoplay=false&showWarningMessages=true&warningMessage=mature&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL10041&embeddedMode=true">'),
	(239, 'Style Wars (1983)', '     	&quot;When director Tony Silver and co-producer Henry Chalfant delivered the  broadcast version of their prize-winning film to PBS in 1983, the world  received its first full immersion in the phenomenon that had taken over  New York City. The urban landscape was physically transformed by  graffiti artists who invented a new visual language to express both  their individuality, and the voice of their community. In STYLE WARS,  New York\'s ramshackle subway system is their public playground,  battleground, and spectacular artistic canvas. As MC\'s, DJ\'s and B-boys  rock the city with new sounds and new moves, we see street corner  breakdance battles turn into performance art.&quot; -amazon.com ', NULL, 0, 0, NULL, '<object classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" width="580" height="476" id="utv132577" name="utv_n_952873"><param name="flashvars" value="loc=%2F&amp;autoplay=false&amp;vid=5820892&amp;locale=en_US&amp;hasticket=false&amp;id=5820892&amp;v3=1" /><param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="src" value="http://www.ustream.tv/flash/viewer.swf" /><embed flashvars="loc=%2F&amp;autoplay=false&amp;vid=5820892&amp;locale=en_US&amp;hasticket=false&amp;id=5820892&amp;v3=1" width="580" height="476" allowfullscreen="true" allowscriptaccess="always" id="utv132577" name="utv_n_952873" src="http://www.ustream.tv/flash/viewer.swf" type="application/x-shockwave-flash" /></object>'),
	(240, 'Union: The Business Behind Getting High, The (2007)', '&quot;BC\'s illegal marijuana trade industry has evolved into a business giant, dubbed by some involved as \'The Union\', Commanding upwards of $7 billion Canadian annually. With up to 85% of \'BC Bud\' being exported to the United States, the trade has become an international issue. Follow filmmaker Adam Scorgie as he demystifies the underground market and brings to light how an industry can function while remaining illegal. Through growers, police officers, criminologists, economists, doctors, politicians and pop culture icons, Scorgie examines the cause and effect nature of the business - an industry that may be profiting more by being illegal. &quot; -imdb.com', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=-9077214414651731007&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(241, 'Who Wants a Ride? (2009)', '&quot;My friend Ron Swafford\'s pedicab documentary... check out the funny, sexy, outrageous stories from the Austin pedicab scene. The soundtrack is by The Blue Hit... David Moss, the cellist, is a pedicabber and has stories featured in here as well. Enjoy!&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"> 			    <param name="movie" value="http://www.youtube.com/v/ivW0_AaRY68&hl=en_GB&fs=1&"> 			    </param> 			    <param name="allowFullScreen" value="true"> 			    </param> 			    <param name="allowscriptaccess" value="always"> 			    </param> 			    <embed src="http://www.youtube.com/v/ivW0_AaRY68&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed> 		      </object>'),
	(242, 'Wonderland: Virtual Adultery and Cyberspace Love (2007)', '&quot;Carolyn is a 37 year-old mother of four in the midst of a passionate affair that is tearing her family apart. She\'s spending up to 18 hours a day with her lover, and her husband is in despair. But the extraordinary thing about this affair is that Carolyn\'s lover is man she has never met. Because he\'s not a human being. He\'s an avatar (or computer generated figure), who exists only in the virtual world of Second Life. And their relationship exists only in cyberspace.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=9093841055587638621" allowfullscreen="true" flashvars="fs=true">'),
	(243, 'World\'s Most Dangerous Drug (2006)', '     	Watch the rest on YouTube     	&quot;Meth really is the mother of all drugs. It\'s the cheapest, dirtiest and  most powerful drug in existence today. It\'s also the fastest spreading.  Meth doesn\'t kill its addicts immediately. The process is slow, during  which it takes an extreme physical and psychological toll. Meth  literally rots people\'s bodies&mdash;teeth, face and insides. Frankly, I was  appalled by how ugly it made frequent users.&quot; -Lisa Ling      ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/ku85jOI1WVo&amp;hl=en_GB&amp;fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/ku85jOI1WVo&amp;hl=en_GB&amp;fs=1" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(244, 'World\'s Most Dangerous Gang (2006)', '&quot;Correspondent Lisa Ling documented the experience of filming this special from El Salvador to Los Angeles. Below are accounts of some of her chilling experiences, including finding out that she and her crew had been targeted for kidnapping and touring MS-13 controlled territory in Los Angeles with an active MS-13 member.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-8050801435890714263" allowfullscreen="true" flashvars="fs=true">'),
	(245, 'AIDS Inc. (2007)', '&quot;AIDS, Inc. is a film about the multi-billion dollar AIDS industry, and how it profits from continuing fears and misconceptions about the disease. While AIDS grabs the headlines and raises billions of dollars with celebrity endorsements and billionaire endowments, we are no closer to finding a cure than when the scourge first appeared 30 years ago. Could it be that after so many years of research, and so much money being spent, that the entire orthodox medical establishment has been wrong about AIDS, or even worse, has sought to profit on a system that it knew was flawed from the beginning?&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1546322203061765598" allowfullscreen="true" flashvars="fs=true">'),
	(246, 'America: From Freedom to Fascism (2006)', '&quot;Determined to find the law that requires American citizens to pay  income tax, producer Aaron Russo (&quot;The Rose,&quot; &quot;Trading Places&quot;) set out  on a journey to find the evidence. This film which is neither left, nor  right-wing is a startling examination of government. It exposes the  systematic erosion of civil liberties in America since 1913 when the  Federal Reserve system was fraudulently created. Through interviews  with U.S. Congressmen, a former IRS Commissioner, former IRS and FBI  agents and tax attorneys and authors, Russo connects the dots between  money creation, federal income tax, and the national identity card  which becomes law in May 2008. This ID card will use Radio Frequency  Identification (RFID) chips which are essentially homing devices used  to track people. This film shows in great detail and undeniable facts  that America is moving headlong into a fascist police state.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1656880303867390173" allowfullscreen="true" flashvars="fs=true">'),
	(247, 'Corporation, The (2003)', ' 		  &quot;Since the late 18th century American legal decision that the business  corporation organizational model is legally a person, it has become a  dominant economic, political and social force around the globe. This  film takes an in-depth psychological examination of the organization  model through various case studies. What the study illustrates is that  in the its behaviour, this type of &quot;person&quot; typically acts like a  dangerously destructive psychopath without conscience. Furthermore, we  see the profound threat this psychopath has for our world and our  future, but also how the people with courage, intelligence and  determination can do to stop it.&quot; -imdb.com ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/p/FA50FBC214A6CE87?version=3&hl=en_US&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/p/FA50FBC214A6CE87?version=3&hl=en_US&fs=1" type="application/x-shockwave-flash" width="580" height="476" allowscriptaccess="always" allowfullscreen="true"></embed></object>'),
	(248, 'Daylight Robbery (2008)', '       &quot;When the US goes to war, corporate America goes too. There are contracts for caterers, tanker drivers, security guards and even interrogators, many of them through companies with links to the White House. Now more than 70 whistleblower cases threaten to reveal the scandals behind billions of dollars worth of waste, theft and corruption during the Iraq war.&quot;     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=789547337385191959" allowfullscreen="true" flashvars="fs=true">'),
	(249, 'Dispatches - The Great Green Smokescreen (2007)', '&quot;Days after Live Earth partied for the planet, Dispatches reveals how attempts to buy our way out of climate crisis may not be delivering.  Channel 4 News\' Science Correspondent Tom Clarke dissects the many \'solutions\' to global warming - from carbon off-setting to green energy tariffs. &quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=2551323600117068903" allowfullscreen="true" flashvars="fs=true">'),
	(250, 'Enemy Image (2005)', '&quot;Enemy Image traces the ways us television has covered war, starting with Vietnam in the 1960s and shows how the military has devised ever-improving means of ensuring the American public never again has the real face of combat beamed directly into their living rooms. Comparing footage of Vietnam, including rarely-seen material shot in North Vietnam, to coverage of Iraq and using extensive interviews with veteran war correspondents and news anchors, Mark Daniels demonstrates how television that once revealed the truth is now increasingly used to hide it.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=2863861954538932125" allowfullscreen="true" flashvars="fs=true">'),
	(251, 'Fiat Empire - Why the Federal Reserve Violates the U.S. Constitution (2007)', '&quot;Find out why some feel the Federal Reserve\'s practices are a violation of the U.S. Constitution and others feel it\'s simply &quot;a bunch of organized crooks.&quot; Discover why experts agree the Fed is a banking cartel that benefits mainly bankers and their corporate clients as well as a Congress that would rather increase the National Debt to $9 trillion than raise taxes. Find out how the corporate media facilitates the partnership between the Fed and Congress and why it fails to disclose what\'s going on. Lastly, find out how the Federal Reserve Member Banks are owned and controlled by an elite group of insiders.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=5232639329002339531" allowfullscreen="true" flashvars="fs=true">'),
	(252, 'Freedom Downtime (2001)', '&quot;Can you launch a nuclear missile by whistling into a payphone? The unofficial story of Kevin Mitnick, possibly the first citizen in  American history to be jailed without a bail-hearing. He went to jail for nothing more than copying software, but was \'convicted\' by the media both for breaking into NORAD as well as causing millions of dollars in damage to a software-company. This documentary introduces you to the \'Free Kevin\' movement, who trried to stop the making of a film about Mitnick based on the media\'s lies, and who went on a journey to track down key players in the Mitnick-affair and get some answers.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-6746139755329108302" allowfullscreen="true" flashvars="fs=true">'),
	(253, 'Great African Scandal, The (2007)', '&quot;In this thought-provoking documentary, made with the help of Christian Aid, academic Robert Beckford undertakes a challenging, emotional journey to Ghana in West Africa. This is where, two centuries ago, Robert Beckford&rsquo;s ancestors were seized and taken as slaves to Jamaica. Now he is making a journey to the land of his roots to discover the hidden costs of rice, chocolate and gold.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-6756318286045228473" allowfullscreen="true" flashvars="fs=true">'),
	(254, 'Live Aid: Rockin\' All Over the World (2005)', '&quot;BBC Documentary telling the story of Live Aid, the biggest concert of all time which raised millions for the starving in africa.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=1685619231581116299" allowfullscreen="true" flashvars="fs=true">'),
	(255, 'Manufacturing Consent: Noam Chomsky and the Media (1992)', '&quot;This film showcases Noam Chomsky, one of America\'s leading linguists and political dissidents. It also illustrates his message of how government and big media businesses cooperate to produce an effective propaganda machine in order to manipulate the opinions of the United States populous. The key example for this analysis is the simultaneous events of the massive coverage of the communist atrocities of Khmer Rouge regime of Cambodia and the suppression of news of the US supported Indonesian invasion and subjugation of East Timor.&quot;  -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-5631882395226827730" allowfullscreen="true" flashvars="fs=true">'),
	(256, ' Merchants of Cool, The (2001)', '&quot;Teenagers in America number more than 30 million and command over 150  billion dollars in disposable income. They are exposed to over 3000  advertising messages in an average day. In contrast to adults,  teenagers respond to whatever is &quot;cool&quot;, as determined by the  trend-setters of the moment. This documentary examines how businesses  seek the ever-elusive &quot;cool&quot; and use it to sell products to teens.  Alas, once corporations find cool, it soon ceases to be so; this means  marketers are forever searching for new products and strategies to  capture the attention of their target audience. This documentary also  looks at how real life and TV life are blurring together, acting like a  feedback loop to push popular teen culture towards more violent and  sexual behaviors.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=5109415725027567998" allowfullscreen="true" flashvars="fs=true">'),
	(257, ' Money Masters, The (1995)', '&quot;THE MONEY MASTERS is a 3 1/2 hour non-fiction, historical  documentary that traces the origins of the political power structure that rules our nation and the world today. The modern political power structure has its roots in the hidden  manipulation and accumulation of gold and other forms of money. The development of fractional reserve banking practices in the 17th century brought to a cunning  sophistication the secret techniques initially used by goldsmiths fraudulently to accumulate wealth. With the formation of the privately-owned Bank of England in 1694, the  yoke of economic slavery to a privately-owned &quot;central&quot; bank was first forced  upon the backs of an entire nation, not removed but only made heavier with the passing of the three centuries to our day. Nation after nation, including America, has fallen prey to this cabal of international central bankers.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-515319560256183936&amp;hl=en" allowfullscreen="true" flashvars="fs=true">'),
	(258, 'My Cultural Divide (2006)', '&quot;Filmmaker Faisal Lutchmedial goes beyond the activist stereotype as he takes a personal journey into his mother\'s native country for the first time. A three month visit to Bangladesh becomes a discovery of family and home that runs parallel with his attempt to tackle the complex issue of global trade. Starting from the opening scene My Cultural Divide questions the logic of the hardcore political activist, and wonders aloud whether ethical consuming actually does anything good for the workers behind the machines. Because of family connections Lutchmedial makes his way into some of the worst factories in Bangladesh, and talks frankly with the workers inside about their job and living conditions. Sometimes contradicting western activists, the labour leaders he speaks to soon make Lutchmedial question his own long-standing beliefs on child labour and personal responsibility. Accompanied by his ailing mother, Lutchmedial takes us on a very personal journey to bridge the gap between his heritage in Bangladesh and his life in Canada. He connects his politics with his humanity, and weaves together a story that is both thought provoking and touching.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"> 		  <param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="movie" value="http://vimeo.com/moogaloop.swf?clip_id=6393377&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=1&amp;show_portrait=0&amp;color=&amp;fullscreen=1" /><embed src="http://vimeo.com/moogaloop.swf?clip_id=6393377&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=1&amp;show_portrait=0&amp;color=&amp;fullscreen=1" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(259, 'Obama Deception, The (2009)', '&quot;The Obama Deception is a hard-hitting film that completely destroys the myth that Barack Obama is working for the best interests of the American people.           The Obama phenomenon is a hoax carefully crafted by the captains of the New World Order. He is being pushed as savior in an attempt to con the American people into accepting global slavery.           We have reached a critical juncture in the New World Order&rsquo;s plans.  It&rsquo;s not about Left or Right:  it&rsquo;s about a One World Government.  The international banks plan to loot the people of the United States and turn them into slaves on a Global Plantation.           Covered in this film:  who Obama works for, what lies he has told, and his real agenda.  If you want to know the facts and cut through all the hype, this is the film for you.&quot; 	  ', NULL, 0, 0, NULL, '<object width="580" height="476"> 		    <param name="movie" value="http://www.youtube.com/v/eAaQNACwaLw&amp;hl=en&amp;fs=1" /> 		    </param> 		    <param name="allowFullScreen" value="true" /> 		    </param> 		    <param name="allowscriptaccess" value="always" /> 		    </param> 		    <embed src="http://www.youtube.com/v/eAaQNACwaLw&amp;hl=en&amp;fs=1" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed> 	      </object>'),
	(260, 'Secret, The (2006)', '     	&quot;The Secret is a feature length movie presentation which reveals The  Great Secret of the universe. It has been passed throughout the ages,  traveling through centuries... This is The Secret to everything - the  secret to unlimited joy, health, money, relationships, love, youth:  everything you have ever wanted. All the resources you will ever need  to understand and live The Secret. The world\'s leading scientists,  authors, and philosophers will reveal The Secret that utterly  transformed the lives of every person who ever knew it... Plato,  Newton, Carnegie, Beethoven, Shakespeare, Einstein.&quot; -imdb.com    	</span>', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=8039702275464206997&hl=fi&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(261, 'Sexy Inc. Our Children Under Influence (2007)', '&quot;Sophie Bissonnette\'s documentary analyzes the hypersexualization of our environment and its noxious effects on young people. Psychologists, teachers and school nurses criticize the unhealthy culture surrounding our children, where marketing and advertising are targeting younger and younger audiences and bombarding them with sexual and sexist images. Sexy Inc. suggests various ways of countering hypersexualization and the eroticization of childhood and invites us to rally against this worrying phenomenon.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always" autostart="false" autoplay="false" flashvars="mID=IDOBJ10041&bufferTime=10&width=580&height=476&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/sexy-inc-tv-big.jpg&autostart=false&autoplay=false&showWarningMessages=true&warningMessage=mature&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL10041&embeddedMode=true">'),
	(262, 'Steal This Film II (2007)', '&quot;These are strange times indeed. While they continue to command so much attention in the mainstream media, the \'battles\' between old and new modes of distribution, between the pirate and the institution of copyright, seem to many of us already lost and won. We know who the victors are. Why then say any more? Because waves of repression continue to come: lawsuits are still levied against innocent people; arrests are still made on flimsy pretexts, in order to terrify and confuse; harsh laws are still enacted against filesharing, taking their place in the gradual erosion of our privacy and the bolstering of the surveillance state. All of this is intended to destroy or delay inexorable changes in what it means to create and exchange our creations. If STEAL THIS FILM II proves at all useful in bringing new people into the leagues of those now prepared to think \'after intellectual property\', think creatively about the future of distribution, production and creativity, we have achieved our main goal.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=3636669624532830059" allowfullscreen="true" flashvars="fs=true">'),
	(263, 'Starsuckers (2009)', ' 		  Watch the rest on YouTube 		  &quot;Starsuckers is the most controversial documentary of the year, and was released in British cinemas in November 2009 to critical acclaim. It\'s a darkly humourous and shocking expos&eacute; of the celebrity obsessed media, that uncovers the real reasons behind our addiction to fame and blows the lid on the corporations and individuals who profit from it. Directed by Chris Atkins, BAFTA nominated for Taking Liberties, Starsuckers exploded into the news in October  when it emerged that the team had been selling fake celebrity stories to all the British Tabloids. This became a news sensation in it\'s own right, and was followed by the darker revelation that Atkins had secretly filmed four journalists for three Sunday tabloids  trying to buy medical records. The filmmakers also stung Max Clifford, who the film shows boasting about his clients on undercover camera. When Clifford found out, he hired the infamous law firm Carter Ruck and threatened to injunct the film which would have prevented it\'s release. The film ends with a damning critique of Bob Geldof\'s Live Aid and the star-studded Live 8 concerts in 2005.&quot; 		  Slow stream? Video also availabe at xtshare.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/um9gyx_XV50?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/um9gyx_XV50?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(264, 'Stupidity (2003)', '&quot;A lighthearted look at stupidity and ignorance in modern society, as  well as a brief history of the study of intelligence. Celebrities and  other notable personalities are interviewed on the subject of the  prevalence of stupidity in the media and culture.&quot; -imdb.com</span>', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-6646286420437586735" allowfullscreen="true" flashvars="fs=true">'),
	(265, 'Super Rich: The Greed Game (2008)', '&quot;As the credit crunch bites and a global economic crisis threatens, Robert Peston reveals how the super-rich have made their fortunes, and the rest of us are picking up the bill.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-3305522889894137433&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(266, 'Union: The Business Behind Getting High, The (2007)', '&quot;BC\'s illegal marijuana trade industry has evolved into a business giant, dubbed by some involved as \'The Union\', Commanding upwards of $7 billion Canadian annually. With up to 85% of \'BC Bud\' being exported to the United States, the trade has become an international issue. Follow filmmaker Adam Scorgie as he demystifies the underground market and brings to light how an industry can function while remaining illegal. Through growers, police officers, criminologists, economists, doctors, politicians and pop culture icons, Scorgie examines the cause and effect nature of the business - an industry that may be profiting more by being illegal. &quot; -imdb.com', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=-9077214414651731007&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(267, ' War You Don\'t See, The (2010)', ' 		  &quot;A powerful and timely investigation into the media\'s role in war, tracing the history of \'embedded\' and independent reporting from the carnage of World War One to the destruction of Hiroshima, and from the invasion of Vietnam to the current war in Afghanistan and disaster in Iraq. As weapons and propaganda become even more sophisticated, the nature of war is developing into an \'electronic battlefield\' in which journalists play a key role, and civilians are the victims. But who is the real enemy? John Pilger says in the film: &quot;We journalists&hellip; have to be brave enough to defy those who seek our collusion in selling their latest bloody adventure in someone else\'s country&hellip; That means always challenging the official story, however patriotic that story may appear, however seductive and insidious it is. For propaganda relies on us in the media to aim its deceptions not at a far away country but at you at home&hellip; In this age of endless imperial war, the lives of countless men, women and children depend on the truth or their blood is on us&hellip; Those whose job it is to keep the record straight ought to be the voice of people, not power.&quot;&quot; ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.tagtele.com/v/73930"></param><param name="wmode" value="transparent"></param><embed src="http://www.tagtele.com/v/73930" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476"></embed></object>'),
	(268, 'WikiRebels (2010)', '&quot;Exclusive rough-cut of first in-depth documentary on WikiLeaks and the people behind it! From summer 2010 until now, Swedish Television has been following the secretive media network WikiLeaks and its enigmatic Editor-in-Chief Julian Assange. Reporters Jesper Huor and Bosse Lindquist have traveled to key countries where WikiLeaks operates, interviewing top members, such as Assange, new Spokesperson Kristinn Hrafnsson, as well as people like Daniel Domscheit-Berg who now is starting his own version - Openleaks.org! Where is the secretive organization heading? Stronger than ever, or broken by the US? Who is Assange: champion of freedom, spy or rapist? What are his objectives? What are the consequences for the internet?&quot;', NULL, 0, 0, NULL, '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" width="580" height="476" id="viddler"><param name="movie" value="http://www.viddler.com/player/34bcbc18/" /><param name="allowScriptAccess" value="always" /><param name="allowFullScreen" value="true" /><param name="flashvars" value="fake=1"/><embed src="http://www.viddler.com/player/34bcbc18/" width="580" height="476" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" flashvars="fake=1" name="viddler" ></embed></object>'),
	(269, 'Who Killed the Electric Car? (2006)', '     	&quot;In 1996, electric cars began to appear on roads all over California. They were quiet and fast, produced no exhaust and ran without gasoline...........Ten years later, these cars were destroyed.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=1405611374523233913&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(270, 'Zeitgeist: Addendum (2008)', '       &quot;The second film, Zeitgeist: Addendum, attempts to locate the root causes of this pervasive social corruption, while offering a solution. This solution is not based not on politics, morality, laws, or any other &quot;establishment&quot; notions of human affairs, but rather on a modern, non-superstitous based understanding of what we are and how we align with nature, to which we are a part. The work advocates a new social system which is updated to present day knowledge, highly influenced by the life long work of Jacque Fresco and The Venus Project.&quot;\r\n            ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=7065205277695921912" allowfullscreen="true" flashvars="fs=true">'),
	(271, ' Great African Scandal, The (2007)', '&quot;In this thought-provoking documentary, made with the help of Christian Aid, academic Robert Beckford undertakes a challenging, emotional journey to Ghana in West Africa. This is where, two centuries ago, Robert Beckford&rsquo;s ancestors were seized and taken as slaves to Jamaica. Now he is making a journey to the land of his roots to discover the hidden costs of rice, chocolate and gold.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-6756318286045228473" allowfullscreen="true" flashvars="fs=true">'),
	(272, 'Unreported World: Egypt\'s Rubbish People', '&quot;Unreported World exposes a dark side to Egypt that the authorities don\'t want foreigners to see: a secretive society of around 40,000 people literally living in rubbish in a Cairo ghetto overrun by rats and disease.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.liveleak.com/e/406_1207620829"></param><param name="wmode" value="transparent"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.liveleak.com/e/406_1207620829" type="application/x-shockwave-flash" wmode="transparent" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(273, 'Dispatches: Beneath the Veil (2001)', '&quot;An anonymous woman, covered from head to toe in a blue burka, is dragged across a football pitch and shot in front of 30,000 spectators. This haunting image of Taliban justice was filmed secretly in Channel 4\'s award-winning documentary Beneath the Veil broadcast in June 2001. The woman was Zarmina, 35-year-old mother of seven. In a new Dispatches film, Lifting the Veil, Carla Garapedian went to Afghanistan to discover her story and see whether women\'s lives have improved since the fall of the Taliban.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-4201322772364661561" allowfullscreen="true" flashvars="fs=true">'),
	(274, 'Slavery: A Global Investigation (2002)', '&quot;Slavery is officially banned internationally by all countries, yet despite this, in the world today there are more slaves now than ever before. In the four hundred years of the slave trade around 13 million people were shipped from Africa. Today there are an estimated 27 million slaves - people paid no money, locked away and controlled by violence. Multi-Award winning documentary makers Kate Blewett and Brian Woods - who produced the groundbreaking films The Dying Rooms, Innocents Lost and Eyes of a Child, saw this terrible exploitation with their own eyes. The result is an utterly devastating film.&quot;', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=8510275415580537193&amp;hl=en&amp;fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(275, ' Tank Man, The (2004)', '&quot;Documentary about the lone man who stood before the tanks entering  Tiananmen Square during the June 1989 pro-democracy demonstrations. He  is then pulled back into the crowd, either by friends, fellow  demonstrators or government forces - no one knows for sure. And no one  knows who he was, to this day.&quot; -amazon.com ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=2300254722104314948" allowfullscreen="true" flashvars="fs=true">'),
	(276, 'Hooligans (2006)', '       Watch the rest on YouTube       &quot;Panorama carries out an undercover investigation into previously unreported hooligan violence at World Cup 2006.&quot;     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/OOTGe12Wu0U&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><embed src="http://www.youtube.com/v/OOTGe12Wu0U&hl=en&fs=1" type="application/x-shockwave-flash" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(277, 'Ross Kemp on Gangs - Moscow (2006)', '&quot;Ross uncovers the extent to which the Nazi, or National Socialist,  groups are gaining power in Russia: it would seem that at best the  police turn a blind eye to racism, at worse actively endorse it. And  Ross meets one Member of Parliament who openly promotes Nazi ideology.  Ross joins one Neo Nazi group during their training and through a  series of tests -which include him being set on fire - he gains their  trust. They invite him back to their secret headquarters where he meets  some seriously disturbing individuals and uncovers the heart of their  violent organisation.&quot;', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=4784767647228050785&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(278, 'Ross Kemp on Gangs - Poland (2006)', '&quot;Ross Kemp investigates Neo-nazi football Hooligans in Poland.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=8831046128904338535" allowfullscreen="true" flashvars="fs=true">'),
	(279, 'Taking Liberties (2007)', '       Watch the rest on YouTube       &quot;Right to Protest, Right to Freedom of Speech. Right to Privacy. Right not to be detained without charge, Innocent Until Proven Guilty. Prohibition from Torture. TAKING LIBERTIES will reveal how these six central pillars of liberty have been systematically destroyed by New Labour, and the freedoms of the British people stolen from under their noses amidst a climate of fear created by the media and government itself.&quot; ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/oP7Km_waRRI?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/oP7Km_waRRI?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(280, 'Inside Hamas (2008)', '       &quot;This candid film shows the reality of daily life in Gaza under Hamas, the \'Islamic Resistance Movement\' and asks if they can make the move to meaningful political force?&quot;       Directed by Rodrigo Vazquez     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1127653652241016730" allowfullscreen="true" flashvars="fs=true">'),
	(281, 'Occupation 101 (2006)', '       Watch the rest on Youtube       &quot;For decades many Americans have been deceived about the Palestinian-Israeli issue that appears to be locked in a never-ending conflict. \'Occupation 101\' is a film that exposes the root-cause of the Israeli-Palestinian conflict. In Addition it explains the reality of the situation through the voices of the silent majority of Israeli, Jewish, Christian, and Americans that are silenced through the mainstream media.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/-SbjAanvUqs?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/-SbjAanvUqs?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(282, 'Rageh Inside Iran', '&quot;Rageh Omaar embarks on a unique journey inside what he describes as  one of the most misunderstood countries in the world, looking at the  country through the eyes of people rarely heard - ordinary Iranians. It  took a year of wrangling to get permission to film inside Iran but the  result is an amazing portrayal of an energetic and vibrant country that  is completely different to the usual images seen in the media.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=9161934809152225169" allowfullscreen="true" flashvars="fs=true">'),
	(283, 'Suicide Killers (2006)', '&quot;This feature documentary takes the audience on a disturbing journey deep into a culture that few can comprehend -- that of suicide bombers. Filmmaker Pierre Rehov examines the phenomenon of suicide bombers through rare and never-before-seen interviews with actual family members of terrorists, the prisoners whose bombing attempts have been thwarted, and exclusive footage of a terror bomber as he prepares for mission! This film provides a message of urgency for increasing our understanding of the psychopathological dynamics of these terrorist bombers. We finally gain insight to how these human bombs \'tick\'. &quot; -imdb.com', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=-5671220264306422368&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(284, '10 MPH (2007)', '       &quot;10 MPH is a comical documentary that follows a pair of aspiring filmmakers as they quit their jobs and turn a friend\'s ludicrous idea into a movie. The impulsive purchase of a two-wheeled Segway scooter sets this story in motion when the two friends decide to travel from Seattle to Boston at 10 MPH in an attempt to change their lives forever... What ensues is a road trip like none other with a haphazard cast of characters you could only find on a zany 100-day trek through America\'s back roads. Each poignant story the two friends discover along the way inspires a craving inside to go out and do that thing you\'re supposed to do.&quot;       PLEASE SUPPORT OUR FILM, CLICK HERE: http://www.10mph.com/ourstage -\r\n         We\'ll get $1 for our next film and you will get a FREE iTunes download of 10 MPH.\r\n       Thank you -- Hunter &amp; Josh     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/DdR41fe9Zeg&rel=1"></param><param name="wmode" value="transparent"></param><embed src="http://www.youtube.com/v/DdR41fe9Zeg&rel=1" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476"></embed></object>'),
	(285, 'American Drug War: The Last White Hope (2007)', '       &quot;The War on Drugs has become the longest and most costly war in American history, the question has become, how much more can the country endure? Inspired by the death of four family members from &quot;legal drugs&quot; Texas filmmaker Kevin Booth sets out to discover why the Drug War has become such a big failure. Three and a half years in the making the film follows gang members, former DEA agents, CIA officers, narcotics officers, judges, politicians, prisoners and celebrities. Most notably the film befriends Freeway Ricky Ross; the man many accuse for starting the Crack epidemic, who after being arrested discovered that his cocaine source had been working for the CIA. AMERICAN DRUG WAR shows how money, power and greed have corrupted not just dope fiends but an entire government. More importantly, it shows what can be done about it. This is not some \'pro-drug\' stoner film, but a collection of expert testimonials from the ground troops on the front lines of the drug war, the ones who are fighting it and the ones who are living it.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-8231634812734884936&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(286, 'Anarchism in America (1983)', '       &quot;A colorful and provocative survey of anarchism in America, the film attempts to dispel popular misconceptions and trace the historical development of the movement. The film explores the movement both as a native American philosophy stemming from 19th century American traditions of individualism, and as a foreign ideology brought to America by immigrants. The film features rare archival footage and interviews with significant personalities in anarchist history including Murray Boochkin and Karl Hess, and also live performance footage of the Dead Kennedys.&quot; -imdb.com ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/p/A9A8175C7D4C744E?version=3&hl=en_US&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/p/A9A8175C7D4C744E?version=3&hl=en_US&fs=1" type="application/x-shockwave-flash" width="580" height="476" allowscriptaccess="always" allowfullscreen="true"></embed></object>'),
	(287, 'Aryan Brotherhood (2007)', '&quot;In the maximum-security prison world of murderers and rapists, they are  the most feared. With nicknames like &quot;The Beast&quot; and &quot;The Hulk,&quot; the  warriors of The Aryan Brotherhood are the most violent criminals behind  bars-men who strangle with their bare hands, shank guards, gouge out  their enemies\' eyes at the slightest sign of disrespect. We go behind  bars to unveil the secrets of the vicious gang of white supremacists in  prisons. Jailhouse interviews, surveillance footage that reveal their  deadly tactics.&quot;  -National Geographic', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="video" value="http://static.video.yandex.ru/lite/noopcwd/dp2bd4cf8o.305/"></param><param name="allowFullScreen" value="true"></param><param name="scale" value="noscale"></param><embed src="http://static.video.yandex.ru/lite/noopcwd/dp2bd4cf8o.305/" type="application/x-shockwave-flash" width="580" height="476" allowfullscreen="true" scale="noscale" ></embed></object>'),
	(288, 'Becoming 13 (2006)', '&quot;This smart documentary dares to explore the increasingly intimidating terrain of girlhood by following three 12 year-olds over the period of one year. As these girls move from childhood to maturity it\'s clear that peer pressure is an important influence, but as the films shows, the greatest influence in a young girl\'s life is family. Filmmaker Victoria King\'s creative approach, including the use of \'diary-cam\' footage, not only follows the girls but allows them to question the world in their own voices. Ultimately, the film reveals the complexities of being 12, both satisfying our curiousity and inviting us to ask, \'What happens next?\'&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always" autostart="false" autoplay="false" flashvars="mID=IDOBJ8951&bufferTime=10&width=580&height=476&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/becoming-13_big.jpg&autostart=false&autoplay=false&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL8951&embeddedMode=true">'),
	(289, 'Bowling for Columbine (2002)', '     	Watch the rest on YouTube     	&quot;The United States of America is notorious for its astronomical number  of people killed by firearms for a developed nation without a civil  war. With his signature sense of angry humour, activist filmmaker  Michael Moore sets out to explore the roots of this bloodshed. In doing  so, he learns that the conventional answers of easy availability of  guns, violent national history, violent entertainment and even poverty  are inadequate to explain this violence when other cultures share those  same factors without the equivalent carnage. In order to arrive at a  possible explanation, Michael Moore takes on a deeper examination of  America\'s culture of fear, bigotry and violence in a nation with  widespread gun ownership. Furthermore, he seeks to investigate and  confront the powerful elite political and corporate interests fanning  this culture for their own unscrupulous gain.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/hQo-orO8UHU&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/hQo-orO8UHU&hl=en&fs=1" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(290, 'Carts of Darkness (2008)', '&quot;Murray Siple\'s feature-length documentary follows a group of homeless men who have combined bottle picking with the extreme sport of racing shopping carts down the steep hills of North Vancouver. This subculture depicts street life as much more than the stereotypes portrayed in mainstream media. The film takes a deep look into the lives of the men who race carts, the adversity they face and the appeal of cart racing despite the risk. Shot in high-definition and featuring tracks from Black Mountain, Ladyhawk, Vetiver, Bison, and Alan Boyd of Little Sparta.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowscriptaccess="always" allowfullscreen="true" autostart="false" flashvars="mID=IDOBJ1351&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/cod-tv-big.jpg&width=516&height=337&autostart=false&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&embeddedMode=true">'),
	(291, 'Copwatch - These Streets Are Watching', '&quot;Copwatch (also Cop Watch) is a network of United States and Canadian volunteer organizations that &quot;police the police&quot;.  Copwatch groups usually engage in monitoring of the police, videotaping  police activity, educating the public about police misconduct, and  advocating for more accountable law enforcement practices&quot; -wikipedia', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-2298191316209203092&hl=en" allowfullscreen="true" flashvars="fs=true">'),
	(292, 'End of Liberty (2010)', '&quot;The National Inflation Association is pleased to announce the release of \'End of Liberty\', a new one-hour and fourteen minute documentary about how the United States is headed for hyperinflation and a complete societal collapse. \'End of Liberty\' is the most eye-opening film ever produced about the U.S. government. This could be the most important documentary ever released in our nation\'s history.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/AQv-sdMCClQ?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/AQv-sdMCClQ?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(293, 'Gladiator Days: Anatomy of a Prison Murder (2002)', '&quot;Across the United States, violent crime in prison is an everyday reality, with inmates routinely exposed to assault, riot, rape and murder.  Gladiator Days: Anatomy of a Prison Murder examines the culture of institutional violence through the events that led to one burtal prison murder. Utah State Prison surveillance cameras capture this disturbing real-life account of the vicious stabbing of black inmate Lonnie Blackmon by convicted murderer, white supremacist Troy Kell and his accomplice Eric Daniels&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/p/C9C4D34EEF362F05?version=3&hl=en_US&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/p/C9C4D34EEF362F05?version=3&hl=en_US&fs=1" type="application/x-shockwave-flash" width="580" height="467" allowscriptaccess="always" allowfullscreen="true"></embed></object>'),
	(294, 'Ground Truth: After the Killing Ends, The (2006)', '&quot;The Ground Truth stunned filmgoers at the 2006 Sundance and Nantucket  Film Festivals. Hailed as &quot;powerful&quot; and &quot;quietly unflinching,&quot;  Patricia Foulkrod\'s searing documentary feature includes exclusive  footage that will stir audiences. The filmmaker\'s subjects are  patriotic young Americans - ordinary men and women who heeded the call  for military service in Iraq - as they experience recruitment and  training, combat, homecoming, and the struggle to reintegrate with  families and communities. The terrible conflict in Iraq, depicted with  ferocious honesty in the film, is a prelude for the even more  challenging battles fought by the soldiers returning home - with  personal demons, an uncomprehending public, and an indifferent  government. As these battles take shape, each soldier becomes a new  kind of hero, bearing witness and giving support to other veterans, and  learning to fearlessly wield the most powerful weapon of all - the  truth.&quot; -imdb.com</span>', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-2459382896193581807" allowfullscreen="true" flashvars="fs=true">'),
	(295, 'Hacking Democracy (2006)', '       Watch the rest on YouTube       &quot;Electronic voting machines count about 87% of the votes cast in America today.    But are they reliable?  Are they safe from tampering?  From a current congressional   hearing to persistent media reports that suggest misuse of data and even outright fraud,   concerns over the integrity of electronic voting are growing by the day.  And if the voting   process is not secure, neither is America\'s democracy. The timely, cautionary documentary HACKING DEMOCRACY exposes gaping   holes in the security of America\'s electronic voting system.&quot;      ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/-hNxBa6KENE&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><embed src="http://www.youtube.com/v/-hNxBa6KENE&hl=en&fs=1" type="application/x-shockwave-flash" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(296, 'Half Ton Man (2005)', '&quot;Patrick Deuel is the world\'s heaviest man - almost 1100 pounds. This documentary opens with paramedics removing a wall of his house in Valentine, Nebraska and transporting him six hours to a hospital where he spent months trying to lose weight to qualify for a gastric bypass operation. This documentary moves among (primarily) Patrick and two others who are morbidly obese and their loved ones, neighbors and doctors. It examines how they got that way, what made them that way and how they have succeeded and failed in their struggles to change.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-162531092497573171" allowfullscreen="true" flashvars="fs=true">'),
	(297, 'Hearts and Minds (1974)', '&quot;This film recounts the history and attitudes of the opposing sides of the Vietnam War using archival news footage as well as their own film and interviews. A key theme is how attitudes of American racism and self-righteousness militarism helped create and prolong this bloody conflict. The film also endeaveors to give voice to the Vietnamese people themselves as to how the war has affected them and their reasons why they fight the United States and other western powers while showing the basic humanity of the people that US propaganda tried to dismiss.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-8502739857306070849" allowfullscreen="true" flashvars="fs=true">'),
	(298, 'Judgment Day: Intelligent Design on Trial', '&quot;PBS Nova: ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-404729062613200911" allowfullscreen="true" flashvars="fs=true">'),
	(299, 'Level Zero (2009)', '     	Watch the trailer    	  &quot;A documentary about Alameda County EMS... \'Level Zero\'. With over 110,000 calls for 911 in this system annually, an extremely busy system with a progressive medicine being the role model for many communities throughout the country. With over 1.5 million people living in Alameda, EMS serve and protect the citizens in their most critical hour. These are the faces that will bring you comfort as you dial 911. There is a sense of duty that is only surpassed by the passion to serve. It is because of this that the County of Alameda has become the premiere place for Paramedics and EMT\'s to hone their skills and gain experience necessary to be successful in EMS. This story will share the real lives of those in service and their impact on the community they serve.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="movie" value="http://www.vimeo.com/moogaloop.swf?clip_id=4901024&amp;server=www.vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00adef&amp;fullscreen=1" /><embed src="http://www.vimeo.com/moogaloop.swf?clip_id=4901024&amp;server=www.vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00adef&amp;fullscreen=1" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(300, 'Louis Theroux: Law &amp; Disorder (2008)', '       Watch the rest on Dailymotion       &quot;Louis Theroux joins the Philadelphia Police Department patrolling the most dangerous part of one of the most violent cities in America.&quot;     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.dailymotion.com/swf/video/x7pwwp?additionalInfos=0"></param><param name="allowFullScreen" value="true"></param><param name="allowScriptAccess" value="always"></param><embed type="application/x-shockwave-flash" src="http://www.dailymotion.com/swf/video/x7pwwp?additionalInfos=0" width="580" height="476" allowfullscreen="true" allowscriptaccess="always"></embed></object>'),
	(301, 'Medicating Kids (2001)', '&quot;In \'Medicating Kids,\' FRONTLINE examines the dramatic increase in the prescription of behavior-modifying drugs for children. Are these medications really necessary--and safe--for young children, or merely a harried nation\'s quick fix for annoying, yet age-appropriate, behavior?&quot;', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.nl/googleplayer.swf?docid=-9055413814104510828&hl=nl&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(302, 'Place Called Chiapas, A (1998)', '&quot;On January 1, 1994, the Zapatista National Liberation Army--made up of  impoverished Mayan Indians from the state of Chiapas--took over five  towns and 500 ranches in southern Mexico. The government deployed its  troops, and at least 145 people died in the ensuing battle. Fighting  for indigenous Mexicans to regain control over their lives and the  land, the Zapatistas and their charismatic leader, guerilla poet  Subcomandante Marcos, began sending their message to the world via the  Internet. The result was what THE NEW YORK TIMES called &quot;the world&rsquo;s  first postmodern revolution.&quot; Years into the uprising, filmmaker Nettie  Wild traveled to the jungle canyons of southern Mexico to film the  elusive and fragile life of the rebellion. Her camera effectively and  movingly captures the personal stories behind a very public clash of  traditional culture and globalization.&quot; -amazon.com', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=4513202692382805096&hl=en" allowfullscreen="true" flashvars="fs=true">'),
	(303, 'Ross Kemp on Gangs - Orange County (2006)', '&quot;Ross Kemp investigates Public Enemy No. 1 and the Neonazi Skinheads of Orange County, CA.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-6674599107070769895" allowfullscreen="true" flashvars="fs=true">'),
	(304, 'Secret Rulers of the World - The Legend of Ruby Ridge, The (2001)', '&quot;In the first episode of this five-part series, Jon Ronson covers the events of 21st August 1992, near Naples, Idaho, during which Randy Weaver, his family and a friend, came head-to-head with the US Marshals Service and the Federal Bureau of Investigation.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=-4565369222910430105&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(305, 'Sicko (2007)', '       Watch the rest on YouTube       &quot;A comedy about 45 million people with no health care in the richest country on earth.&quot; -imdb.com       Video: Moore Approves of Movie Pirating     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/a7pCaK0aASE?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/a7pCaK0aASE?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(306, 'Slacker Uprising (2007)', '&quot;\'Slacker Uprising\' takes place in the wake of \'Fahrenheit 9/11,\' during the run-up to the 2004 election, as I traveled for 42 days across America, visiting 62 cities in a failed attempt to remove George W. Bush from office. My goal was to help turn out a record number of young voters and others who had never voted before. (That part was a success. Young adults voted in greater numbers than in any election since 18-year-olds were given the right to vote. And the youth vote was the only age group that John Kerry won.) &quot; ', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-5587469256278477903&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(307, 'Super Size Me (2004)', '&quot;Why are Americans so fat? Two words: fast food. What would happen if  you ate nothing but fast food for an entire month? Filmmaker Morgan  Spurlock does just that and embarks on the most perilous journey of his  life. The rules? For 30 days he can\'t eat or drink anything that isn\'t  on McDonald\'s menu; he must wolf three squares a day; he must consume  everything on the menu at least once and supersize his meal if asked.  Spurlock treks across the country interviewing a host of experts on  fast food and an equal number of regular folk while chowing down at the  Golden Arches. Spurlock\'s grueling drive-through diet spirals him into  a physical and emotional metamorphosis that will make you think twice  about picking up another Big Mac.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476" data="http://o.snagfilms.com/film.swf" type="application/x-shockwave-flash" id="f-26"><param name="allowNetworking" value="all" /><param name="allowScriptAccess" value="always" /><param name="movie" value="http://o.snagfilms.com/film.swf" /><param name="wmode" value="transparent" /><param name="flashvars" value="id=26&cid=f-26-super_size_m" /></object>'),
	(308, 'Torture: America\'s Brutal Prisons (2005)', '&quot;Savaged by dogs, Electrocuted With Cattle Prods, Burned By Toxic Chemicals, Does such barbaric abuse inside U.S. jails explain the horrors that were committed in Iraq?&quot;', NULL, 0, 0, NULL, '<embed src="http://www.youtube.com/v/IWxpQ87C4t4" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476">'),
	(309, 'Children of the Secret State (2000)', '       Watch the rest on YouTube       &quot;Children of the Secret State\' is an investigation into North Korea, considered           by many as the last Stalinist dictatorship, a hidden and sealed country           riddled with propaganda and saturated with hostility to democracy and           the West.&quot; ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/xLpjNZA8PFY?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/xLpjNZA8PFY?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(310, 'Undercover in the Secret State (2005)', '&quot;CNN Presents: Undercover in the Secret State follows  Korean-American journalist Jung Eun Kim as she tracks down a new breed  of dissident in North Korea. These dissidents are using small digital  cameras and cell phones to show the world the brutal life inside North  Korea.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-4720227739408864997&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(311, 'Death of a Nation (2006)', ' 			&quot;Fifteen years after the fall of Communism, Marcel Theroux goes on a personal journey through Putin\'s Russia. 				 			He discovers a country that\'s literally dying.&quot; ', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=636418887164673686&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(312, 'Frontline - Sex Slaves (2005)', '&quot;Sex Slaves is a gripping documentary expose inside the global sex trade in women from the former Soviet Bloc. The film takes viewers into the shadowy, multi-billion dollar world of sex trafficking. Part cinema verit&eacute;, part investigation, Sex Slaves puts a human face on this most inhuman of contemporary issues. From the villages of Moldova and Ukraine, to underground brothels and discotheques in Turkey where many women are trafficked and forced into prostitution, we witness first-hand the brutal world of white sex slavery.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=456480507747515257" allowfullscreen="true" flashvars="fs=true">'),
	(313, 'Ross Kemp on Gangs - San Salvador', '&quot;Starting  in San Salvador the smallest, most densely populated and most dangerous  country in Central America, Ross immerses himself in the dangerous  world of the Mara Salvatruchaor MS13gang. &ldquo;El Salvador has a level of  violence that far exceeds any other country I&rsquo;ve been to.&rdquo; says Ross,  &ldquo;There are on average 11 murders a day in a country with a population  smaller than London.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=4221922153764278699" allowfullscreen="true" flashvars="fs=true">'),
	(314, ' War on Democracy, The (2007)', '&quot;Award winning journalist John Pilger examines the role of Washington in America\'s manipulation of Latin American politics during the last 50 years leading up to the struggle by ordinary people to free themselves from poverty and racism. Since the mid 19th Century Latin America has been the \'backyard\' of the US, a collection of mostly vassal states whose compliant and often brutal regimes have reinforced the \'invisibility\' of their majority peoples. The film reveals similar CIA policies to be continuing in Iraq, Iran and Lebanon. The rise of Venezuela\'s Hugo Chavez despite ongoing Washington backed efforts to unseat him in spite of his overwhelming mass popularity, is democratic in a way that we have forgotten or abandoned in the west. True Democracy being a solid 80% voter turnout in support of Chavez in over 6 elections.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-3739500579629840148" allowfullscreen="true" flashvars="fs=true">'),
	(315, 'World\'s Most Dangerous Gang (2006)', '&quot;Correspondent Lisa Ling documented the experience of filming this special from El Salvador to Los Angeles. Below are accounts of some of her chilling experiences, including finding out that she and her crew had been targeted for kidnapping and touring MS-13 controlled territory in Los Angeles with an active MS-13 member.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-8050801435890714263" allowfullscreen="true" flashvars="fs=true">'),
	(316, 'Aftermath: The Remnants of War (2001)', '&quot;Aftermath: The Remnants of War&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always" autostart="false" autoplay="false" flashvars="mID=IDOBJ1041&width=580&height=476&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2008/Aftermath-tv-big.jpg&autostart=false&autoplay=false&showWarningMessages=true&warningMessage=mature&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL1041&embeddedMode=true">'),
	(317, 'Before the Music Dies (2006)', ' 		  Watch the rest on YouTube 		  &quot;With outstanding performances and revealing interviews Before the Music Dies takes a critical look at the homogenization of popular music with commentary by some of the industry\'s biggest talents like Eric Clapton, Dave Matthews, Elvis Costello, Erykah Badu, Branford Marsalis, Bonnie Raitt and more.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/cNtZ_x5OHpc?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/cNtZ_x5OHpc?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(318, 'Bulgaria\'s Abandoned Children (2007)', '&quot;Director Kate Blewett visits a children\'s care home in Bulgaria and investigates the conditions in which the children live.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=944239315372248151&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(319, 'Bumfights: A Video Too Far (2004)', '     	Watch the rest on YouTube     	&quot;Documentary about the controversial BUMFIGHTS: A CAUSE FOR CONCERN phenomena. It covers the video itself, as well as the copycat cases that followed.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/Y5zky5fE_uE?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/Y5zky5fE_uE?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(320, 'Class Divided, A (1985)', '&quot;One day in 1968, Jane Elliott, a teacher in a small, all-white Iowa town, divided her third-grade class into blue-eyed and brown-eyed groups and gave them a daring lesson in discrimination. This is the story of that lesson, its lasting impact on the children, and its enduring power thirty years later.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=6189991712636113875" allowfullscreen="true" flashvars="fs=true">'),
	(321, 'Earthlings (2003)', '&quot;Narrated by Academy Award Nominee Joaquin Phoenix and featuring music by the critically acclaimed platinum artist Moby, EARTHLINGS is a documentary film about humankind\'s complete economic dependence on animals raised for pets, food, clothing, entertainment and scientific research. Using hidden cameras and never-before-seen footage, EARTHLINGS chronicles the day-to-day practices of the largest industries in the world, all of which rely entirely on animals for profit. Powerful, informative, controversial and thought-provoking, EARTHLINGS is by far the most comprehensive documentary ever produced on the correlation between nature, animals and human economic interests.&quot;', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=-5403685606111090415&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(322, 'Enemies of Reason, The (2007)', '&quot;Professor Richard Dawkins confronts the epidemic of irrational, superstitious thinking with logic, observation and evidence - in other words, through reason&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/p/0E7C2E0DD4ED128A?version=3&hl=en_US&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/p/0E7C2E0DD4ED128A?version=3&hl=en_US&fs=1" type="application/x-shockwave-flash" width="580" height="476" allowscriptaccess="always" allowfullscreen="true"></embed></object>'),
	(323, 'Fog of War: Eleven Lessons from the Life of Robert S. McNamara, The (2003)', '&quot;Robert S. McNamara discusses his experiences and lessons learned during his tenure as Secretary of Defense under John Kennedy and Lyndon Johnson. He talks about his work as a bombing statistician during World War II, his brief tenure as president of Ford Motor Company, and the Kennedy administration\'s triumph during the Cuban Missle Crisis. However, the film focuses primarily on his failures in Vietnam. The theme of the film are his &quot;eleven lessons&quot; learned during this time. Some of these include improving military efficiency, understanding your enemy, and the frustrations of trying to deal with (and unsuccessfully trying to change) human nature.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-8653788864462752804" allowfullscreen="true" flashvars="fs=true">'),
	(324, 'Frontline - Growing Up Online (2008)', '&quot;In Growing Up Online, FRONTLINE takes viewers inside the very public private worlds that kids are creating online, raising important questions about how the Internet is transforming childhood. \'The Internet and the digital world was something that belonged to adults, and now it\'s something that really is the province of teenagers,\' says C.J. Pascoe, a postdoctoral scholar with the University of California, Berkeley\'s Digital Youth Research project.&quot;', NULL, 0, 0, NULL, '<object width = "580" height = "476" > <param name = "movie" value = "http://www-tc.pbs.org/video/media/swf/PBSPlayer.swf" > </param><param name="flashvars" value="video=1082076027&player=viral&end=0" /> <param name="allowFullScreen" value="true"></param> <param name = "allowscriptaccess" value = "always" > </param><param name="wmode" value="transparent"></param><embed src="http://www-tc.pbs.org/video/media/swf/PBSPlayer.swf" flashvars="video=1082076027&player=viral&end=0" type="application/x-shockwave-flash" allowscriptaccess="always" wmode="transparent" allowfullscreen="true" width="580" height="476" bgcolor="#000000"></embed></object>'),
	(325, 'Gladiator Days: Anatomy of a Prison Murder (2002)', '&quot;Across the United States, violent crime in prison is an everyday reality, with inmates routinely exposed to assault, riot, rape and murder.  Gladiator Days: Anatomy of a Prison Murder examines the culture of institutional violence through the events that led to one burtal prison murder. Utah State Prison surveillance cameras capture this disturbing real-life account of the vicious stabbing of black inmate Lonnie Blackmon by convicted murderer, white supremacist Troy Kell and his accomplice Eric Daniels&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/p/C9C4D34EEF362F05?version=3&hl=en_US&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/p/C9C4D34EEF362F05?version=3&hl=en_US&fs=1" type="application/x-shockwave-flash" width="580" height="467" allowscriptaccess="always" allowfullscreen="true"></embed></object>'),
	(326, 'Horizon - How to Commit the Perfect Murder (2007)', '&quot;Modern forensic science should make it impossible to commit  murder and get away with it. But how easy would it be to outfox the  detectives? With the help of top forensic scientists, and real-life  murder investigations, we explore whether it\'s possible to commit a  perfect murder.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1807566009355608301" allowfullscreen="true" flashvars="fs=true">'),
	(327, 'Horizon - The Mystery of the Human Hobbit', '         Watch the rest on YouTube         &nbsp;         &quot;Is the hobbit a new human species or nothing more than a modern human with a crippling deformity?  On the far-flung island of Flores, in  the  Indonesian archipelago, a team of archaeologists happened upon a tiny  18,000-year old skeleton. It was no more than a metre tall. They  assumed they have found the remains of a young girl. But other signs  suggested she was in fact much older. They had discovered one of the  smallest human adults ever found.&quot;     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/TKSAncCIaK8?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/TKSAncCIaK8?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(328, 'Human Footprint, The (2007)', '       Watch the rest on YouTube       &quot;Documentray examining the amount of products consumed in a lifetime and the impact it has on the environment.&quot; -imdb.com ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/ey3rGFNPAgQ?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/ey3rGFNPAgQ?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(329, 'Meet Your Meat', '&quot;Meet Your Meat is a look behind the closed doors of today s giant meat, egg and dairy product industries, revealing the shocking truth about the abuse of animals for food.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-513747926833909134" allowfullscreen="true" flashvars="fs=true">'),
	(330, 'Scared Sacred (2004)', '&quot;Scared Sacred is a feature documentary that asks the question: Can we be Scared into the Sacred? The film takes us on a journey to the pivotal ground zeros of the world, places like Bosnia, Hiroshima, New York City and Afghanistan in search of stories of hope and meaning.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowscriptaccess="always" allowfullscreen="true" flashvars="mID=IDOBJ4981&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/ScaredSacred_big.jpg&width=580&height=337&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&embeddedMode=true">'),
	(331, 'Starsuckers (2009)', ' 		  Watch the rest on YouTube 		  &quot;Starsuckers is the most controversial documentary of the year, and was released in British cinemas in November 2009 to critical acclaim. It\'s a darkly humourous and shocking expos&eacute; of the celebrity obsessed media, that uncovers the real reasons behind our addiction to fame and blows the lid on the corporations and individuals who profit from it. Directed by Chris Atkins, BAFTA nominated for Taking Liberties, Starsuckers exploded into the news in October  when it emerged that the team had been selling fake celebrity stories to all the British Tabloids. This became a news sensation in it\'s own right, and was followed by the darker revelation that Atkins had secretly filmed four journalists for three Sunday tabloids  trying to buy medical records. The filmmakers also stung Max Clifford, who the film shows boasting about his clients on undercover camera. When Clifford found out, he hired the infamous law firm Carter Ruck and threatened to injunct the film which would have prevented it\'s release. The film ends with a damning critique of Bob Geldof\'s Live Aid and the star-studded Live 8 concerts in 2005.&quot; 		  Slow stream? Video also availabe at xtshare.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/um9gyx_XV50?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/um9gyx_XV50?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(332, 'Stupidity (2003)', '&quot;A lighthearted look at stupidity and ignorance in modern society, as  well as a brief history of the study of intelligence. Celebrities and  other notable personalities are interviewed on the subject of the  prevalence of stupidity in the media and culture.&quot; -imdb.com</span>', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-6646286420437586735" allowfullscreen="true" flashvars="fs=true">'),
	(333, ' Trap: What Happened to Our Dream of Freedom, The (2007)', '       &quot;The Trap is a series of three films by Bafta-winning producer Adam Curtis that explains the origins of our contemporary, narrow idea of freedom. It shows how a simplistic model of human beings as self-seeking, almost robotic, creatures led to today\'s idea of freedom. This model was derived from ideas and techniques developed by nuclear strategists during the Cold War to control the behaviour of the Soviet enemy.&quot;     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=404227395387111085" allowfullscreen="true" flashvars="fs=true">'),
	(334, 'Worse Than War (2009)', '&quot;WORSE THAN WAR documents Goldhagen&sup1;s travels, teachings, and interviews in nine countries around the world, bringing viewers on an unprecedented journey of insight and analysis. In a film that is highly cinematic and evocative throughout, he speaks with victims, perpetrators, witnesses, politicians, diplomats, historians, humanitarian aid workers, and journalists, all with the purpose of explaining and understanding the critical features of genocide and how to finally stop it.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/w7cZuhqSzzc?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/w7cZuhqSzzc?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(335, 'Zeitgeist: Addendum (2008)', '       &quot;The second film, Zeitgeist: Addendum, attempts to locate the root causes of this pervasive social corruption, while offering a solution. This solution is not based not on politics, morality, laws, or any other &quot;establishment&quot; notions of human affairs, but rather on a modern, non-superstitous based understanding of what we are and how we align with nature, to which we are a part. The work advocates a new social system which is updated to present day knowledge, highly influenced by the life long work of Jacque Fresco and The Venus Project.&quot;\r\n            ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=7065205277695921912" allowfullscreen="true" flashvars="fs=true">'),
	(336, 'AIDS Inc. (2007)', '&quot;AIDS, Inc. is a film about the multi-billion dollar AIDS industry, and how it profits from continuing fears and misconceptions about the disease. While AIDS grabs the headlines and raises billions of dollars with celebrity endorsements and billionaire endowments, we are no closer to finding a cure than when the scourge first appeared 30 years ago. Could it be that after so many years of research, and so much money being spent, that the entire orthodox medical establishment has been wrong about AIDS, or even worse, has sought to profit on a system that it knew was flawed from the beginning?&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1546322203061765598" allowfullscreen="true" flashvars="fs=true">'),
	(337, 'Bulgaria\'s Abandoned Children (2007)', '&quot;Director Kate Blewett visits a children\'s care home in Bulgaria and investigates the conditions in which the children live.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=944239315372248151&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(338, 'Half Ton Man (2005)', '&quot;Patrick Deuel is the world\'s heaviest man - almost 1100 pounds. This documentary opens with paramedics removing a wall of his house in Valentine, Nebraska and transporting him six hours to a hospital where he spent months trying to lose weight to qualify for a gastric bypass operation. This documentary moves among (primarily) Patrick and two others who are morbidly obese and their loved ones, neighbors and doctors. It examines how they got that way, what made them that way and how they have succeeded and failed in their struggles to change.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-162531092497573171" allowfullscreen="true" flashvars="fs=true">'),
	(339, 'Horizon - Total Isolation (2008)', '&quot;or the first time in 40 years Horizon re-creates a controversial sensory deprivation experiment. Six ordinary people are taken to a nuclear bunker and left alone for 48 hours. Three subjects are left alone in dark, sound-proofed rooms, while the other three are given goggles and foam cuffs, while white noise is piped into their ears.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.liveleak.com/e/f7b_1213549155"></param><param name="wmode" value="transparent"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.liveleak.com/e/f7b_1213549155" type="application/x-shockwave-flash" wmode="transparent" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(340, ' Human Footprint, The (2007)', '       Watch the rest on YouTube       &quot;Documentray examining the amount of products consumed in a lifetime and the impact it has on the environment.&quot; -imdb.com ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/ey3rGFNPAgQ?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/ey3rGFNPAgQ?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(341, 'In Lies We Trust: The CIA, Hollywood and Bioterrorism (2007)', '&quot;Are we winning the wars officials say we must?  Wars against cancer, AIDS and terrorism?&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-8674401787208020885" allowfullscreen="true" flashvars="fs=true">'),
	(342, 'Meet Your Meat', '&quot;Meet Your Meat is a look behind the closed doors of today s giant meat, egg and dairy product industries, revealing the shocking truth about the abuse of animals for food.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-513747926833909134" allowfullscreen="true" flashvars="fs=true">'),
	(343, 'Origins of AIDS, The (2003)', '&quot;From the hyphotesis of British journalist Edward Hoope, the film reopens the explosively controversial subject of the origins of AIDS, zeroing in specifically on his fiercely contested proposition that the HIV virus was first transmitted to children in the Belgian Congo via contaminated polio vaccine.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-2224046095510532365&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(344, 'Other Side of AIDS, The (2004)', '&quot;Take an unflinching look into an issue the mainstream media doesn\'t dare touch: the failure of the multi billion-dollar war on AIDS. The Other Side of AIDS gives voice to a growing movement of doctors, scientists, journalists, and HIV positives who reveal a tangled web of conflicts of interest, political correctness and unresolved errors surrounding AIDS.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-266890172132861595" allowfullscreen="true" flashvars="fs=true">'),
	(345, 'Super Size Me (2004)', '&quot;Why are Americans so fat? Two words: fast food. What would happen if  you ate nothing but fast food for an entire month? Filmmaker Morgan  Spurlock does just that and embarks on the most perilous journey of his  life. The rules? For 30 days he can\'t eat or drink anything that isn\'t  on McDonald\'s menu; he must wolf three squares a day; he must consume  everything on the menu at least once and supersize his meal if asked.  Spurlock treks across the country interviewing a host of experts on  fast food and an equal number of regular folk while chowing down at the  Golden Arches. Spurlock\'s grueling drive-through diet spirals him into  a physical and emotional metamorphosis that will make you think twice  about picking up another Big Mac.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476" data="http://o.snagfilms.com/film.swf" type="application/x-shockwave-flash" id="f-26"><param name="allowNetworking" value="all" /><param name="allowScriptAccess" value="always" /><param name="movie" value="http://o.snagfilms.com/film.swf" /><param name="wmode" value="transparent" /><param name="flashvars" value="id=26&cid=f-26-super_size_m" /></object>'),
	(346, 'Sicko (2007)', '       Watch the rest on YouTube       &quot;A comedy about 45 million people with no health care in the richest country on earth.&quot; -imdb.com       Video: Moore Approves of Movie Pirating     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/a7pCaK0aASE?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/a7pCaK0aASE?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(347, 'Sweet Misery: A Poisoned World (2004)', '&quot;Narrator Cori Brackett had a strange cause-and-effect experience with  the diet cokes she was drinking and quickly found herself disabled and  diagnosed with MS. Slowly able to walk and speak again, she believes  her illness is linked to aspartame. She is a co-owner of a video/film  production company. After 7000 miles, and 25 hours of footage, \'Sweet  Misery\' will reveal one of the most pervasive, insidious forms of  corporate negligence since tobacco.&quot;  -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-6551291488524526735&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(348, '4 Little Girls (1997)', '&quot;This film recounts the people and events leading up to the one of the most despicable hate-crimes during the height of the civil-rights movement, the bombing of the 16th Street Church in Birmingham, Alabama. In that attack, four little African-American girls lost their lives and a nation was simultaneously revolted, angered and galvanized to push the fight for equality and justice on.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.ca/googleplayer.swf?docid=-3302971953362876297&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(349, 'Aftermath: The Remnants of War (2001)', '&quot;Aftermath: The Remnants of War&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always" autostart="false" autoplay="false" flashvars="mID=IDOBJ1041&width=580&height=476&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2008/Aftermath-tv-big.jpg&autostart=false&autoplay=false&showWarningMessages=true&warningMessage=mature&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL1041&embeddedMode=true">'),
	(350, 'Assassination of Martin Luther King, The', '&quot;The most definitive video existing DOCUMENTING the FBI\'s conspiracy to kill MLK.              As MLK went above and beyond issues of Civil Rights,  the policy makers behind the secret curtain had to have him killed.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-3793111576487038398" allowfullscreen="true" flashvars="fs=true">'),
	(351, 'Conspiracy? FDR and Pearl Harbor (2005)', '&quot;There has been much debate as to how and why the United States had  been  caught unaware, and how much and when American officials knew of  Japanese plans and related topics. Some argue that various parties knew  of the attack in advance and may even have let it happen or encouraged  it in order to force America into war. film includes issues of  The Pearl Harbor advance-knowledge debate and others.&quot;', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-7736750907069936394" allowfullscreen="true" flashvars="fs=true">'),
	(352, 'Corporation, The (2003)', ' 		  &quot;Since the late 18th century American legal decision that the business  corporation organizational model is legally a person, it has become a  dominant economic, political and social force around the globe. This  film takes an in-depth psychological examination of the organization  model through various case studies. What the study illustrates is that  in the its behaviour, this type of &quot;person&quot; typically acts like a  dangerously destructive psychopath without conscience. Furthermore, we  see the profound threat this psychopath has for our world and our  future, but also how the people with courage, intelligence and  determination can do to stop it.&quot; -imdb.com ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/p/FA50FBC214A6CE87?version=3&hl=en_US&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/p/FA50FBC214A6CE87?version=3&hl=en_US&fs=1" type="application/x-shockwave-flash" width="580" height="476" allowscriptaccess="always" allowfullscreen="true"></embed></object>'),
	(353, 'Decoding the Past: Mayan Doomsday Prophecy', '&quot;The world is coming to an end on December 21, 2012! The ancient Maya  made this stunning prediction more than 2,000 years ago. We\'ll peel  back the layers of mystery and examine in detail how the Maya  calculated the exact date of doomsday. Journey back&nbsp;to the ancient city  of Chichen Itza, the hub of Maya civilization deep in the heart of  Mexico\'s Yucatan Peninsula, to uncover the truth about this prophecy.  The Maya were legendary astronomers and timekeepers--their calendar is  more accurate than our own. By tracking the stars and planets they  assigned great meaning to astronomical phenomena and made extraordinary  predictions based on them--many of which&nbsp;have come true. Could their  doomsday prophecy be one of them? In insightful interviews  archaeologists, astrologers, and historians speculate on the meaning of  the 2012 prophecy. Their answers are as intriguing as the questions.&quot; -history.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-2056220249702121896" allowfullscreen="true" flashvars="fs=true">'),
	(354, 'Hitler\'s Private World', '     	Watch the rest on YouTube     	&quot;When Adolf Hitler bought Eva Braun a movie camera, to film the people and parties which occurred at their Bavarian retreat, the technology  to include synchronized sound had not yet been developed.     		     		So when soldiers discovered Hitler\'s private home movies, in the Berlin bunker where the Nazi leader took his own life, the tantalizing clips they unearthed, featuring leading members of the SS in a more relaxed mode, remained silent for 60 years.     		     		Now, leading edge lip reading software has enabled German experts to re-voice these films and provide us with a chilling insight into Hitlers private world.&quot;     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/3Tk1BbrA5EY&hl=en&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/3Tk1BbrA5EY&hl=en&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(355, ' Living Dead - Three Films About the Power of the Past, The (1995)', '&quot;The Living Dead (subtitled Three Films About the Power of the Past) was the second major documentary series made by British film-maker Adam Curtis. This series investigated the way that history and memory (both national and individual) have been used by politicians and others. In three parts, it was transmitted on BBC Two in the spring of 1995.&quot; -wikipedia', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=1758338679527790685&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(356, 'Loss of Liberty (2002)', '&quot;The USS Liberty was an electronic intelligence-gathering ship that was  cruising international waters off the Egyptian coast on June 8, 1967.  Israeli planes and torpedo boats opened fire on the Liberty in the  midst of what became known as the Israeli-Arab Six-Day War. 34  Americans were killed and more than 170 were wounded in the attack.  Israel and its supporters have long maintained that the attack was a  \'tragic case of misidentification,\' an explanation that Lyndon  Johnson\'s administration did not formally challenge. Israel claimed its  forces thought the ship was an Egyptian vessel and apologized to the  United States. After the attack, a Navy court of inquiry concluded  there was insufficient information to make a judgment about why Israel  attacked the ship, stopping short of assigning blame or determining  whether it was an accident. On Wednesday, a former top Navy attorney  publicly said for the first time that President Lyndon Johnson and  Defense Secretary Robert McNamara ordered the U.S. military  investigation to conclude that the Israeli attack was an accident. The  attorney, retired Captain Ward Boston, said the White House ordered  investigators to \'conclude that the attack was a case of \'mistaken  identity\' despite overwhelming evidence to the contrary.\' Boston was  the senior legal counsel to the Navy\'s 1967 review of the attack. He  said he was prompted to come forward following the publication of the  recent book \'The Liberty Incident\' which concluded the attack was an  accident.&quot; -amazon.com ', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=4113285887114591367&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(357, 'Memphis Belle: A Story of a Flying Fortress, The (1944)', '&quot;Documentary about the 25th and last bombing mission of a B17, the  \'Memphis Belle\'. The \'Memphis Belle\' took part in a great bombing raid  on sub-pens in Wilhelmshafen, Germany. On their way they encounterd  heavy AA fire and interceptors.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/UMDSFAYDV-Y?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/UMDSFAYDV-Y?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(358, 'Mr. Death: The Rise and Fall of Fred A. Leuchter, Jr. (1999)', '&quot;Documentary about Fred Leuchter, an engineer who became an expert on  execution devices and was later hired by revisionist historian Ernst  Zundel to &quot;prove&quot; that there were no gas chambers at Auschwitz.  Leuchter published a controversial report confirming Zundel\'s position,  which ultimately ruined his own career. Most of the footage is of  Leuchter, puttering around execution facilities or chipping away at the  walls of Auschwitz, but Morris also interviews various historians,  associates, and neighbors.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=654178281151939378" allowfullscreen="true" flashvars="fs=true">'),
	(359, ' Origins of Christmas, The', '&quot;From the Greeks to Pagans to grafted Christian Holidays. Proof that the war on Christmas is a pathetic marketing tool for the Right&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=7606420729663402952" allowfullscreen="true" flashvars="fs=true">'),
	(360, 'Scared Sacred (2004)', '&quot;Scared Sacred is a feature documentary that asks the question: Can we be Scared into the Sacred? The film takes us on a journey to the pivotal ground zeros of the world, places like Bosnia, Hiroshima, New York City and Afghanistan in search of stories of hope and meaning.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowscriptaccess="always" allowfullscreen="true" flashvars="mID=IDOBJ4981&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/ScaredSacred_big.jpg&width=580&height=337&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&embeddedMode=true">'),
	(361, 'Sherlock Holmes: The True Story', '&quot;A documentary about the real life inspirations for Sherlock Holmes. A leading professor of medicine, Dr.  Joseph Bell is a pioneer in a new field, forensic science. Joseph Bell is the real life model for the greatest fictional detective in history. He inspired his student, Arthur Conan Doyle to create a legend. Includes interviews with literary historians and Holmes experts and asks the question what is it about this imaginary victorian detective seem so real.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-6874005371653227293" allowfullscreen="true" flashvars="fs=true">'),
	(362, 'Tank Man, The (2004)', '&quot;Documentary about the lone man who stood before the tanks entering  Tiananmen Square during the June 1989 pro-democracy demonstrations. He  is then pulled back into the crowd, either by friends, fellow  demonstrators or government forces - no one knows for sure. And no one  knows who he was, to this day.&quot; -amazon.com ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=2300254722104314948" allowfullscreen="true" flashvars="fs=true">'),
	(363, 'True Story of Che Guevara, The (2007)', '&quot;THE TRUE STORY OF CHE GUEVARA uncovers the real story of the life and death of this twentieth century icon.&quot; -newvideo.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=5762714709014580290" allowfullscreen="true" flashvars="fs=true">'),
	(364, 'U.S. vs. John Lennon, The (2006)', '&quot;A documentary on the life of John Lennon, with a focus on the time in  his life when he transformed from a musician into an antiwar activist.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=777046699234389996" allowfullscreen="true" flashvars="fs=true">'),
	(365, 'Walking with Dinosaurs (1999)', '&quot;Using the latest technology the amazing lost world of the Cretaceous, Triassic and Jurassic periods of Earth\'s history, when the dinosaurs reigned supreme, is brought stunningly back to life. The series provides insights into how these mammoth creatures appeared, how they survived for millions of years and probes the mysteries of their sudden disappearance leaving only a fossil record to show they had ever existed!&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-4312370814621987479" allowfullscreen="true" flashvars="fs=true">'),
	(366, 'Walking with Monsters (2005)', '       &quot;A 90-minute documentary about life before the dinosaurs. Starting from the Cambrian Period (530 MYA) and ending at the Early Triassic Period (248 MYA), Walking With Monsters shows the life and death struggles prehistoric creatures before the dinosaurs went through. It also portrays an accurate picture of our first ancestors.&quot;       Watch part 2 and 3 on Google Video     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-5510417670090664089" allowfullscreen="true" flashvars="fs=true">'),
	(367, 'Zeitgeist (2007)', '       &quot;Zeitgeist was created as a nonprofit filmiac expression to inspire people to start looking at the world from a more critical perspective and to understand that very often things are not what the population at large think they are. The information in Zeitgeist was established over a year long period of research and the current Source page on this site lists the basic sources used / referenced and the Interactive Transcript includes exact source references and further information.&quot;\r\n            ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="movie" value="http://vimeo.com/moogaloop.swf?clip_id=13726978&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=1&amp;show_portrait=1&amp;color=&amp;fullscreen=1&amp;autoplay=0&amp;loop=0" /><embed src="http://vimeo.com/moogaloop.swf?clip_id=13726978&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=1&amp;show_portrait=1&amp;color=&amp;fullscreen=1&amp;autoplay=0&amp;loop=0" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(368, 'Beat This!: A Hip Hop History (1984)', '&quot;Beat This: A Hip-Hop History is a 1984 BBC documentary film about hip-hop culture, directed by Dick Fontaine.[1] The cast includes Afrika Bambaataa, DJ Kool Herc &mdash; the film includes footage from Herc\'s original dance parties &mdash; The Cold Crush Brothers, Jazzy Jay, Brim Fuentes, and The Dynamic Rockers.[2] It is narrated by Imhotep Gary Byrd.[3][4] Originally part of the Arena television series, it was among the first crop of documentaries about hip-hop.&quot; -wikipedia', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=3972671039973659170&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(369, 'Before the Music Dies (2006)', ' 		  Watch the rest on YouTube 		  &quot;With outstanding performances and revealing interviews Before the Music Dies takes a critical look at the homogenization of popular music with commentary by some of the industry\'s biggest talents like Eric Clapton, Dave Matthews, Elvis Costello, Erykah Badu, Branford Marsalis, Bonnie Raitt and more.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/cNtZ_x5OHpc?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/cNtZ_x5OHpc?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(370, 'Bruce Lee: The Legend Lives On (2002)', '&quot;This program provides a detailed and unique look into the qualities, both physical and philosophical, that drove Bruce Lee to international stardom. This film pieces together rare early footage of Bruce practising and teaching his own form of martial arts, Jeet Kun Do, and explains the power held within the \'one inch\' punch, together with in-depth interviews with the people that knew and worked with Lee.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=1058332466922753689" allowfullscreen="true" flashvars="fs=true">'),
	(371, 'Ctrl Alt Shift (2009)', '&quot;Ctrl Alt shift is a documentary that explores VJ culture. Looking at VJing, Audio Visual works and live performance cinema. The documentary was filmed in various locations within the U.K including London, Leeds, Bloc music festival, Cornwall and more!&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"> 			<param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="movie" value="http://vimeo.com/moogaloop.swf?clip_id=4676745&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=1&amp;show_portrait=0&amp;color=&amp;fullscreen=1" /><embed src="http://vimeo.com/moogaloop.swf?clip_id=4676745&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=1&amp;show_portrait=0&amp;color=&amp;fullscreen=1" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(372, 'Freshest Kids, The (2002)', '       Watch the rest on YouTube       &quot;Breaking... Born at Kool D.J. Herc\'s House parties in the early \'70s,  catapulted to a worldwide phenomenon in the \'80s, and now experiencing  its latest gravity-defying incarnation as a thriving underground  movement, \'The Freshest Kids\' brings to you the illest B-Boying this  planet has ever witnessed. Over two hours of hardcore breaking gives  you an all-access pass to the underground world of B-Boys spanning the  last 25+ years. See and hear the early history via rare archival  footage and exclusive interviews with The Nigga Twins, Spy (the man  with 1000 moves), Rock Steady Crew icons Crazy Legs and Ken Swift, The  New York City Breakers, Mr. Wiggles, Styelements and the world\'s most  innovative B-boys of the next generation along with hip-hop legends  Kool D.J. Herc, Afrika Bambaataa, KRS-One, Mos Def and many more as  they come together to reveal for the first time the most comprehensive  history of B-Boying, its evolution and its place within hip-hop culture  and beyond. These are The Freshest Kids and this is their story!&quot; -imdb.com ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/Uizp9UYdKKw?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/Uizp9UYdKKw?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(373, 'Godfather and the Mob, The (2006)', '&quot;The untold story of the real life Mafia&rsquo;s involvement in the making of Coppola&rsquo;s &lsquo;The Godfather&rsquo;&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=5468395812563230682" allowfullscreen="true" flashvars="fs=true">'),
	(374, 'Jimi Hendrix at Woodstock (1992)', '&quot;The entire concert of Jimi Hendrix performing at the Woodstock festival in 1969.&quot;', NULL, 0, 0, NULL, '<embed src="http://player.youku.com/player.php/sid/XMjE3MTQ3MTg0/v.swf" allowfullscreen="true" quality="high" width="580" height="476" align="middle" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(375, 'Live Aid: Rockin\' All Over the World (2005)', '&quot;BBC Documentary telling the story of Live Aid, the biggest concert of all time which raised millions for the starving in africa.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=1685619231581116299" allowfullscreen="true" flashvars="fs=true">'),
	(376, 'Living in the Hard Hat Zone (2007)', '&quot;This rockumentary pulls no punches. This is the rock and roll circus as seen from the ringmaster\'s flea-ridden y-fronts... peep through your fingers if you dare.&quot; Selwyn Tripe, Film Review Gazette Eddie Izzard made them the house-band for his TV show, they dropped a ladder on Big Brother\'s Pete Bennett when he was 5, rocked New York on BBC\'s Whicker\'s World, then got kicked out of Holland! \'Living in the Hard Hat Zone\' charts The Vulcans\' rise from their humble beginnings on the south coast of England to become one of the best live acts in the country. Without doubt, one of the most revealing rockumentaries ever made.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-6700451554761435485&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(377, 'Making \'The Shining\' (1980)', '&quot;This documentary is followed around Jack Nicholson as he prepared for the \'Here\'s Johnny!\' scene and interviewed the actors about there relationship with Stanley Kubrick, the scripts and scene.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=6588011823460938946" allowfullscreen="true" flashvars="fs=true">'),
	(378, 'Rhyme &amp; Reason (1997)', '&quot;A study in the world of hip-hop, done mostly with interviews, in order  to see why it is as popular as it is today and what the future holds.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=6821011409594651929" allowfullscreen="true" flashvars="fs=true">'),
	(379, 'RiP! A Remix Manifesto (2008)', '&quot;Immerse yourself in the energetic, innovative and potentially illegal world of mash-up media with RiP: A remix manifesto. Let web activist Brett Gaylor and musician Greg Gillis, better known as Girl Talk, serve as your digital tour guides on a probing investigation into how culture builds upon culture in the information age.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowscriptaccess="always" allowfullscreen="true" flashvars="mID=IDOBJ12743&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2010/rip_remix_tv_big2.jpg&width=516&height=337&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&embeddedMode=true">'),
	(380, 'Stanley Kubrick\'s Boxes (2008)', '     	&quot;Two years after Kubrick\'s death, Jon Ronson was invited to the director\'s estate to explore the hundreds of boxes the legendary film director had collected during his decades at Childwick Manor in Hertfordshire. He\'s been returning ever since, and the story of Kubrick and the archive, now housed at University of the Arts London, is revealed in this fascinating documentary.&quot;     	', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/Vic2rVsx71I&hl=en&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/Vic2rVsx71I&hl=en&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(381, '11th Hour, The (2007) ', '&quot;A look at the state of the global environment including visionary and practical solutions for restoring the planet\'s ecosystems.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-7008000065780397277&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(382, 'Baraka (1992)', '     	&quot;The word Baraka means \'blessing\' in several languages;  watching this film, the viewer is blessed with a dazzling barrage of  images that transcend language. Filmed in 24 countries and set to an  ever-changing global soundtrack,  the movie draws some surprising connections between various peoples and  the spaces they inhabit, whether that space is a lonely mountaintop or  a crowded cigarette factory. Some of these attempts at connection are  more successful than others: for instance, an early sequence segues  between the daily devotions of Tibetan monks, Orthodox Jews, and  whirling dervishes, finding more similarity among these rituals than  one might expect. And there are other amazing moments, as when sped-up  footage of a busy Hong Kong intersection reveals a beautiful symmetry  to urban life that could only be appreciated from the perspective of  film.&quot; -amazon.com  ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="video" value="http://static.video.yandex.ru/lite/wakingsun/gm4m8do58a.308/"></param><param name="allowFullScreen" value="true"></param><param name="scale" value="noscale"></param><embed src="http://static.video.yandex.ru/lite/wakingsun/gm4m8do58a.308/" type="application/x-shockwave-flash" width="580" height="476" allowfullscreen="true" scale="noscale" ></embed></object>'),
	(383, 'Doomsday Called Off (2004)', '&quot;A critical examination of the prevalent view that human endeavors are causing a possibly catastrophic global climate change.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-3309910462407994295" allowfullscreen="true" flashvars="fs=true">'),
	(384, 'Earthlings (2003)', '&quot;Narrated by Academy Award Nominee Joaquin Phoenix and featuring music by the critically acclaimed platinum artist Moby, EARTHLINGS is a documentary film about humankind\'s complete economic dependence on animals raised for pets, food, clothing, entertainment and scientific research. Using hidden cameras and never-before-seen footage, EARTHLINGS chronicles the day-to-day practices of the largest industries in the world, all of which rely entirely on animals for profit. Powerful, informative, controversial and thought-provoking, EARTHLINGS is by far the most comprehensive documentary ever produced on the correlation between nature, animals and human economic interests.&quot;', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=-5403685606111090415&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(385, 'New Swirled Order (2009)', ' 			Watch the rest on YouTube 			&quot;Where does this mysterious crop circle phenomena come from? Is it done by man as a joke? So why do people have extraordinary experiences then? Flying ball of lights were seen in and around crop cirlces. Or is it an alien intelligence which try to communicate with us? The geometry which can be found in crop circles, inculed a lot of mathematics which can be also found in nature. 			Our new documentary \'New swirled order\' deals with these questions and present some very extraordinary Crop circle formations in 2008, like the \'Pi\'-formation in Barbury Castle or the Crop Circle near Avebury Manor, which showed our solar system with the planetary constellation of December 21 of 2012.&quot; 		', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/DjTsO3s24dM?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/DjTsO3s24dM?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(386, ' Ultimate Predators (2000)', '       &quot;Predators, a series of six half-hour films starting on 4 May, uses miniaturised cameras mounted on the hunters themselves to show the chase from their perspective. The series also uses action replays and computer animations, allowing it to analyse the tactics of predator and prey from every angle. It shows that both are often evenly matched, with no room on either side for the slightest mistake.&quot;     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=3882529307936397855" allowfullscreen="true" flashvars="fs=true">'),
	(387, 'Walking with Dinosaurs (1999)', '&quot;Using the latest technology the amazing lost world of the Cretaceous, Triassic and Jurassic periods of Earth\'s history, when the dinosaurs reigned supreme, is brought stunningly back to life. The series provides insights into how these mammoth creatures appeared, how they survived for millions of years and probes the mysteries of their sudden disappearance leaving only a fossil record to show they had ever existed!&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-4312370814621987479" allowfullscreen="true" flashvars="fs=true">'),
	(388, 'Walking With Lions (2002)', '&quot;Walking with Lions takes us to a remote corner of the Zambezi Valley in northern Zimbabwe. Here, a remote spring serves as the sole source of water for thousands of wild animals during the harsh eight-month dry season. They trek from afar to slake their thirst in a death trap: an African spring surrounded by a pride of lions. Witness the conflict faced between satisfying their need to drink while walking the gauntlet into a narrow gorge harbouring hidden predators.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=7592341395951782790" allowfullscreen="true" flashvars="fs=true">'),
	(389, 'Walking with Monsters (2005)', '       &quot;A 90-minute documentary about life before the dinosaurs. Starting from the Cambrian Period (530 MYA) and ending at the Early Triassic Period (248 MYA), Walking With Monsters shows the life and death struggles prehistoric creatures before the dinosaurs went through. It also portrays an accurate picture of our first ancestors.&quot;       Watch part 2 and 3 on Google Video     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-5510417670090664089" allowfullscreen="true" flashvars="fs=true">'),
	(390, 'Wave That Shook the World (2005)', '&quot;Experts econstruct the 2004 Indian Ocean tsunami in an effort to prepare for the next big one&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1132647693676039760" allowfullscreen="true" flashvars="fs=true">'),
	(391, 'Weird Nature - Puzzling Partners (2002)', '&quot;This BBC/DISCOVERY series reveals some of the strangest behaviour in the animal world.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=1253125755067724610" allowfullscreen="true" flashvars="fs=true">'),
	(392, 'Wolves (1999)', '&quot;Take a journey into the world of WOLVES as these amazing animals work and play while struggling to survive against the elements.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=1152159969691879963" allowfullscreen="true" flashvars="fs=true">'),
	(393, 'Area 51: The Alien Interview (1997)', '&quot;A documentary about aliens and UFOs with re-enactments of alien interviews and video of a supposedly real video of an alien being interviewed by government officials.&quot;  -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-4114414828759545020" allowfullscreen="true" flashvars="fs=true">'),
	(394, 'Black Box: UFO Secrets (2006)', '       Missing 17 minutes from the end. You can watch this doc on Youtube in 5 parts.       &quot;Reveals for the first time the cockpit and control tower audio  recordings of pilot and astronaut confrontations and sightings of  unidentified flying  objects high in our skies. From a detailed account of one of the very  the first reported pilot case, the Arnold case in 1947, to recent  recordings  over New England and Texas, to NASA recordings and video from 2005,  this special features interviews with pilots, witness and experts,  including  UCLA\'s Joseph Nagy, actor Ed Asner, and pilot/UFO researcher Don  Berliner&quot;     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=8614351526846808167" allowfullscreen="true" flashvars="fs=true">'),
	(395, 'Conspiracy? Area 51', '&quot;In southern Nevada, there exists a 575 square mile block of land that goes by many names: The Box, Paradise Ranch, Groom Lake, Watertown Strip and Dreamland. But most refer to this mysterious region as Area 51. Since the late 1950&rsquo;s the skies above Dreamland have been home to an array of unidentified flying objects. Locals here know that sightings of curios lights and other unexplained phenomena are commonplace. In 1989, the revelations of Bob lazar, a Las Vegas resident, brought the strange goings-on at Area 51 to a national audience. He claimed to have amazing inside information on the stark terrain 90 miles north of Las Vegas. Known as Area 51, this outpost is one of the most mysterious locations on the face of the earth, that until recently the government denied its existence.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-7894334334925055702" allowfullscreen="true" flashvars="fs=true">'),
	(396, 'Dan Aykroyd Unplugged on UFOs (2005)', '&quot;Dan Aykroyd Unplugged on UFOs explores past and present sightings from  around the world with shocking real footage, much of it never before  seen, that will leave even the most skeptical viewers scratching their  heads. Along with the fascinating collection of stunning eyewitness  videos, Akroyd reveals his own vast knowledge of the strange and  paranormal as he explores in detail his views on conspiracy theories,  military secrets, and how UFO technology is currently part of our  everyday lives!  &quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-8993422112864357113" allowfullscreen="true" flashvars="fs=true">'),
	(397, 'Derren Brown Investigates: The Man with X-Ray Eyes (2010)', '&quot;Derren is accompanied by blind British woman Judy Dunk on his second journey into the world of the extraordinary. They travel to Holland to meet Vyacheslav Bronnikov, who claims to be able to teach the blind to psychically see again.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/p/885F3FD09C1FBBC5?version=3&hl=en_US&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/p/885F3FD09C1FBBC5?version=3&hl=en_US&fs=1" type="application/x-shockwave-flash" width="580" height="476" allowscriptaccess="always" allowfullscreen="true"></embed></object>'),
	(398, 'Evidence: The Case For NASA UFOs (2001)', '&quot;One of the best and most interesting documentaries on the UFO subject.  The evidence presented here is some of the most best I have seen. I can  really understand that NASA has stopped their transmissions fram the  space shuttle.... And it is obvious they know a lot more than they tell  the public. Lets hope David Sereda\'s excellent video will put more  pressure on them, so they will come out with what they REALLY know.&quot; -amazon.com', NULL, 0, 0, NULL, '<embed src="http://player.ku6.com/refer/vPT3Lrw_S2lHYv7l/v.swf" quality="high" width="580" height="476" align="middle" allowscriptaccess="always" allowfullscreen="true" type="application/x-shockwave-flash">'),
	(399, 'New Swirled Order (2009)', ' 			Watch the rest on YouTube 			&quot;Where does this mysterious crop circle phenomena come from? Is it done by man as a joke? So why do people have extraordinary experiences then? Flying ball of lights were seen in and around crop cirlces. Or is it an alien intelligence which try to communicate with us? The geometry which can be found in crop circles, inculed a lot of mathematics which can be also found in nature. 			Our new documentary \'New swirled order\' deals with these questions and present some very extraordinary Crop circle formations in 2008, like the \'Pi\'-formation in Barbury Castle or the Crop Circle near Avebury Manor, which showed our solar system with the planetary constellation of December 21 of 2012.&quot; 		', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/DjTsO3s24dM?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/DjTsO3s24dM?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(400, 'Mysterious Origins of Man (1996)', '&quot;This unique documentary questions commonly-held beliefs about man\'s evolution. In the video, a group of modern-day scientists presents new  evidence about the origins of man they say most members of the academic community have ignored. Among their findings: human artifacts and bones discovered in rock strata millions of years older than the theory of evolution can account for.&quot;', NULL, 0, 0, NULL, '<embed src="http://krishnatube.com/nvplayer.swf?config=http://krishnatube.com/nuevo/econfig.php?key=495c2a83e53ed35838de" width="580" height="476" wmode="transparent" allowscriptaccess="always" allowfullscreen="true" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" />'),
	(401, 'Out of the Blue - The Definitive Investigation of the UFO Phenomenon (2003)', '       Also available on YouTube       &quot;This                   award-winning documentary reveals, through exclusive interviews                   with high-ranking military and government personnel, that some                   Unidentified Flying Objects could be of extraterrestrial origin.                   The film, narrated by PETER COYOTE, brings to light how secrecy                   and ridicule are used to shroud the UFO issue.&quot;     ', NULL, 0, 0, NULL, '<embed id="VideoPlayback" style="width:580px;height:476px" allowfullscreen="true" src="http://video.google.com/googleplayer.swf?docid=5545276251937701731&hl=en&fs=true" type="application/x-shockwave-flash">'),
	(402, 'Roswell Incident, The (1995)', '&quot;Documentary from Channel 4 shown in 1994 about the infamous \'UFO Crash\' at Roswell in 1947.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=9182185773538640886" allowfullscreen="true" flashvars="fs=true">'),
	(403, 'Secret, The (2006)', '     	&quot;The Secret is a feature length movie presentation which reveals The  Great Secret of the universe. It has been passed throughout the ages,  traveling through centuries... This is The Secret to everything - the  secret to unlimited joy, health, money, relationships, love, youth:  everything you have ever wanted. All the resources you will ever need  to understand and live The Secret. The world\'s leading scientists,  authors, and philosophers will reveal The Secret that utterly  transformed the lives of every person who ever knew it... Plato,  Newton, Carnegie, Beethoven, Shakespeare, Einstein.&quot; -imdb.com    	</span>', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=8039702275464206997&hl=fi&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(404, ' Secret KGB UFO Files, The (1998)', '       Watch the rest on YouTube       &quot;For five decades, American agencies have stockpiled information on UFOs. So did their counterparts behind the iron curtain. Soldiers, scientists and spies all paint a disturbing picture of the KGB\'s secret campaign. The UFO encounter that almost sparked a nuclear war. The pair of MiG fighters that tried to shoot down a UFO - both jets blown out of the sky! Stunning proof that the Soviets recovered something not from this earth! Amazing film footage smuggled out of Russia. This exclusive investigation into one of the most compelling events of our time is hosted by Roger Moore.&quot; -imdb.com ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/XL4jsCRV3rc?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/XL4jsCRV3rc?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(405, 'Secret NASA Transmissions: The Smoking Gun, The (2001)', '&quot;EBE Award Winner! Best Film - International UFO Congress Film Festival. On March 11, 2000, in front of an assembled audience of UFO enthusiasts and the media, evidence was presented that would appear to indicate the existence of, not one, but two types of unknown extraterrestrial lifeforms. Labeled \'Phenomena One\' and \'Phenomena Two\' by a man who spent several years recording and logging thousands of hours of NASA space shuttle transmissions, this "historic" footage and the story that lay behind its discovery can now be revealed&quot; - Amazon.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-3611205436090721403" allowfullscreen="true" flashvars="fs=true">'),
	(406, 'Secrets of the Psychics (1993)', '&quot;Can psychics predict the future? Many people seem to think so. Others argue that, in most cases, so-called psychic experiences are really misinterpretations of events. In this episode of NOVA, magician and confirmed skeptic James Randi challenges viewers to weigh the evidence for and against the existence of psychic phenomena.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/p/271477956B3C9A35?version=3&hl=en_US&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/p/271477956B3C9A35?version=3&hl=en_US&fs=1" type="application/x-shockwave-flash" width="580" height="476" allowscriptaccess="always" allowfullscreen="true"></embed></object>'),
	(407, 'UFO\'s: The Secret Evidence (2005)', '       &quot;Finally revealed: What the World Governments really know about UFOs. This film includes 44 original UFO films from all around the world, most of them never shown before, including films from the archives of NASA and the U.S. Air Force.&quot;     ', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-834605691449249469&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(408, 'UFO - The Greatest Story Ever Denied (2006)', '       Note: this is a rough-cut version with un-mixed sound. An authorized clean and re-edited version will be featured soon provided by the filmmaker for free.       &quot;The official denial and             the ridicule began in 1942 with the Battle of Los Angeles, where a UFO             was fired upon by our military that could not bring it down. The release             of this film brings an end to over sixty years of official denial.&quot;     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-5980990221766439646" allowfullscreen="true" flashvars="fs=true">'),
	(409, 'Unsolved Mysteries - The Roswell Incident (1989)', '       &quot;Unsolved Mysteries, The Most Excellent TV show, hosted by the late Robert Stack. This episode is about Roswell (NM) incident which  ... all &raquo; happened back in 1947 (Mack Brazel, Bob Lazar, Glen Dennis, Jesse Marcel, George Knapp, Stanton Friedman, Barney Barnet, Majority 12, Majestic 12,Majic. Roswell/Area 51 Connection Hudson Valley UFO Belgian UFO Falcon Lake UFO UFO Healing&quot;     ', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=9182185773538640886&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(410, 'World\'s Greatest Conspiracy Theories (2004)', '&quot;Looks at some of the conspiracy theories that have abounded regarding alien abductions, moon landings, Kennedy\'s assasination, the death of Princess Diana, and government mind control experiments. Also rumours that Hitler and Elvis faked their deaths.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-5602679622368188669&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(411, 'American Dream, The (2010)', '&quot;The AMERICAN DREAM is a 30 minute animated film that shows you how you\'ve been scammed by the most basic elements of our government system. All of us Americans strive for the American Dream, and this film shows you why your dream is getting farther and farther away. Do you know how your money is created? Or how banking works? Why did housing prices skyrocket and then plunge? Do you really know what the Federal Reserve System is and how it affects you every single day? THE AMERICAN DREAM takes an entertaining but hard hitting look at how the problems we have today are nothing new, and why leaders throughout our history have warned us and fought against the current type of financial system we have in America today. You will be challenged to investigate some very entrenched and powerful institutions in this nation, and hopefully encouraged to help get our nation back on track.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/a6OQzH07u0U?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/a6OQzH07u0U?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(412, 'Betty Boop: Minnie the Moocher (1932)', '&quot;Betty Boop and Bimbo run away from home, but that night they are scared by a chorus of ghosts singing the title song.&quot; -imdb.com</span>', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=2683613321391359141" allowfullscreen="true" flashvars="fs=true">'),
	(413, 'Bugs Bunny: Ali Baba Bunny (1957)', '&quot;Bugs and Daffy are tunnelling their way to a vacation spot (with Bugs  doing all the work, naturally), when a wrong turn lands them in a cave  in the middle of the desert. Daffy\'s true nature once again shines  through when the cave is discovered to be full of treasure. Daffy\'s  glee quickly turns to terror, however, when Hassan the guard (whose  only orders are &quot;chop!&quot;) catches him with his hands in the gold.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/agLwIxiEk_c?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/agLwIxiEk_c?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(414, 'Cartoon All-Stars to the Rescue (1990)', '&quot;Many different cartoon stars like Bugs Bunny, the Muppet Babies and Garfield join forces to convince a boy that drugs aren\'t cool.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=709471084170784075&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(415, 'Christmas Cracker (1963)', '&quot;This short animation consists of three segments that take a playful look at Christmas: a rendition of \'Jingle Bells\' in which paper cut-out figures dance, a dime-store rodeo of tin toys, and a story of decorating the perfect Christmas tree. This holiday film received many awards and an Oscar nomination.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always"  flashvars="mID=IDOBJ218&bufferTime=10&width=580&height=476&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2008/christmas_cracker_big_tv.jpg&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL179&embeddedMode=true">'),
	(416, 'Destination Earth (1956)', '&quot;The American Petroleum Institute presents \'Destination Earth\' Color by Technicolor... The cartoon begins by establishing the planet Mars, ruled by a dictator named Ogg. The martians are small green guys with big noses and space helmets. The poor guys are herded by soldiers into a space-age colliseum where Ogg forces them to applaud as they hear his criticisms of problems with martian ground transportation -- no good fuel and too much friction. A single martian is sent to Earth to find a solution. The intrepid Martian crashes his saucer into a farm, sets forth into the city, learns about the glorious benefits of petroleum AND capitalist competition, steals a few library books, and heads back to Mars. He excitedly reveals the truths he\'s learned to the crowd in the colliseum. The crowd is fueled by the spirit of capitalism and the dictatorship breaks down instantly, to be replaced by the Oil Pioneers, the Oil Explorers, and new management. And we learn that a future with oil and competition is Destination Unlimited. I enjoy John Sutherland\'s educational cartoons, but this one is really a work of art. The animation is several cuts above his usual good work. Of course a lot of the difference has to do with the presence of Tom Oreb and Vic Haboush as production designers. And whoever animated Ogg (was it Ken O\'Brien?) provides lush movement done in a very limited style.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=5437261131639475009" allowfullscreen="true" flashvars="fs=true">'),
	(417, 'Duxorcist, The (1987)', '&quot;Daffy Duck has opened his own \'paranormalist-at-large\' exorcism service, and his first client is an alluring lady duck, who is possessed by evil spirits that cause her to metamorphose at random into a hostile, ugly beast.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/nJyUNmozcDw?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/nJyUNmozcDw?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(418, 'Felix the Cat - Into Outer Space (1958)', '&quot;In this children\'s film, the evil plans of the two villains, Professor and Rock Bottom, must be stopped by Felix.&quot; -allmovie.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.joost.com/embed/007001s"></param><param name="allowFullScreen" value="true"></param><param name="allowNetworking" value="all"></param><param name="allowScriptAccess" value="always"></param><embed src="http://www.joost.com/embed/007001s" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" allownetworking="all" width="580" height="476"><noembed><a href="http://www.joost.com/007001s/t/Felix-the-Cat-Into-Outer-Space">Felix the Cat - Into Outer Space</a></noembed></embed></object>'),
	(419, 'Garfield Christmas Special, A (1987)', ' 		  &quot;Garfield, Jon and Odie go to Jon\'s grandmother\'s house for Christmas, where Garfield finds a present for Grandma.&quot; -imdb.com</span> 	  ', NULL, 0, 0, NULL, '<object id="smotriComVideoPlayer" classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" width="580" height="476"><param name="movie" value="http://pics.smotri.com/player.swf?file=v13208305ca1&bufferTime=3&autoStart=false&str_lang=rus&xmlsource=http%3A%2F%2Fpics.smotri.com%2Fcskins%2Fblue%2Fskin_color.xml&xmldatasource=http%3A%2F%2Fpics.smotri.com%2Fskin_ng.xml" /><param name="allowScriptAccess" value="always" /><param name="allowFullScreen" value="true" /><param name="bgcolor" value="#ffffff" /><embed src="http://pics.smotri.com/player.swf?file=v13208305ca1&bufferTime=3&autoStart=false&str_lang=rus&xmlsource=http%3A%2F%2Fpics.smotri.com%2Fcskins%2Fblue%2Fskin_color.xml&xmldatasource=http%3A%2F%2Fpics.smotri.com%2Fskin_ng.xml" quality="high" allowscriptaccess="always" allowfullscreen="true" wmode="opaque"  width="580" height="476" type="application/x-shockwave-flash"></embed></object>'),
	(420, 'He-Man: Diamond Ray Of Disappearance (1983)', '&quot;Skeletor uses a magic gem to banish He-Man\'s friend to another dimension. He proceeds to Greyskull intending to use it on He-Man and take control of the Castle.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/gwNyh5sVfhA?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/gwNyh5sVfhA?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(421, 'Inspector Gadget - Health Spa (1983)', '&quot;Watch as Inspector Gadget takes on the evil Dr. Claw and his henchmen  armed with his arsenal of misfiring gadgetry, his brilliant niece Penny  and their loyal dog Brain.&quot; -amazon.com ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-4984926450461931130" allowfullscreen="true" flashvars="fs=true">'),
	(422, 'It\'s Hummer Time (1950)', '&quot;A cat chases a hummingbird and repeatedly stumbles onto the property of a sleepy bulldog, who punishes the cat for each interruption of his slumber.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/lC-WhTyOah8?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/lC-WhTyOah8?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(423, 'Marine Boy - The Green Monster (1968', '&quot;Cartoon series chronicles the adventures of marine boy, who can breathe  for extended periods underwater with the use of oxygum. He also has jet  boots that propel him underwater, and a friendly dolphin who always  seems to show up just when marine boy needs him most.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1389807280031794325" allowfullscreen="true" flashvars="fs=true">'),
	(424, 'Mr. Bean: The Animated Series - Car Trouble (2002)', '&quot;Based on the popular British skit comedy &quot;Mr. Bean&quot;, this animated cartoon follows the adventures of everyone\'s favourite bumbler. The title character, voiced by Rowan Atkinson, lives in his flat with the lovable Teddy, where he makes moronic decisions yet brilliantly solves them. However, he also needs to outwit his evil landlady Mrs. Wicket and her horrible one-eyed cat Scrapper. &quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/cMUxo1LoJq8?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/cMUxo1LoJq8?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(425, ' Mister Magoo Show - Episode 1, The (196?) ', '&quot;Mr. Magoo was a snooty, incredibly near-sighted character who was constantly getting himself into comedic trouble due to his intense myopia and chronic stubborness. Despite his lack of vision, Magoo had been entrusted as the caretaker of his little nephew Waldo, who was always drawn in to his uncle\'s mishaps.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.joost.com/embed/007001k"></param><param name="allowFullScreen" value="true"></param><param name="allowNetworking" value="all"></param><param name="allowScriptAccess" value="always"></param><embed src="http://www.joost.com/embed/007001k" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" allownetworking="all" width="580" height="476"><noembed><a href="http://www.joost.com/007001k/t/The-Mr-Magoo-Show-Episode-1">The Mr. Magoo Show - Episode 1</a></noembed></embed></object>'),
	(426, ' Pink Panther Show, The - Pinkfinger (1969)', '&quot;When a voice tells the pink panther about how cool it would be a secret agent the pink decides to become one. Then the pink panther finds himself investigating a crime in the process.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/fvlfxvAzzSw&hl=en_GB&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/fvlfxvAzzSw&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(427, 'Popeye: Popeye the Sailor (1933)', '&quot;Popeye introduces himself to us (including a quick live-action shot of  newspapers announcing that he\'s a movie star). The ship docks, and the  sailors try to pick up Olive, but she only wants Popeye. They head for  a carnival, but Bluto isn\'t giving up easily. The boys compete at the  various games. Betty Boop does a hula dance, and Popeye joins her on  stage. Meanwhile, Bluto runs off with Olive and ties her to the tracks.  Popeye comes along and rescues her in the nick of time.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/9UjM9UI40jk&hl=en"></param><embed src="http://www.youtube.com/v/9UjM9UI40jk&hl=en" type="application/x-shockwave-flash" width="580" height="476"></embed></object>'),
	(428, 'Rocky &amp; Bullwinkle &amp; Friends - Jet Fuel Formula 1 (1959)', '&quot;After a trip to the moon, Rocky and Bullwinkle return to earth with moonmen Gidney and Cloyd. The moonmen find themselves endangered, and seek Rocky and Bullwinkle\'s help in returning to the moon.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.joost.com/embed/0070013"></param><param name="allowFullScreen" value="true"></param><param name="allowNetworking" value="all"></param><param name="allowScriptAccess" value="always"></param><embed src="http://www.joost.com/embed/0070013" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" allownetworking="all" width="580" height="476"><noembed><a href="http://www.joost.com/0070013/t/Rocky-and-Bullwinkle-Jet-Fuel-Formula-1-of-40">Rocky and Bullwinkle - Jet Fuel Formula 1 of 40</a></noembed></embed></object>'),
	(429, 'Ryan (2004)', '&quot;Four decades ago, filmmaker Ryan Larkin produced some of the most influential animations of his generation. Years later, plagued by alcoholism and drug abuse, he was destitute on the streets of Toronto. In this haunting film, his friend and fellow animator, Chris Landreth, examines Ryan\'s life through the voices of those who know him best. Combining real interviews with strange, disembodied computer-generated characters, \'Ryan\' won the 2005 Academy Award for Best Animated Short.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowscriptaccess="always" allowfullscreen="true" flashvars="mID=IDOBJ2801&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/ryan-tv-big.jpg&width=580&height=476&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&embeddedMode=true">'),
	(430, 'Society Dog Show (1939)', '&quot;Mickey enters Pluto in a ritzy dog show where they are hopelessly outclassed and have little chance of winning until the building catches on fire and Pluto saves the day. &quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/5R2wE8Sduhs&hl=en&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/5R2wE8Sduhs&hl=en&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(431, 'South Park - Make Love, Not Warcraft (2006)', '&quot;The boys dedicate their lives to defeating a mad gamer and saving the World of Warcraft.&quot;', NULL, 0, 0, NULL, '<object classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" width="580" height="476"><param name="movie" value="http://www.pp2g.tv/pZXB!Y3E_.aspx"></param><param name="wmode" value="transparent"></param><param name="flashvars" value="width=320&height=273"></param><embed src="http://www.pp2g.tv/pZXB!Y3E_.aspx" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476" flashvars="width=580&height=476"></embed></object>'),
	(432, 'Superman: Destruction Inc. (1942)', '&quot;A murder at the Metropolis Munitions plant draws Lois Lane into the  thick of a sabotage plot; she ends up inside a torpedo about to be  tested. Meanwhile, where is Superman?&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/DddEwb62Zl4&rel=1"></param><param name="wmode" value="transparent"></param><embed src="http://www.youtube.com/v/DddEwb62Zl4&rel=1" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476"></embed></object>'),
	(433, 'Superman: Eleventh Hour (1942)', '&quot;Somehow, reporters Clark and Lois manage to visit wartime Japan. While  there, Superman commits a little sabotage...at 11:00 each night. Of  course, this endangers Lois...&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/6M5WUiJkH-E&hl=en"></param><embed src="http://www.youtube.com/v/6M5WUiJkH-E&hl=en" type="application/x-shockwave-flash" width="580" height="476"></embed></object>'),
	(434, 'Superman: Magnetic Telescope, The (1942)', '&quot;An experimental \'magnetic telescope\' draws down a fireball from space. Despite warnings, the callous "professor" tries it again, this time on a full-fledged comet. Even Superman is unable to halt its mighty momentum. Is Metropolis doomed?&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/6M5WUiJkH-E&hl=en"></param><embed src="http://www.youtube.com/v/6M5WUiJkH-E&hl=en" type="application/x-shockwave-flash" width="580" height="476"></embed></object>'),
	(435, 'Superman: Mummy Strikes, The (1943)', '&quot;Oh no! A crook dressed as Superman commits a series of robberies. The  real Superman must work fast to counter the bad publicity...&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/x9a6s36ZIqw?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/x9a6s36ZIqw?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(436, 'Yankee Doodle Daffy (1943)', '&quot;Daffy is an agent representing Sleepy LaGoof trying to sell him to talent scout Porky. Daffy spends a great deal of time and energy explaining and demonstrating what the kid can do, while the kid sits on a couch licking a giant sucker.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/42Lf7yNhdtk&hl=en"></param><embed src="http://www.youtube.com/v/42Lf7yNhdtk&hl=en" type="application/x-shockwave-flash" width="580" height="476"></embed></object>'),
	(437, 'Amazing Screw-On Head, The (2006)', '&quot;A Civil War-era secret agent with an extraordinary special power serves under president Abraham Lincoln.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-5434666681046246946" allowfullscreen="true" flashvars="fs=true">'),
	(438, 'Angst (2005)', '&quot;From the day Andr&eacute; was born, he got harassed by the wind, which resulted in a fear for it. He is forced to confront his fears, the moment his dog gets in trouble.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/pAH4klqLTXg&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><embed src="http://www.youtube.com/v/pAH4klqLTXg&hl=en&fs=1" type="application/x-shockwave-flash" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(439, 'Bang Bang You are Bread (2008)', '&quot;A psychotic loaf of bread seeks revenge on Dr Atkins, creator of the low-carb revolution.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://api.aniboom.com/e/291768" /><param name="allowScriptAccess" value="sameDomain" /><param name="quality" value="high" /><embed src="http://api.aniboom.com/e/291768" quality="high"  width="580"  height="476" allowscriptaccess="sameDomain" type="application/x-shockwave-flash"></embed></object>'),
	(440, 'Big Snit, The (1985)', '&quot;A couple have a fight over a scrabble game unaware that a full scale nuclear war has started.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always" autostart="false" autoplay="false" flashvars="mID=IDOBJ334&bufferTime=10&width=580&height=476&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/Big-snit_BIG.jpg&autostart=false&autoplay=false&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL334&embeddedMode=true">'),
	(441, 'Cat Came Back, The (1988)', '&quot;This hilarious Oscar&reg;-nominated animation is based on the century-old folk song of the same name. Old Mr. Johnson makes increasingly manic attempts to rid himself of a little yellow cat that just won\'t stay away... Also won the 1989 Genie Award for best animated short film. &quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always"  flashvars="mID=IDOBJ260&bufferTime=10&width=580&height=476&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2009/The-Cat-Came-Back_big.jpg&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL179&embeddedMode=true">'),
	(442, 'Conflict (1983)', '&quot;One of the greatest anti-war cartoons.  Knowlege of Russian not required.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-7269205919871967751" allowfullscreen="true" flashvars="fs=true">'),
	(443, 'Downtown - Train Pain (1999)', '&quot;Downtown was an animated series on MTV in urban life, based on interviews with real people. The show follows a diverse and multiracial cast   who live in New York City. It was created by Chris Prynoski, a former animator on Beavis and Butt-Head. In 2000, Downtown was nominated for an Emmy in the category of outstanding animated program.Despite being original and creative, Downtown faced a similar fate as MTV\'s other cartoons - it only lasted one season (13 episodes). While there is little hope for another season, there has been an outcry for a DVD release of the first since the show is no longer on the air.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=8199467673164934361" allowfullscreen="true" flashvars="fs=true">'),
	(444, 'Fallen Art (2004)', '&quot;An old, forgotten military base somewhere in the Pacific. Soldiers who lost their minds, due to the hardships of past missions, and  exemplary officers the Army can\'t yet get rid of are sent there. There, far away from civilization, laws and rules they nurture their insanities.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=2681862943803609235" allowfullscreen="true" flashvars="fs=true">'),
	(445, 'Frosty the Snowman (1969)', '&quot;A discarded silk tophat becomes the focus of a struggle between a washed-up stage magician and a group of schoolchildren after it magically brings a snowman to life. Realizing that newly-living Frosty will melt in spring unless he takes refuge in a colder climate, Frosty and a young girl who he befriends stow away on a freight train headed for the north pole. Little do they know that the magician is following them, and he wants his hat back. This animated short is based on the popular Christmas song of the same name.&quot;', NULL, 0, 0, NULL, '<object width="580px" height="476px" ><param name="allowFullScreen" value="true"/><param name="wmode" value="transparent"/><param name="movie" value="http://mediaservices.myspace.com/services/media/embed.aspx/m=4262362,t=1,mt=video"/><embed src="http://mediaservices.myspace.com/services/media/embed.aspx/m=4262362,t=1,mt=video" width="580" height="476" allowfullscreen="true" type="application/x-shockwave-flash" wmode="transparent"></embed></object>'),
	(446, 'Gentlemen\'s Duel, A (2006)', '&quot;A seemingly innocent tea party is transformed into mega technological mayhem when two imperious aristocrats compete for the affections of a lady.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/uCP2qbHDGIs&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/uCP2qbHDGIs&hl=en&fs=1" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(447, ' Google Toilet, The', '&quot;Google has finally developed technology that can literally sift through your sh*t.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/hrontojPWEE&hl=en_GB&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/hrontojPWEE&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(448, 'Harvie Krumpet (2003)', '&quot;Life is easy for some people; Harvie Krumpet is not one of them. This surprisingly heart-warming film tells the story of Harvie\'s journey from childhood in Poland to old age in Australia, and the string of incessant bad luck that follows him throughout. Written and directed by Adam Elliot, and narrated by Geoffrey Rush, &quot;Harvie Krumpet&quot; won the 2003 Academy Award for Best Animated Short.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/ouyVS6HOFeo&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><embed src="http://www.youtube.com/v/ouyVS6HOFeo&hl=en&fs=1" type="application/x-shockwave-flash" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(449, 'Invention of Love (2010)', '&quot;A simple love story among gears and bolts.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/PTdzCAGH3lU?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/PTdzCAGH3lU?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(450, 'Jungle Jail (2007)', '&quot;a new guy in jail.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://api.aniboom.com/e/119216" /><param name="allowScriptAccess" value="sameDomain" /><param name="quality" value="high" /><embed src="http://api.aniboom.com/e/119216" quality="high"  width="580"  height="476" allowscriptaccess="sameDomain" type="application/x-shockwave-flash"></embed></object>'),
	(451, 'Life and Music', '&quot;Trey Parker, one of the creators of South Park, was raised in Colorado, where his father attempted to teach him Buddhism. Now, years later, Parker and his animation pal Matt Stone have brought to life the teachings of Alan Watts, the comparative religion expert and philosopher. Under the FurryCarlos Productions banner, the two tapped South Park animators Chris Brion and Todd Benson to keyframe three of Watts&rsquo; recordings, which can be viewed below.&quot; - coldhardflash.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/ERbvKrH-GC4&rel=1"></param><param name="wmode" value="transparent"></param><embed src="http://www.youtube.com/v/ERbvKrH-GC4&rel=1" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476"></embed></object>'),
	(452, 'Love and War (2006)', '&quot;Bunny is sitting in her bedroom browsing through a photo album. She starts daydreaming and the images come to life. The time she shared with the love of her life is enacted. During her training to become a nurse, Bunny meets, by mere chance, the fighter pilot Bear. Romance ensues and they form a couple. When Bear is about to propose, they are suddenly interrupted by an international conflict. Duty calls and Bear is sent into battle.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/jiSu3YCDEuw&hl=en&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/jiSu3YCDEuw&hl=en&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(453, 'Madame Tutli-Putli (2007)', '&quot;This stop-motion animated film takes viewers on an exhilarating existential journey into the fully imagined, tactile world of Madame Tutli-Putli. As she travels alone on the night train, weighed down with her all her earthly possessions and the ghosts of her past, she faces both the kindness and menace of strangers. Finding herself caught up in a desperate metaphysical adventure, adrift between real and imagined worlds. she confronts her demons.&quot;', NULL, 0, 0, NULL, '<embed src="http://media1.nfb.ca/medias/flash/ONFflvplayer-gama.swf" width="580" height="476" allowfullscreen="true" allowscriptaccess="always"  flashvars="mID=IDOBJ12773&bufferTime=10&width=580&height=476&image=http://media1.nfb.ca/medias/nfb_tube/thumbs_large/2010/tutli-putli-tv-big.jpg&showWarningMessages=false&streamNotFoundDelay=15&lang=en&getPlaylistOnEnd=true&playlist_id=REL179&embeddedMode=true">'),
	(454, 'Mouse and His Child, The (1977)', '&quot;Adaptation of Russell Hoban\'s novel about two mechanical toy mice, and their quest to become &quot;self-winding&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="560" height="456"><param name="movie" value="http://www.youtube.com/v/1OWdw1IwdYY"></param><param name="wmode" value="transparent"></param><embed src="http://www.youtube.com/v/1OWdw1IwdYY" type="application/x-shockwave-flash" wmode="transparent" width="560" height="456"></embed></object>'),
	(455, 'Oktapodi (2007)', '&quot;Two Octopi fight for their lives with a stubborn restaurant cook in a comical escape through the streets of a small Greek village.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/badHUNl2HXU&color1=0xb1b1b1&color2=0xcfcfcf&hl=en_US&feature=player_embedded&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowScriptAccess" value="always"></param><embed src="http://www.youtube.com/v/badHUNl2HXU&color1=0xb1b1b1&color2=0xcfcfcf&hl=en_US&feature=player_embedded&fs=1" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(456, 'Over Time (2005)', '&quot;Over Time is a stunning hommage to muppets creator, Jim Henson. Directed by Oury Atlan, Thibaut Berland and Damien Ferrie as a student film, it is haunting yet beautiful. A truly unique and inspiring film that more of us should aspire to. Watch it a number of times to appreciate the subtle nuances and attention to detail. The short features equally moving music from the Silberman Orchestra as well as compositions by Ornadel and the Starlight Symphony.&quot;', NULL, 0, 0, NULL, '<object name="iLyROoaftAOn" id="iLyROoaftAOn" type="application/x-shockwave-flash" data="http://sa.kewego.com/swf/p3/epix.swf" width="580" height="476">  <param name="movie" value="http://sa.kewego.com/swf/p3/epix.swf" />  <param name="allowFullScreen" value="true" />  <param name="allowscriptaccess" value="always" />  <param name="flashVars" value="language_code=en&playerKey=09d651125dab&skinKey=71703ed5cea1&sig=iLyROoaftAOn&autostart=false&advertise=1" /></object>'),
	(457, 'Pingu Goes Fishing (1986)', '&quot;Pingu Makes a Friend&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/oTWv63RyLP8&hl=en&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/oTWv63RyLP8&hl=en&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(458, 'Pixels (2010)', '8-bit invasion', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/ou8vRWTSsJo?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/ou8vRWTSsJo?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(459, 'Plague Dogs, The (1982)', '&quot;An animated adaptation of Richard Adams\' novel, about a pair of dogs  (Snitter and Rowf) who escape from a research laboratory and try to  survive in the wild with the help of a cunning fox (The Tod). The lab  director tries to keep the escape quiet, but as an increasing number of  sheep are found killed, word leaks out, together with rumours that the  dogs might be plague carriers...&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=4455833622504222188" allowfullscreen="true" flashvars="fs=true">'),
	(460, 'Prime Time', '&quot;A magic box falls from the sky and disturbs the peaceful lives of two prehistoric brothers.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/WwqPOkcXrYQ?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/WwqPOkcXrYQ?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(461, 'Raggedy Ann &amp; Andy: A Musical Adventure (1977)', '&quot;Based on the beloved Johnny Gruelle characters and featuring the music of Sesame Street composer Joe Raposo, is this 1977 feature film.  While this was directed by Richard Williams, he was generally &quot;for-hire&quot; without much creative involvement. While it was a critical and financial disappointment, as well as the animation being a bit sub-par compared to other Williams work, it\'s a very enjoyable children\'s movie. Unfortunately, though this was shot in Panavision (2.35:1 widescreen), no video master exists in the original format.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=6706642381871663196" allowfullscreen="true" flashvars="fs=true">'),
	(462, 'Reach (2009)', '&quot;A tiny robot is given the gift of life with only one limitation, the length of his power cable. When a curious bird appears at the workshop window, his lust to live outside of his reach, may be his demise.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/tzg2jjH2z8E&hl=en&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/tzg2jjH2z8E&hl=en&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(463, 'Rejected (2000)', '&quot;An animator\'s commisioned works, rejected because of their increasingly absurd and violent tone (reflecting the animator\'s own progressive breakdown), eventually find their entire animated world collapsing in upon itself.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/rgQqSVrkkag?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/rgQqSVrkkag?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(464, 'Rockfish (2003)', '&quot;A fisherman and his little alien pet go fishing on a desolate barren planet somewhere in the galaxy. With his gear he digs a whole in the crust up until the magma shows up. Now the fishing can start, some bait, and down the mechanical fishing rod goes. It won\'t take long until something eats the bait. But what kind of fish is this? One thing we know for sure: it doesn\'t want to get caught. Not at all.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=8338293420527115517" allowfullscreen="true" flashvars="fs=true">'),
	(465, 'Rudolph, the Red-Nosed Reindeer (1964)', '       If it doesn\'t play, watch in on Google Video       &quot;Sam the snowman tells us the story of a young red-nosed reindeer who, after being ousted from the reindeer games because of his beaming honker, teams up with Hermey, an elf who wants to be a dentist, and Yukon Cornelius, the prospector. They run into the Abominable Snowman and find a whole island of misfit toys. Rudoph vows to see if he can get Santa to help the toys, and he goes back to the North Pole on Christmas Eve. But Santa\'s sleigh is fogged in. But when Santa looks over Rudolph, he gets a very bright idea...  &quot; -imdb.com     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=http://video.google.com/videoplay?docid=-7226220443648270051&ei=fkpISe3ULaKy2gKp1-zqBQ&q" allowfullscreen="true" flashvars="fs=true">'),
