	(468, 'Salad Fingers - Episode 3: Nettles (2004)', '       &quot;Salad Fingers is playing with nettles and has irritated blisters all over his hands.&quot;  -wikipedia       &quot;Salad Fingers is a Flash cartoon series originally created by David Firth in July 2004 which gained rapid internet popularity in 2005. The San Francisco Chronicle ranked it in the \'top 10\' pop culture phenomena for that year.&quot; -wikipedia     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/ojoICRzSCOo&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><embed src="http://www.youtube.com/v/ojoICRzSCOo&hl=en&fs=1" type="application/x-shockwave-flash" allowfullscreen="true" width="580" height="476"></embed></object>'),
