	(472, 'Snowman, The (1982)', '       Watch the rest on YouTube       &quot;Wordless (save for the song \'Walking in the Air\') animated adventure about a young English boy who makes a snowman one Christmas Eve, only for it to come to life that night and take him on a magical adventure to the North Pole to meet Santa Claus. &quot; ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/2IhNeFFk_4o?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/2IhNeFFk_4o?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(473, 'SuperNews!:  Emoticon War: SuperNews!', '&quot;A determined group of Emoticons fulfill their digital destiny.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/nFSCrcqebVg&hl=en_GB&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/nFSCrcqebVg&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(474, 'Thief and the Cobbler, The (1993)', '&quot;The film tells a story which takes place in an oriental city from the  tales of thousand and one night. It covers the friendship of a thief  knowing all tricks to survive in the city and a poor cobbler/shoemaker  who has to struggle in order to live.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=3215943965738923925&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(475, ' Third &amp; The Seventh, The', '&quot;A FULL-CG animated piece that tries to illustrate architecture art across a photographic point of view where main subjects are already-built spaces. Sometimes in an abstract way. Sometimes surreal.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="movie" value="http://vimeo.com/moogaloop.swf?clip_id=7809605&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00ADEF&amp;fullscreen=1" /><embed src="http://vimeo.com/moogaloop.swf?clip_id=7809605&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00ADEF&amp;fullscreen=1" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(476, 'Tim Tom (2003)', '&quot;Tim and Tom persevere and successfully connect despite the interference of their higher power.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/RUAO9HIjkmM&rel=1"></param><param name="wmode" value="transparent"></param><embed src="http://www.youtube.com/v/RUAO9HIjkmM&rel=1" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476"></embed></object>'),
	(477, 'Toonerville Picnic (1936)', '&quot;This is typical 1930s color-cartoon animation, just before the sophisticated Fleischer and Disney styles took over the genre. It\'s a picnic trip on Fontaine Fox\'s classic Toonerville Trolley. Sparks fly as The Terrible-Tempered Mr. Bang, Powerful Katrinka, and the Skipper head off to a less-than-peaceful summertime picnic excursion aboard the ultimately-existential Toonerville light-rail system. It\'s too bad more of these Toonerville cartoons weren\'t made, and it\'s a mystery, too, because the newspaper comic strip on which they were based ran from 1915 into 1955. The children will roar with delight, and adults will marvel at the simpler and less-sophisticated times in which the Toonerville Trolley operated.&quot; -imdb.com</span>', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/A958SI-8JLQ&hl=en"></param><embed src="http://www.youtube.com/v/A958SI-8JLQ&hl=en" type="application/x-shockwave-flash" width="580" height="476"></embed></object>'),
	(478, 'Transformers - More Than Meets the Eye: Part 1 (1984)', '       Watch more episodes on YouTube       &quot;The Autobots and Decepticons, during the great Cybertronian War, crash landed on earth. Millions of years later, geological activity revives the warring factions - the Decepticons want to strip the earth of its vast energy resources, and the Autobots seek to protect the inhabitants of earth from that fate. And so an endless battle begins...&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/LR0rORa92vY?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/LR0rORa92vY?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(479, 'Transformers - More Than Meets the Eye: Part 2 (1984)', '           &quot;After being rescued from a Decepticon attack, Spike and Sparkplug Witwicky offer their assistance to the Autobots, and The Autobots are going to need it in order to stop The Decepticons from gaining power to conquer Cybertron.&quot;     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/TlCBSa92ANo?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/TlCBSa92ANo?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(480, 'Wallace &amp; Gromit\'s Cracking Contraptions (2002)', '&quot;Wallace and Gromit try out a number of their latest inventions which rarely work as planned.&quot;', NULL, 0, 0, NULL, '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=8,0,0,0" width="580" height="476"><param name="movie" value="http://i47.vbox7.com/player/ext.swf?vid=99554f66"><param name="quality" value="high"><embed src="http://i48.vbox7.com/player/ext.swf?vid=99554f66" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="580" height="476"></embed></object>   		  <h1>Wallace &amp; Gromit\'s Cracking Contraptions (2002)</h1> 		'),
	(481, 'Al TV (2006)', '&quot;&quot;Weird Al&quot; Yankovic hosts a new television special to promote his new album Straight Outta Lynwood. This features new &quot;fake&quot; interviews  ... all &raquo; with Jessica Simpson and Kevin Federline, as well as hilarious host segments. Also featured are the complete music videos for &quot;I\'ll Sue Ya,&quot; &quot;Close But No Cigar,&quot; &quot;Weasel Stomping Day,&quot; &quot;Polkarama,&quot; and &quot;White and Nerdy.&quot; Also featured are clips from &quot;Virus Alert&quot; &quot;Confessions Part III&quot; (sync with the original Usher video for &quot;Confessions Part II&quot; which was parodied) and &quot;Don\'t Download This Song.&quot; &quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1686518509628377951" allowfullscreen="true" flashvars="fs=true">'),
