	(483, 'Blackadder Back &amp; Forth (1999)', ' 		  Watch the rest on Youtube 		  &quot;The Blackadder cast returns after a 10 year absence for this special. The new 21st century Lord Blackadder and his scabby, but loyal, servant Baldrick wreak havoc as they tumble through the past in a time machine, with disastrous consequences. &quot;     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/Ptm8agr5DV0?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/Ptm8agr5DV0?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(484, 'Blackadder Goes Forth - Goodbyeee (1989)', '&quot;Blackadder pretends that he\'s insane to avoid certain death carrying out the General\'s order for the \'big push\'.&quot;', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=5511752399184462534&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
