	(487, 'Brass Eye - \'Peadogeddon\' (2001)', '&quot;In 2001, the series was repeated, along with a new and entirely original extra show, which tackled the tricky subject of paedophilia and the associated moral panic prevalent in parts of the British media at the time following the death of Sarah Payne focused on the controversial \'name and shame\' campaign of the News of the World. This included an incident in 2000, in which a paediatrician in Newport had the word \'PAEDO\' daubed in yellow paint on her home.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=9031532194656768989" allowfullscreen="true" flashvars="fs=true">'),
	(488, 'Bravo Profiles - Penn and Teller (2001)', '&quot;Bravo network TV series that profiles creative artists in many fields.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-7548774060504643868" allowfullscreen="true" flashvars="fs=true">'),
	(489, 'Computer Chronicles - Computer Games (1984)', '       &quot;Computers are creating an entirely new platform for playing games, between humans or between humans and computers.       Guests: Trip Hawkins, Electronic Arts; Bill Budge, Game Designer; Chris Crawford, Atari; Steve Kitchen, Activision        Products/Demos: Pinball Construction Set, One on One, Space Shuttle, Excaliber, Larry Bird Basketball&quot;     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/RLpP2uh-zmE&rel=1"></param><param name="wmode" value="transparent"></param><embed src="http://www.youtube.com/v/RLpP2uh-zmE&rel=1" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476"></embed></object>'),
	(490, 'Dateline - To Catch a Predator (03-06-2007)', '&quot;\'To Catch a Predator\' is a series of hidden camera investigations by the television newsmagazine Dateline NBC devoted to the subject of identifying and detaining potential child sexual abusers who contact minors (or individuals whom they believe to be minors) over the Internet for sexual liaisons.&quot; -wikipedia', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=2150665490135952267" allowfullscreen="true" flashvars="fs=true">'),
	(491, 'Derren Brown: Mind Control', '&quot;Illusionist Derren Brown\'s breakthrough TV show, he shows audiences a variety of \'magic\' or \'psychic\' tricks through the use of suggestion, psychology, misdirection and showmanship.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=6282159641861799839&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(492, 'Derren Brown - Waking Dead', '&quot;In June 2005, a clip from the second series widely circulated the internet. In this clip, Derren claims to have created a video game he calls &quot;Waking Dead&quot; which &quot;is able to put roughly 1/3 of the people who play it into a catatonic trance&quot;. In this episode he places the video game in a pub, to lure a supposedly unsuspecting patron into playing the game. He then &quot;kidnaps&quot; the catatonic &quot;victim&quot; and places him in a real-life recreation of the video game, having him fire an air gun at actors, pretending to be zombies and outfitted with explosive squibs.&quot; -wikipedia', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/2SYhYLt-Vgg&hl=en_GB&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/2SYhYLt-Vgg&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(493, 'Goodness Gracious Me: Back Where They Came from (2001)', '&quot;A one-off special from the cast of \'Goodness Gracious Me\'&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=8718238815350384095" allowfullscreen="true" flashvars="fs=true">'),
	(494, 'Ghost Hunters - Live! at Waverly Hills Sanatorium (2007)', '&quot;This one-hour weekly docu-soap from the creator/executive producer of \'American Chopper\' follows a group of real-life paranormal researchers as they investigate haunted houses throughout the country, encountering every type of imaginable haunting. Jason Hawes and Grant Wilson, plumbers by trade, head up TAPS -- The Atlantic Paranormal Society -- a group of ordinary, everyday people with an interest in getting to the bottom of your otherworldly disturbances.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1961049877459830410" allowfullscreen="true" flashvars="fs=true">'),
	(495, ' IT Crowd - Yesterday\'s Jam (2006)', '&quot;From the creators of FATHER TED and THE OFFICE comes THE IT CROWD, the popular British sitcom that\'s taking the world by storm. Relegated to a dingy basement, Moss, Jen and Roy are their company\'s last line of technological defence; they are the IT crowd.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=4174391869357140840" allowfullscreen="true" flashvars="fs=true">'),
	(496, 'Kenny vs. Spenny - First One to Laugh Loses (2006)', '&quot;Both players agreed to give their attention to each other\'s attempts at making one another laugh. Spenny had a mutual friend humiliate himself in front of Kenny. Results of competition were decided by reviewing the video in slow motion, as Kenny and Spenny both laughed at nearly the same moment.&quot; -wikipedia', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-1429919880225634864&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(497, 'Kenny vs. Spenny - Who Can Stay Awake the Longest?? (2003)', '&quot;Kenny used a bright light visor, an earpiece that beeped when he tilted his head and drank lots of coffee. Kenny had also used different methods to use little energy. Spenny sought to win by using his willpower. After 81 hours, 12 minutes, 23 seconds, Spenny had fallen asleep.&quot; -wikipedia', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-5090558142809535481&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(498, 'Kenny vs. Spenny - Who Can Stay Homeless the Longest? (2007)', '&quot;During the contest Kenny visited his bank and withdrew money without his card so he could dine in a restaurant. Spenny was arrested after hitting Kenny in front of two police officers, causing him to spend the night in a cell, thus losing the competition. (Rules stated that they must sleep outside).&quot; -wikipedia', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=2848075952111115424&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(499, 'Look Around You - Maths (2002)', ' 			&quot;This spoof comedy series is so firmly entrenched in its origins - a very  small pocket of British television history known as Programmes for  Schools, which were TV shows intended to be videotaped and shown in  classrooms for educational purposes - that it might be almost  impossible for it to be appreciated by anyone outside of the UK, and  even for us residents, it\'s full genius can only be appreciated by  those of us around and at school in the 1970\'s, or awake at night  watching those hideous Open University programmes.&quot;  -amazon.com 			Watch more episodes on YouTube 		', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/Pj2NOTanzWI&hl=en&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/Pj2NOTanzWI&hl=en&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(500, ' Lucy Show - Lucy with George Burns, The (1966)', '&quot;When visiting the bank as a customer, George Burns finds out that Lucy is instinctive funny and asks her to become a partner in his show. Mr. Mooney, who thinks this is an opportunity to get rid of her, accepts being her agent. The show opens in Santa Monica, where the new pair appear in a Burns and Allen-style act. George Burns is the straight man and Lucy the comedienne, who delivers the punchlines.&quot;', NULL, 0, 0, NULL, '<embed src="http://blip.tv/play/gu980pN4Ag%2Em4v" type="application/x-shockwave-flash" width="580" height="476" allowscriptaccess="always" allowfullscreen="true">'),
	(501, 'Lucy Show - Lucy and John Wayne, The (1966)', '&quot;When Mr. Mooney sends Lucy to the movie studio to deliver some papers regarding the financing on John Wayne\'s new film, she ignores his warning not to bother Mr. Wayne and finds herself lunching with him. Nervous and excited, Lucy proceeds to talk his ear off and finally splatters him with ketchup. Mr. Wayne takes that as his exit cue, but Lucy soon tracks him to the set of his film, where she continuously screws up the production.&quot;', NULL, 0, 0, NULL, '<embed src="http://blip.tv/play/gu981Pp6Ag%2Em4v" type="application/x-shockwave-flash" width="580" height="476" allowscriptaccess="always" allowfullscreen="true">'),
	(502, 'Mad TV - Terminator 3', '&quot;Arnold goes back in time to save Jesus in Terminator 3 Mad TV skit.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=4071151553895092459" allowfullscreen="true" flashvars="fs=true">'),
	(503, 'Monty Python\'s Flying Circus - The Spanish Inquisition (1970)', '&quot;The irreverent Monty Python comedy troupe present a series of skits  which are often surreal, baudy, uncompromising, tasteless, but  inevitably hilarious.&quot;  -imdb.com</span>', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=7355366681316596027" allowfullscreen="true" flashvars="fs=true">'),
	(504, 'Most Haunted - Chillingham Castle (2002)', '&quot;Paranormal investigations into haunted locations, using psychic mediums and scientific equipment.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=1519680168343027249" allowfullscreen="true" flashvars="fs=true">'),
	(505, 'Mr. Show with Bob and David - Oh, You Men (1997)', '&quot;Bob and David seek an audience with the mayor of television.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-7984154180848593932&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(506, 'Mystery Science Theater 3000 - Space Mutiny', '       &quot;In the not too distant future, a man and his robots are trapped on the  Satellite of love, where evil scientists force them to sit through the  worst movies ever made.&quot; -imdb.com       Watch more episodes on Google Video     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=8590533394044637016" allowfullscreen="true" flashvars="fs=true">'),
	(507, 'Does God Exist? The Nightline Face-Off', '&quot;Kirk Cameron and Ray Comfort face off in a debate with the Rational Response Squad over the existence of God.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=1229854964003619354" allowfullscreen="true" flashvars="fs=true">'),
	(508, 'Penn &amp; Teller: Bullshit! - Being Green (2008)', '&quot;In episode 606, Penn and Teller consider the popularity of the &quot;green&quot; movement, a largely bogus and hypocritical philosophy that links sanctimonious politics to an &quot;ethical&quot; lifestyle while doing little or nothing to actually create a healthier ecosystem.&quot; -tv.com', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=-5329857034306331360&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(509, 'Penn &amp; Teller: Bullshit! - NASA (2008)', '       &quot;They put a man on the moon 40 years ago, but what has NASA done for us lately?  The Space Program doesn&rsquo;t seem to have the appeal it did back when there was a race going on.  But let&rsquo;s face it, space is downright boring.  How did NASA screw that up?  Well, it turns out PR isn&rsquo;t the only thing they&rsquo;ve screwed up.  So can they make space travel sexy again?&quot;     ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=3580087289320113608" allowfullscreen="true" flashvars="fs=true">'),
	(510, 'Penn &amp; Teller: Bullshit! - P-E.T.A. (2004)', '       Watch the rest on YouTube       1 April 2004 (Season 2, Episode 1)        &quot;Offers criticism toward the animal rights movement, and particular attention to the P.E.T.A. organization, and its apparent ties with the Animal Liberation Front.&quot; -wikipedia     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/7kXUPy-dCx4?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/7kXUPy-dCx4?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(511, 'Prisoner, The (1967)', ' 		  &quot;After resigning, a secret agent is abducted and taken to what looks like an idyllic village, but is really a bizarre prison. His warders demand information. He gives them nothing, but only tries to escape.&quot; -imdb.com 		  &quot;The Prisoner is a 17-episode British television series first broadcast in the UK from 29 September 1967 to 1 February 1968.[1][2] Starring and co-created by Patrick McGoohan, it combined spy fiction with elements of science fiction, allegory and psychological drama.&quot; -wikipedia     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/p/0B1EB112654593C0?version=3&hl=en_US&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/p/0B1EB112654593C0?version=3&hl=en_US&fs=1" type="application/x-shockwave-flash" width="580" height="476" allowscriptaccess="always" allowfullscreen="true"></embed></object>'),
	(512, 'Real Hustle, The - Episode 1 (2006)', '&quot;A team of real-life confidence tricksters carry out notorious scams on  unsuspecting members of the general public whilst hidden cameras  capture all the action.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=25386750441983070" allowfullscreen="true" flashvars="fs=true">'),
	(513, 'Saturday Night Live - Britney Spears (2002)', '&quot;The classic late night live sketch comedy show.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="video" value="http://static.video.yandex.ru/lite/alyesina/0ht76kz76u.2717/"></param><param name="allowFullScreen" value="true"></param><param name="scale" value="noscale"></param><embed src="http://static.video.yandex.ru/lite/alyesina/0ht76kz76u.2717/" type="application/x-shockwave-flash" width="580" height="476" allowfullscreen="true" scale="noscale" ></embed></object>'),
	(514, 'Secrets of the Sexes - Brainsex', '&quot;Men and women are just the same. Just as caring, just as promiscuous, just as good at a three point turn. Aren\'t they? The results of a new BBC sex survey of 500,000 people from around the globe - the largest ever carried out - provide very revealing answers. And five men and five women are put through a unique battery of experiments to uncover the real differences between the sexes. Engineer Lloyd finds out what\'s missing in him. Bickering couple Liz and Craig squabble over who\'s the most empathic - until a stunning brain scan settles the argument. And in a television first we reveal the true effects of sex hormones on the brain by following 29-year-old Max as, under the influence of monthly testosterone injections, she turns from a woman into a man.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=5216260073192690957&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(515, 'Star Trek: New Voyages - Come What May: Pilot (2004)', '&quot;After receiving a distress call, the USS Enterprise, commanded by Captain James T. Kirk , is assigned to investigate an intruder attacking the Primus IV colony. Once there, the crew encounters a strange alien life form that can produce visions of personal events displaced in time. These visions may hold the key to better understanding the threat they are about to encounter.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-8640306924766056110" allowfullscreen="true" flashvars="fs=true">'),
	(516, 'Star Trek: New Voyages - World Enough and Time (2007)', '&quot;During an emergency transport, Sulu returns 30 years older than when he left and with his daughter.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=9214316752721424505" allowfullscreen="true" flashvars="fs=true">'),
	(517, '\'Star Wars\' Holiday Special, The (1978)', '&quot;It is Lifeday, a holiday that is celebrated on Chewbacca\'s home planet Kashyyyk. Chewie and Han Solo are trying to get to the planet where Chewie\'s family is waiting for him, but the empire is out searching for the rebels, giving everyone a hard time. While we are waiting we get a look at the everyday life of a wookie family. We meet all the familiar characters from Star Wars and we are introduced to Bobba Fett during a small cartoon. We also pay a visit to the Cantina and meet all the monsters again.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=323909610753051544" allowfullscreen="true" flashvars="fs=true">'),
	(518, 'Twilight Zone - Nightmare at 20,000 Feet (1963)', '&quot;Rod Serling\'s seminal anthology series focused on ordinary folks who suddenly found themselves in extraordinary, usually supernatural, situations. The stories would typically end with an ironic twist that would see the guilty punished.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-6925428447334060048&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(519, ' Twilight Zone - Time Enough At last (1959)', '       Wach the rest on YouTube       &quot;Rod Serling\'s seminal anthology series focused on ordinary folks who suddenly found themselves in extraordinary, usually supernatural, situations. The stories would typically end with an ironic twist that would see the guilty punished.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/0FUI90HIQt8?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/0FUI90HIQt8?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(520, 'V: The Final Battle (1984)', '&quot;A small group of human resistance fighters fight a desperate guerilla war against the genocidal extra-terrestrials who dominate Earth.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-2040361659653215949&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(521, 'World\'s Funniest Commercials (2006)', 'Funniest commercials of the year 2006.', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=1073480766037412930" allowfullscreen="true" flashvars="fs=true">'),
	(522, 'Captain Blasto - Episode One (2005)', '       Watch the other episodes on YouTube       &quot;Captain Blasto, a comedy video web series, follows Colin Carter, a high school outcast, who recruits a middle-aged crew of comic crooks, including his high school janitor, to stage fake robberies in their small town which he can foil as his childhood comic book super hero.&quot;     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/JTIBMhs80H8&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><embed src="http://www.youtube.com/v/JTIBMhs80H8&hl=en&fs=1" type="application/x-shockwave-flash" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(523, 'Amazing Johnathan, The', '&quot;September 9, 1958 in Detroit, Michigan), better known by the stage name The Amazing Johnathan, is an American stand-up comedian/magician. His act is mostly composed of hijinks, interaction with one specific audience member and a few legitimate magic tricks which often fail to comic effect.&quot; -wikipedia', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/eoygH4h45jM&rel=1"></param><param name="wmode" value="transparent"></param><embed src="http://www.youtube.com/v/eoygH4h45jM&rel=1" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476"></embed></object>'),
	(524, 'Andy Kaufman: The Midnight Special (1981) ', '&quot;Andy Kaufman\'s Midnight Special is an episode of Burt Sugarman\'s Midnight Special, hosted by Wolfman Jack, which aired on January 23, 1981. Even though this was filmed a few years before Kaufman\'s premature death in 1984, it\'s a retrospective of his work. Many of his better known characters and routines are featured, including &quot;The Foreign Guy,&quot; Tony Clifton, &quot;Ladies Wrestling,&quot; the ventriloquist act, and of course, Elvis. The highlight of this video is interview footage of Andy &quot;explaining&quot; his work. Is it real or an act? Was he a comic genius or an utter madman running loose on a TV stage? We may never know.&quot; -Rob Bracco (amazon.com)', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1294650459584749168&amp;hl=en-GB" allowfullscreen="true" flashvars="fs=true">'),
	(525, 'Bill Hicks at Dangerfields', '&quot;Old footage of Bill Hicks during a performance at Dangerfields. From a comedy special back in the late 80s I think  &quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/C99eZY4V5w8&hl=en_GB&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/C99eZY4V5w8&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(526, 'Bill Hicks - One Night Stand (1991)', '&quot;I must say this  stand up performance from Bill Hicks is just fabulously funny! From  start to finish Hicks is never at a moment of losing his words! This  was in 1991 when Bill was at his peak and high point even the opening  prologue of him at the airport is funny. Anyway Bill performs at the  Old Vic Theatre in Chicago and I just love his rapid fire southern  style of fast paced tongue and comedic wit! This stand up performance  of only 30 minutes covers topics such as smoking, alcohol, pot use and  the one catchy line about eggs and your brain on drugs.&quot;  -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=1366476727111157120" allowfullscreen="true" flashvars="fs=true">'),
	(527, 'Bill Hicks: Revelations (1993)', '&quot;Hicks\' follow-up show to Relentless, recorded at the Dominion Theatre in London.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=1604695578417499645" allowfullscreen="true" flashvars="fs=true">'),
	(528, 'Brilliant Bill Hicks, The', '&quot;Bill Melvin Hicks (December 16, 1961 &ndash; February 26, 1994) was an American stand-up comedian. Finding moderate mainstream success in the late 1980s and early \'90s, Hicks tended to balance heady discussion of religion, politics and personal issues with more ribald material; he characterized his own performances as \'Chomsky with dick jokes.\'&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-5322253174003276297&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(529, 'Carlin at Carnegie (1982)', '&quot;&quot;What are you, a comedian?&quot; The question is being asked by a cop, played by George Carlin in a semi-improvised sketch, of a wisecracking scofflaw who just happens to be the real George Carlin. Well, yes, he is a comedian, Mr. Policeman, as it turns out. Carlin, the popular satirist, is making a persuasive and very funny case that comedy suffers from negative associations in our language (&quot;That guy is sure acting funny...&quot;), and the joke is typical of his 1982 performance at Carnegie Hall, captured here for an HBO special. On the rebound from his second heart attack (&quot;I lead Richard Pryor in heart attacks two to one, and he leads me in setting oneself on fire&quot;), Carlin follows his rambling observations through such random topics as whether one can argue with Rice Krispies or reject a well-wisher\'s blessing of &quot;Have a nice day.&quot; (&quot;Maybe I don\'t feel like it. I\'m ready, by God, for a crappy day.&quot;) Other items on the agenda include a look at the news (&quot;A man attempting to walk around the world drowned today...&quot;), an overview of foods that don\'t look edible, the poor manners of dogs, and Carlin\'s ever-expanding list of dirty words to provoke the authorities.&quot; --Tom Keogh (amazon.com)', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=3566849034586189848&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(530, 'Carlos Mencia: No Strings Attached (2006)', '&quot;Meet Carlos Mencia. He has quite a few opinions&hellip; on just about everything. In this extended and uncensored comedy performance, No Strings Attached, filmed live in San Francisco, Carlos&rsquo; take on race relations, the police, immigration laws, religion and the mentally challenged will either have you wincing or laughing, but either way, he doesn&rsquo;t really care, because as Carlos is quick to point out, if you ain&rsquo;t laughing, you ain&rsquo;t living.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-8006186370293384252" allowfullscreen="true" flashvars="fs=true">'),
	(531, 'Carlos Mencia: Not for the Easily Offended (2005)', '&quot;In this incredibly funny, raw, biting and ultimately smart routine, Carlos Mencia covers taboo topics including ethnic stereotypes, race relations, immigration, war, patriotism, capitalism and family with brutal honesty and unrelenting provocativeness. Mencia represents the internal voice inside us and demands we admit to thinking what he says out loud. Be prepared to laugh, get red in the face, and rewind to make sure he actually said what you think he said. Most of all, get ready to have a great time (if you&rsquo;re not easily offended) with Carlos Mencia.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=4070031207052860402" allowfullscreen="true" flashvars="fs=true">'),
	(532, 'Christopher Titus: Love is Evol (2009)', ' 		  Watch the rest on YouTube 		  &quot;Divorce, dysfunction, and a Diesel jeans model all add up to another painfully funny stand-up performance by Christopher Titus.&quot; -amazon.com 		', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/_RDp2-pQdXI?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/_RDp2-pQdXI?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(533, 'Comedy Central Presents Dane Cook (2000)', '&quot;Rock n\' roll junkie Dane Cook confesses his twisted desires and lets it all hang out in this no-holds barred half-hour special.&quot;', NULL, 0, 0, NULL, '<embed src="http://www.ebaumsworld.com/player.swf" allowscriptaccess="always" flashvars="pageurl=http://www.ebaumsworld.com/video/watch/943553/&file=http://media.ebaumsworld.com/mediaFiles/video/494827/943553.flv&mediaid=943553&title=Comedy Central Presents - Dane Cook&tags=central,presents,dane,cook,funny,lol,half,hour,old,school,catholic,stand,standup&description=Copyright of Comedy Central, Full Half Hour Comedy&displayheight=325&backcolor=0x0d0d0d&lightoclor=0x336699&frontcolor=0xcccccc&image=http://images.ebaumsworld.com/thumbs/video/494827/943553.jpg&username=lionelk" wmode="transparent" loop="false" menu="false" quality="high" bgcolor="#ffffff" width="580" height="476" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" />'),
	(534, 'Comedy Central Presents Zach Galifianakis (2001)', '&quot;Zach live on TV!&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://embed.trilulilu.ro/video/colebil/4e56127215bf2e.swf"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><param name="flashvars" value="username=colebil&hash=4e56127215bf2e&color=0xeaeaea"></param><embed src="http://embed.trilulilu.ro/video/colebil/4e56127215bf2e.swf" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476" flashvars="username=colebil&hash=4e56127215bf2e&color=0xeaeaea" ></embed></object>'),
	(535, 'Dane Cook: Insomniac Tour', '', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.dailymotion.com/swf/xhssj" /><param name="allowFullScreen" value="true" /><param name="allowScriptAccess" value="always" /><embed src="http://www.dailymotion.com/swf/xhssj" type="application/x-shockwave-flash" width="580" height="476" allowfullscreen="true" allowscriptaccess="always"></embed></object>'),
	(536, 'Dane Cook: Vicious Circle (2006)', '&quot;Vicious Circle captures the hottest comic in America in his first HBO  comedy event, a unique \'in the round\' performance before his hometown  Boston fans.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1795679078662739716" allowfullscreen="true" flashvars="fs=true">'),
	(537, 'Dan Nainan at Seattle\'s Moore Theater', '&quot;Dan Nainan at Seattle\'s Moore Theater - Stand Up Comedy Special for an  audience of 1400 - if you like Jerry Seinfeld you\'ll love this! Check  out the Bill Clinton, George Bush, Jesse Jackson and Arnold  impressions! 100% Clean Stand Up Comedy!&quot;', NULL, 0, 0, NULL, '<object width="560" height="456"><param name="movie" value="http://www.youtube.com/v/say9MsdpGXs"></param><param name="wmode" value="transparent"></param><embed src="http://www.youtube.com/v/say9MsdpGXs" type="application/x-shockwave-flash" wmode="transparent" width="560" height="456"></embed></object>'),
	(538, 'Dave Chappelle: For What It\'s Worth (2004)', '&quot;Comedian Dave Chappelle does what he does best in this outrageous and  hilarious standup performance, which allows him to really push the  envelope and go even farther than he does on his TV show. Taped in San  Francisco at the famed Fillmore, Chappelle lets loose on such topics as  black celebrities, what it\'s like to have raunchy fans of his TV show  approach him while he\'s trying to enjoy Disneyland with his kids,  Michael Jackson, Kobe Bryant and crackheads, of course.&quot; -amazon.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=3383189699619539432" allowfullscreen="true" flashvars="fs=true">'),
	(539, 'Dave Chappelle: Killin\' Them Softly (2000)', '&quot;Dave Chappelle returns to D.C. and riffs on politics, police, race relations, drugs, Sesame Street and more. &quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=1215958813529322429&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(540, 'Eddie Izzard: Definite Article (1996)', '&quot;Well what can you say about Eddie Izzard? Well he is bloody funny to start with. This stage show which was recorded at the Shaftesbury theatre, London is without doubt one of his best. His topic of discusion range from Noah to fashion (cool, cool, normal, looking like a dick head, cool!) and from James Bond to why dogs got the first say in how to have sex and why all the other animals had to do it doggy style!&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=-7225497280072602900&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(541, 'Eddie Izzard: Dress to Kill (1999)', '       &quot;Executive transvestite Eddie Izzard takes his show to San Francisco to give a brief history of pagan and Christian religions, the building of Stonehenge, the birth of the Church of England and of Western empires, and the need for a European dream. Along the way, he dramatizes Dr. Heimlich\'s search for a maneuver, the naming of Engelbert Humperdinck, Scooby and Shaggy as archetypes, Neil Armstrong on the moon, society\'s tolerance of mass murderers, how we sing anthems and carols, Hollywood adapting British films, JFK\'s trip to Berlin, thoughts on puberty, and working school-book-French phrases into Paris conversation. Close-ups catch the glint in his eye and show his carefully-applied make-up.&quot; -imdb.com  ', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=2628774106022441566&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(542, 'Evening with Kevin Smith, An (2002)', '&quot;An Evening With Kevin Smith documents the director\'s 2001/2002 speaking tour through 5 stops, including Cornell University, Indiana University, Kent State University, University of Wyoming, and Clark University. Students from all 5 schools ask Kevin about anything ranging from his takes on religion to his relationship with Jason Mewes.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=4502884125992892434&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(543, 'First Howie Mandel Special, The (1983)', '&quot;Go crazy with the madcap Howie Mandel in this high-energy performance! The popular star of TV\'s St. Elsewhere and creative force behind the long-running animated series Bobby\'s World lets his inner child run wild with a variety of bizarre props, clever jokes and outrageous characters. With Howie\'s unbridled imagination and zany hilarity, you never know what\'s going to happen next! &quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/v70T6Fud6N0&hl=en_GB&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/v70T6Fud6N0&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(544, 'Gabriel Iglesias: Hot and Fluffy (2007) ', '&quot;Gabriel Iglesias is one of the fastest-rising comics today! With his unique brand of humor, lovable stage presence and wide range of voices and impressions, it\'s no wonder that he already has a huge fan following. He\'s been seen on Last Comic Standing, The Tonight Show with Jay Leno and Jimmy Kimmel Live!, and now you can see Comedy Central\'s &quot;Comic of the Year&quot; in his sold-out performance at the historic Fox Theatre in Bakersfield, California!&quot; -amazon.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://embed.trilulilu.ro/video/CopiluRau/aec281a8c5fd84.swf"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><param name="flashvars" value="username=CopiluRau&hash=aec281a8c5fd84&color=0xeaeaea"></param><embed src="http://embed.trilulilu.ro/video/CopiluRau/aec281a8c5fd84.swf" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476" flashvars="username=CopiluRau&hash=aec281a8c5fd84&color=0xeaeaea" ></embed></object>'),
	(545, 'George Carlin - Back in Town (1996)', '       Watch the rest on Trilulilu       &quot;George Carlin brings his comedy stylings to the Beacon theater in New  York City. He rants about Abortion, The death penalty, prison farms,  fart jokes, free floating hostility and words.&quot; -imdb.com ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://embed.trilulilu.ro/video/00070707000/33a5e5712bacd5.swf"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><param name="flashvars" value="username=00070707000&hash=33a5e5712bacd5&color=0xeaeaea"></param><embed src="http://embed.trilulilu.ro/video/00070707000/33a5e5712bacd5.swf" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476" flashvars="username=00070707000&hash=33a5e5712bacd5&color=0xeaeaea" ></embed></object>'),
	(546, 'George Carlin: Carlin on Campus (1984)', '&quot;Carlin brings some great comedy here.  In the form of not only stand-up, but  also in animation and a skit at the beginning.  He performs some classics,  like a place for your stuff, have a nice day, and the sports chant.  Great  entertainment all around.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=7929751666231984816&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(547, 'George Carlin: Complaints and Grievances (2001)', '&quot;In \'Complaints and Grievances,\' Carlin shamelessly exposes the people and subjects that irritate him the most. His bold brand of humor forces us to laugh at our own behavior when it comes to disgusting hygiene habits, those annoying family newsletters and people who use credit cards to pay for inexpensive items.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="video" value="http://static.video.yandex.ru/lite/ngc3000/fqiqgtcnwh.2908/"></param><param name="allowFullScreen" value="true"></param><param name="scale" value="noscale"></param><embed src="http://static.video.yandex.ru/lite/ngc3000/fqiqgtcnwh.2908/" type="application/x-shockwave-flash" width="580" height="476" allowfullscreen="true" scale="noscale" ></embed></object>'),
	(548, 'George Carlin: Doin\' It Again (1990) ', '&quot;George Carlin brings his comedy back to New Jersey and this time talks about Offensive Language, Euphemisms, They\'re Only Words, Dogs, Things you never hear, see or wanna hear, Some people are stupid, Cancer, Feminists, Good Ideas, Rape, Life\'s moments, and organ donors.&quot; -imdb.com', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://kpi-tube.org.ua/embed/30540"></param><param name="wmode" value="window"></param><param name="allowFullScreen" value="true"></param><param name="allowScriptAccess" value="always"><embed src="http://kpi-tube.org.ua/embed/30540" type="application/x-shockwave-flash" wmode="window" width="580" height="476" allowfullscreen="true" allowscriptaccess="always"></embed></object>'),
	(549, 'George Carlin... It\'s Bad for Ya! (2008)', '&quot;One of America\'s first and funniest counterculture comics rips into society\'s sacred taboos and institutions in a new, uncensored evening of stand-up comedy. Carlin\'s 14th original solo HBO stand-up special delivers dead-on, laugh-out-loud insights on such issues as: the advantages of being old, child worship and the failure of the so-called \'self-esteem\' movement &mdash; In other words, our abnormal preoccupation with BS. &quot;', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=-5489325822351974981&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(550, 'George Carlin: Jammin\' in New York (1992)', '&quot;Jammin\' In New York&quot; is George Carlin\'s eighth special to be seen on HBO, recorded on April 24 and 25, 1992 at the Paramount Theater, on the grounds of Madison Square Garden in New York City.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="video" value="http://static.video.yandex.ru/lite/ngc3000/3aexzbdjrw.2826/"></param><param name="allowFullScreen" value="true"></param><param name="scale" value="noscale"></param><embed src="http://static.video.yandex.ru/lite/ngc3000/3aexzbdjrw.2826/" type="application/x-shockwave-flash" width="580" height="476" allowfullscreen="true" scale="noscale" ></embed></object>'),
	(551, 'George Carlin: Playin\' with Your Head (1986)', '&quot;Legendary comedian George Carlin tackles some of his favorite subjects along with his brand of comedy and humor.&quot;', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=5200177469518230016&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(552, 'George Carlin: What Am I Doing in New Jersey? (1988)', '&quot;George Carlin changes his act by bringing politics into the act, but also talks about the People he can do without, Keeping People Alert, and Cars and Driving part 2.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=1153933672016735631&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(553, 'George Carlin: You Are All Diseased (1999)', '&quot;Legendary comic Carlin comes back to the Beacon theater to angrily rant  about airport security, germs, cigars, angels, children and parents,  men, names, religion, god, advertising, Bill Jeff and minorities.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed id="VideoPlayback" src="http://video.google.com/googleplayer.swf?docid=-8683046848311681223&hl=en&fs=true" style="width:580px;height:476px" allowfullscreen="true" allowscriptaccess="always" type="application/x-shockwave-flash">'),
	(554, 'HBO: One Night Stand - Flight of the Conchords (2005)', '       &quot;Flight of the Conchords (Jemaine Clement and Bret McKenzie), a folk parody duo from New Zealand, earned rave reviews at the Edinburgh Fringe Festival and Melbourne Comedy Festival. They won the Bass Ale Award-Best Alternative Act at this year\'s US Comedy Arts Festival.&quot; -hbo       &quot;HBO gave the group a special on their Friday night half-hour stand-up comedy series One Night Stand.&quot; -wikipedia     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/mlYkIJVguCU&color1=0xb1b1b1&color2=0xcfcfcf&hl=en&feature=player_embedded&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowScriptAccess" value="always"></param><embed src="http://www.youtube.com/v/mlYkIJVguCU&color1=0xb1b1b1&color2=0xcfcfcf&hl=en&feature=player_embedded&fs=1" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" width="580" height="476"></embed></object>'),
	(555, 'Jeff Dunham\'s Very Special Christmas Special (2008)', '&quot;The multi-platinum selling comedian performs his first holiday-themed stand-up special with his friends.&quot;', NULL, 0, 0, NULL, '<object width="580px" height="476px" ><param name="allowFullScreen" value="true"/><param name="wmode" value="transparent"/><param name="movie" value="http://mediaservices.myspace.com/services/media/embed.aspx/m=46675744,t=1,mt=video"/><embed src="http://mediaservices.myspace.com/services/media/embed.aspx/m=46675744,t=1,mt=video" width="580" height="476" allowfullscreen="true" type="application/x-shockwave-flash" wmode="transparent"></embed></object>'),
	(556, 'Jerry Seinfeld Stand-up in New York', ' 		  Watch the rest on YouTube 		  &quot;Jerry Seinfeld Stand-up in New York&quot; 		', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/iNCkrYma9N4&hl=en_GB&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/iNCkrYma9N4&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(557, 'Joe Rogan: Live! (2006)', '&quot;Regardless of Joe Rogan\'s success on television with the Ultimate Fighting Championship or hosting Fear Factor or co-starring in NewsRadio, his true love is stand-up comedy. With more than 15 years as a touring comedian, Rogan has honed an opinionated comedic style that challenges the status quo. From his unorthodox ideas for peace in the Middle East to debunking the myth of Noah\'s Ark and appreciating the vastness of space - all of the energy of a live Joe Rogan performance is captured on Joe Rogan: Live!&quot; -amazon.com', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=8928413583604160765&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(558, 'Katt Williams - The Pimp Chronicles Part 1 (2006)', '&quot;Comedian Katt Williams (aka Money Mike) showcases his laugh out loud comedic talents in his first ever HBO stand-up comedy DVD taped in front of a live audience. A native of Cincinnati, Ohio, Williams worked his way up the comedy club ladder before landing key television and film roles that displayed his flashy, sassy, streetwise style. In this hilarious 60-minute performance filmed at The Atlanta Civic Center on April 15th, 2006, Williams draws on his own personal experiences and his edgy take on life to bring the house down with laughter! With his unique personality, pimp-esque charisma, and endless supply of original jokes, Williams scores in this hilarious debut!&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=3517506926644129271&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(559, 'Kevin Hart: I\'m a Grown Little Man (2009)', '&quot;He electrifies the audience with a clever, animated style of comedy that cannot be duplicated and brings his audience to tears in this stand-up performance. He\'s hilarious as he pokes fun at everybody, but he\'s funniest when he\'s the brunt of the jokes! Fans who know him as the congenial host of BET\'s "Comic View: One Mic Stand" or from his outrageous characters in Soul Plane, The 40-Year-Old Virgin, Scary Movie 3 and 4 and Super Hero Movie will want to see Kevin Hart at his wisecracking best.&quot; -amazon.com', NULL, 0, 0, NULL, '<object width="580px" height="476px" ><param name="allowFullScreen" value="true"/><param name="wmode" value="transparent"/><param name="movie" value="http://mediaservices.myspace.com/services/media/embed.aspx/m=54698187,t=1,mt=video"/><embed src="http://mediaservices.myspace.com/services/media/embed.aspx/m=54698187,t=1,mt=video" width="580" height="476" allowfullscreen="true" type="application/x-shockwave-flash" wmode="transparent"></embed></object>'),
	(560, 'Kevin Pollak does killer Star Trek comedy', '&quot;Kevin havin fun with the Enterprize crew.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/e_kZJJUc4mQ&rel=1"></param><param name="wmode" value="transparent"></param><embed src="http://www.youtube.com/v/e_kZJJUc4mQ&rel=1" type="application/x-shockwave-flash" wmode="transparent" width="580" height="476"></embed></object>'),
	(561, 'Lee Evans: XL Tour Live 2005 (2005)', '       Watch the rest on YouTube       &quot;I have to admit to not having seen much of Lee Evans prior to seeing  this comedy show, but I know for sure that I\'ll be seeing a lot more of  him now! Evans\' comedy isn\'t particularly clever or witty, but he tells  in such a way that it\'s hard not laugh, and once you get into his zone,  the whole show becomes funny - and when you consider this is over two  hours long; that\'s quite an achievement, Mr Evans. The show focuses on  things that Evans hates, and features great sections on things like  machines, airports, women, the postal service and many other annoying  things are well observed, and often correct.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/EH-Q5gmFvMM&hl=en_GB&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/EH-Q5gmFvMM&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(562, 'No Cure for Cancer (1992)', '&quot;Ticked off comic Denis Leary talks honestly about subjects ranging from  smoking, red meat, drugs, his family, rehab, and yes, cancer.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=7862730076018325919" allowfullscreen="true" flashvars="fs=true">'),
	(563, 'Pablo Francisco - Bits and Pieces', '&quot;Pablo Francisco adds his brand of comedy to the Ad Lib Breakout Comedy  Series with Bits And Pieces, taped in Southern California in early 2004.&quot; -amazon.com ', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-5690034833946147548" allowfullscreen="true" flashvars="fs=true">'),
	(564, 'Ralphie May: Just Correct (2003)', '&quot;Cutting-edge comic Ralphie May brings his outrageous brand of confrontational stand up comedy to the stage in this performance that finds the equal opportunity offender addressing a wide variety of issues including race, fast food and sexuality.&quot; ~ Jason Buchanan, All Movie Guide', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=7617650986559551054&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(565, 'Ralphie May: Prime Cut (2007)', ' 		  Watch the rest on YouTube 		  &quot;Overweight (and proud of it) comedian Ralphie May performs his inimitable stand-up routine on PRIME CUT. May loves to take potshots at contemporary culture, and this time out he sets his sight on a dizzying array of topics such as flip-flops and mullets.&quot;     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/R5cZ7jfGwH8&amp;hl=en_GB&amp;fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/R5cZ7jfGwH8&amp;hl=en_GB&amp;fs=1" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(566, 'Richard Pryor Live on the Sunset Strip (1982)', ' 		  Watch the rest on YouTube 		  &quot;One of comedian Richard Pryor\'s live performances (at the Sunset Strip, obviously) caught on film. Pryor talks about most of his standard subjects, including rascism and the differences between blacks and whites, along with talking about some of his recent film roles.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/rBojifxzPzc?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/rBojifxzPzc?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(567, 'Robert Newman\'s History of Oil', '&quot;Robert Newman gets to grips with the wars and politics of the last hundred years - but rather than adhering to the history we were fed at school, the places oil centre stage as the cause of all commotion. This innovative history programme is based around Robert Newman\'s stand-up act and supported by resourceful archive sequences and stills with satirical impersonations of historical figures from Mayan priests to Archduke Ferdinand. Quirky details such as a bicycle powered street lamp on the stage brings home the pertinent question of just how we are going to survive when the world\'s oil supplies are finally exhausted.&quot;', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=-8957268309327954402&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(568, 'Rowan Atkinson Live (1992)', ' 		  Watch the rest on Dailymotion 		  &quot;Rowan Atkinson and Angus Deayton in Boston doing a live performance of  the same styles of humor we\'ve seen in Mr. Bean and Blackadder.  Included are lessons on Shakespearean acting, a school headmaster  meeting with the father of a boy he\'s beaten to death, and tips for  having a successful date.&quot; -imdb.com     ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.dailymotion.com/swf/video/x7lslb?width=&theme=none&foreground=%23F7FFFD&highlight=%23FFC300&background=%23171D1B&start=&animatedTitle=&iframe=0&additionalInfos=0&autoPlay=0&hideInfos=0"></param><param name="allowFullScreen" value="true"></param><param name="allowScriptAccess" value="always"></param><embed type="application/x-shockwave-flash" src="http://www.dailymotion.com/swf/video/x7lslb?width=&theme=none&foreground=%23F7FFFD&highlight=%23FFC300&background=%23171D1B&start=&animatedTitle=&iframe=0&additionalInfos=0&autoPlay=0&hideInfos=0" width="580" height="476" allowfullscreen="true" allowscriptaccess="always"></embed></object>'),
	(569, 'Russell Peters: Red, White and Brown (2008)', '&quot;It\'s easy to see why the multiethnic audience at a Russell Peters\' comedy show goes into hysterics over his racial jokes. Even when commenting on stereotypes--for example, that Indian people are cheap and proud of it--Peters\' characterizations are uncannily personal. It\'s not &quot;He\'s Indian so he can make fun of Indian people and get away with it&quot;; he makes fun of Asian, Latino, Arab, black, and white people too, and every time he imitates an accent or takes on a persona, he always seems to portray them from the inside. It goes beyond making a political point; it just feels casually, effortlessly human. And it\'s that casual humanity that makes it very, very funny. Topics range from a fairly sophisticated parsing of race and culture to a decidedly lowbrow discussion of body hair and male enhancement, but throughout Peters\' lack of pretension and unforced decency shines through. Be warned, many of his jokes are full of sexual and scatological references, and he has a startling routine about the deaf that will put some politically correct noses out of joint. If you think this sounds offensive, then Russell Peters is not for you--but that\'s your problem, not his. Red, White and Brown has bonus material that, startlingly enough, is actually funny (his merciless teasing of an Asian man and woman in the audience will make you cringe and laugh at the same time). Also included is a CD version of the exact same concert, though Peters\' expressive face is a big part of his act and not to be missed.&quot; --Bret Fetzer (amazon.com)', NULL, 0, 0, NULL, '<object width="580" height="476" data="http://www.guavaleaf.com/nuevo/player.swf" type="application/x-shockwave-flash"><param name="movie" value="http://www.guavaleaf.com/nuevo/player.swf"><param name="flashvars" value="config=http://www.guavaleaf.com/nuevo/econfig.php?key=95af115de1c414a1849c"><param name="allowscriptaccess" value="always"><param name="allowfullscreen" value="true"><param value="transparent" name="wmode"><param name="bgcolor" value="#000000"></object> 			<h1>Russell Peters: Red, White and Brown (2008)</h1> 		'),
	(570, 'Stephen Lynch: Live at the El Rey (2004)', '&quot;Comedian Stephen Lynch brings his guitar, choirboy-sweet voice, and sardonic (often bawdy) songs before an appreciative audience in the wacky Stephen Lynch: Live at the El Rey. Setting the tone with &quot;Not Home,&quot; in which Lynch testifies to the glories of pleasuring himself with his lover\'s undergarments, the comic digs an ever-deeper hole (in a good way, of course) with an ode to ugly newborns in &quot;Baby,&quot; cheerfully recalls sexual abuse at the hands of a priest in &quot;Priest,&quot; and caps the delicate &quot;Love Song&quot; with the blunt admission, &quot;I have herpes.&quot; A ditty called &quot;Superhero&quot; makes a great centerpiece, in which Lynch sounds like a pre-school teacher invoking the marvels of such make-believe characters as &quot;Awesome Man&quot; and &quot;Immigration Dude.&quot; (Lynch also does his impression of a bong during the bit.) Fellow funnyman Mark Teich joins Lynch on several tunes, including &quot;D&amp;D,&quot; an anthem to the geek universe of Dungeons and Dragons.&quot; -amazon.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-8268667562625514936" allowfullscreen="true" flashvars="fs=true">'),
	(571, 'White House Correspondents\' Dinner 2006', '&quot;At the annual dinner, current White House Correspondents\' Association president Mark Smith served as master of ceremonies. Ken Walsh presented youth scholarships and Ann Compton presented awards to colleagues for their work during the previous year. Incoming WHCA president Steve Scully presented C-SPAN video clips of presidential humor from President Kennedy through the current president. President Bush\'s humorous after-dinner presentation included an impersonator, Steve Bridges, who stood beside him and &quot;interpreted&quot; the president\'s remarks. Following the president, comedian Stephen Colbert made humorous remarks about various current events and the relationship between the press and the White House. He also presented a video of a mock press conference which ended in a chase scene featuring long-time White House correspondent Helen Thomas.&quot;', NULL, 0, 0, NULL, '<object id=\'cspan-video-player\' classid=\'clsid:d27cdb6eae6d-11cf-96b8-444553540000\' codebase=\'http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=9,0,0,0\' align=\'middle\' height=\'476\' width=\'580\'><param name=\'allowScriptAccess\' value=\'true\'/><param name=\'movie\' value=\'http://www.c-spanvideo.org/videoLibrary/assets/swf/CSPANPlayer.swf?pid=192243-1\'/><param name=\'quality\' value=\'high\'/><param name=\'bgcolor\' value=\'#ffffff\'/><param name=\'allowFullScreen\' value=\'true\'/><param name=\'flashvars\' value=\'system=http://www.c-spanvideo.org/common/services/flashXml.php?programid=165915&style=full\'/><embed name=\'cspan-video-player\' src=\'http://www.c-spanvideo.org/videoLibrary/assets/swf/CSPANPlayer.swf?pid=192243-1\' base=\'http://www.c-spanvideo.org/videoLibrary/assets/swf/\' allowscriptaccess=\'always\' bgcolor=\'#ffffff\' quality=\'high\' allowfullscreen=\'true\' type=\'application/x-shockwave-flash\' pluginspage=\'http://www.macromedia.com/go/getflashplayer\' flashvars=\'system=http://www.c-spanvideo.org/common/services/flashXml.php?programid=165915&style=full\' align=\'middle\' height=\'476\' width=\'580\'></embed></object>'),
	(572, 'Zach Galifianakis in Canada', 'This is a performance given by Zach Galifianakis at a comedy club in Canada. ', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/yWe6s4QXv20&hl=en&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/yWe6s4QXv20&hl=en&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(573, 'AC/DC - Live \'77 (2003) ', '&quot;Live \'77 is a DVD released by AC/DC in January 2003 in Japan. It was recorded live in The Golders Green Hippodrome, London and contains tracks recorded by the band with their former singer, Bon Scott.&quot; -wikipedia', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-3318042521012564199" allowfullscreen="true" flashvars="fs=true">'),
