	(575, 'Depeche Mode 101 (1989)', '&quot;Depeche Mode prepares for the 101st and final concert of its massive world tour at the Rose Bowl Stadium, Pasadena, California, while a group of fans who won a contest travel to the concert through the United States on a bus.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-3804452836996932559" allowfullscreen="true" flashvars="fs=true">'),
	(576, 'Genesis - Shepperton 1973: The 16mm Film', 'Recorded live at Shepperton Studios, Borehamwood, UK, on October 30 &amp; 31, 1973.', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/dDI_QK4XjIQ?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/dDI_QK4XjIQ?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(577, 'Gorillaz Live in Harlem', '&quot;Gorillaz perform the entirety of their album &quot;Demon Days&quot; live in Harlem. 0:34 Intro 1:35 Last Living Souls 4:56 Kids With Guns 8:51 O Green World [Dirty Harry Missing] 13:39 Feel Good Inc 17:34 El Manana 21:28 Every Planet We Reach Is Dead 26:55 November Has Come 29:46 All Alone 33:41 White Light 36:02 DARE 40:42 Fire Coming Out Of The Monkeys Head 44:27 Don\'t Get Lost In Heaven 46:32 Demon Days Encore 52:06 Hong Kong 59:20 Latin Simone&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/--QTzeFCwtg?fs=1&amp;hl=en_GB"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/--QTzeFCwtg?fs=1&amp;hl=en_GB" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(578, 'HBO: One Night Stand - Flight of the Concords (2005)', '&quot;Flight of the Conchords (Jemaine Clement and Bret McKenzie), a folk parody duo from New Zealand, earned rave reviews at the Edinburgh Fringe Festival and Melbourne Comedy Festival. They won the Bass Ale Award-Best Alternative Act at this year\'s US Comedy Arts Festival.&quot; -hbo       &quot;HBO gave the group a special on their Friday night half-hour stand-up comedy series One Night Stand.&quot; -wikipedia', NULL, 0, 0, NULL, '<embed src="http://player.youku.com/player.php/sid/XMTQ3OTkwMDQ=/v.swf" quality="high" width="580" height="476" align="middle" allowscriptaccess="sameDomain" type="application/x-shockwave-flash">'),
	(579, 'Jeff Buckley: Live in Chicago (2000) ', '&quot;Jeff Buckley - Live in Chicago includes songs from Grace, classic cover tunes (from sources ranging from Nina Simone to the MC5!), a previously unavailable Buckley composition (\'What Will You Say\'), a previously unreleased instrumental version of \'Vancouver,\' and between-the-songs on-stage banter. In addition to the full-length Chicago concert, the DVD edition of Live In Chicago features two extremely rare in-the-studio acoustic songs: \'So Real\' and \'Last Goodbye\' as well as the Electronic Press Kit (EPK) for Grace (which has been previously unavailable commercially), interactive menus, instant chapter access to songs and a discography of Jeff\'s Columbia Records releases.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=4955431364989527869" allowfullscreen="true" flashvars="fs=true">'),
