	(583, 'MTV in 1983', '&quot;Old VHS recording of MTV from 1983 (Mark Goodman as VJ) including commercials. Some of the music videos include: Night Ranger - Don\'t Tell Me You Love Me Huey Lewis & The News - Heart & Soul The Tubes - Monkey Time Price - Little Red Corvette George Thorogood & The Destroyers - Bad To The Bone The Police - Synchronicity II Sammy Hagar - Your Love Is Driving Me Crazy Steve Miller Band - Jet Airliner Kansas - Fight Fire With Fire Michael Bolton - Fool\'s Game Quiet Riot - Cum On Feel The Noize Bow Wow Wow - Do You Wanna Hold Me? The Who - You Better You Bet The Motels - Suddenly Last Summer Madness - Our House Nick Heyward - Whistle Down The Wind&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-5905210375134304831" allowfullscreen="true" flashvars="fs=true">'),
	(584, 'Neil Young in Concert 1971', 'Neil Young  doing his thing.', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-1626197152950573921" allowfullscreen="true" flashvars="fs=true">'),
	(585, 'Nirvana - Live at the Hollywood Rock Festival 1993', '&quot;The fourth edition of Hollywood Rock is regarded as the best of all 7 years. It was definitely the most publicised &ndash; with Grunge going full blast around the world, renowned bands such as Nirvana, Alice in Chains and L7 headlined the festival, along with the Red Hot Chili Peppers and Simply Red. Nirvana\'s controversial performances both in S&atilde;o Paulo and Rio generated much discussion amongst fans and the media. Kurt Cobain, appearing very intoxicated, spat on the lenses of all TV cameras placed around the stage (the concert was being broadcasted live by Globo TV), and attempted to destroy stage props and equipment. Some footage from the concert in Rio de Janeiro can be seen on Nirvana\'s Live! Tonight! Sold Out!! home video. Due to the high demand for tickets, the venue for the S&atilde;o Paulo concerts was changed back to the larger Morumbi stadium.&quot; -wikipedia', NULL, 0, 0, NULL, '<embed id=VideoPlayback src=http://video.google.com/googleplayer.swf?docid=2608092833344412748&hl=en&fs=true style=width:580px;height:476px allowfullscreen=true allowscriptaccess=always type=application/x-shockwave-flash>'),
	(586, 'Pink Floyd - Dark Side of the Rainbow', 'Watch the rest on YouTube       &quot;Dark Side of the Rainbow (also known as Dark Side of Oz) is a perceived effect created by listening to the 1973 Pink Floyd concept album The Dark Side of the Moon while watching the 1939 film The Wizard of Oz for moments where the film and the album appear to correspond with each other. The title of the music video-like experience comes from a combination of the album title The Dark Side of the Moon and the film\'s song \'Over the Rainbow.\'&quot;</span> -wikipedia</p>', NULL, 0, 0, NULL, '<object width="581" height="476"><param name="movie" value="http://www.youtube.com/v/KmCfvcfHwKA&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/KmCfvcfHwKA&hl=en&fs=1" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(587, 'Radiohead at Glastonbury 2003', '&quot;As part of an ongoing effort to HD everything, here is Glastonbury 2003 in HD :)!       I\'m not overly happy with the quality, but it\'s as soon as it gets for under 1gb :(       --Track Listing--       There There\r\n         2+2=5\r\n         Lucky\r\n         The National Anthem\r\n         Talk Show Host\r\n         Where I End And You Begin\r\n         Climbing Up The Walls\r\n         The Gloaming\r\n         No Surprises\r\n         Fake Plastic Trees\r\n         Sit Down, Stand Up\r\n         Go To Sleep\r\n         Sail To The Moon\r\n         Paranoid Android\r\n         Idioteque\r\n         Everything In It\'s Right Place       --Encore--       Just\r\n         Karma Police\r\n         Street Spirit (Fade Out)&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/jFjAWhY1Amg&hl=en&fs=1"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/jFjAWhY1Amg&hl=en&fs=1" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(588, 'Radiohead - Reading 1994', '&quot;Reading 1994 was a 12 song show, only available in it\'s entirety in a 320x240 version. WOWOW had a 7 song DVD version that cut off the end of Anyone Can Play Guitar.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youtube.com/v/nd9dDSGOXb0&hl=en_GB&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/nd9dDSGOXb0&hl=en_GB&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476"></embed></object>'),
	(589, 'Rage Against the Machine live at Rock am Ring 2000', '&quot;Rock am Ring (Rock at the Ring) is a rock music festival held annually in Germany at the N', NULL, 0, 0, NULL, '<object type=\'application/x-shockwave-flash\' classid=\'clsid:d27cdb6e-ae6d-11cf-96b8-444553540000\' codebase=\'http://fpdownload.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=9,0,124,0\' width=\'580\' height=\'476\' id=\'mncHMovie\' align=\'middle\'><param name=\'quality\' value=\'high\'><param name=\'bgcolor\' value=\'#ffffff\'><param name=\'movie\' value=\'http://dory.mncast.com/mncHMovie.swf?movieID=10046193520070729162627&skinNum=1\'><param name=\'wmode\' value=\'transparent\' /><embed src=\'http://dory.mncast.com/mncHMovie.swf?movieID=10046193520070729162627&skinNum=1\' type=\'application/x-shockwave-flash\' width=\'580\' height=\'476\' wmode=\'transparent\'></embed></object>       <h1>Rage Against the Machine live at Rock am Ring 2000</h1>     '),
	(590, 'Rammstein: Live aus Berlin (1999)', '&quot;Very few live videos can produce the sheer   power of what Rammstein can do. With their   trademark flamethrowers and high adrenaline   stage antics, Rammstein remains one of   those cult bands which most people will   never get to see in person (like myself). Until   the day I get to see them in person, this video   will have to be my single concert experience   of one of my favorite bands.&quot; -imdb.com', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-4778405219383786364" allowfullscreen="true" flashvars="fs=true">'),
	(591, 'Red Hot Chili Peppers live at Rock Werchter 2006', '&quot;Red Hot Chili Peppers live at Rock Werchter 2006  Full show recorded from Skynet live webstream.&quot;', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-3979746648226949027" allowfullscreen="true" flashvars="fs=true">'),
	(592, 'Red Hot Chili Peppers: Live at Slane Castle (2003)', '&quot;1.INTRO 2.BY THE WAY 3.JAM 4.SCAR TISSUE 5.AROUND THE WORLD (INTRO) 6.AROUND THE WORLD 7.MAYBE 8.UNIVERSALLY SPEAKING 9.PARALLEL UNIVERSE (INTRO) 10.PARALLEL UNIVERSE 11.THE ZEPHYR SONG 12.THROW AWAY YOUR TELEVISION 13.HAVANA AFFAIR 14.OTHERSIDE 15.PURPLE STAIN 16.IRISH NATIONAL ANTHEM 17.DON\'T FORGET ME 18.RIGHT ON TIME (INTRO) 19.RIGHT ON TIME 20.CAN\'T STOP 21.VENICE QUEEN (INTRO) 22.VENICE QUEEN 23.GIVE IT AWAY 24.ENCORE BREAK, DRUM &amp; TRUMPET SOLO 25.CALIFORNICATION (INTRO) 26.CALIFORNICATION 27.UNDER THE BRIDGE 28.JAM 29.POWER OF EQUALITY 30.GIVE IT AWAY 31.THE ZEPHYR SONG 32.RIGHT ON TIME 33.CAN\'T STOP 34.THROW AWAY YOUR TELEVISION 35.PARALLEL UNIVERSE enjoy...&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=934320140327789739" allowfullscreen="true" flashvars="fs=true">'),
	(593, 'Sex Pistols - Live In Winterland 1978', '&quot;Includes: \'God Save The Queen\', \'I Wanna Be Me\', \'Seventeen\', \'New York\', \'EMI\', \'Belsen Was A Gas\', \'Bodies\', \'Holidays In The Sun\', \'Liar\', \'No Feelings\', \'Problems\', \'Pretty Vacant\' and \'Anarchy In The UK\'.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-5414812014623876734" allowfullscreen="true" flashvars="fs=true">'),
	(594, 'Slayer: Live Intrusion (1995)', '&quot;Slayer: Live Intrusion includes 12 original Slayer songs and a cover of Venom\'s &quot;Witching Hour.&quot; In between the songs are clips of the band in interviews, as well as footage from behind the scenes and backstage. Slayer is known for high-energy shows and this video doesn\'t spare any energy.&quot; -Amy Lewis, All Movie Guide', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-7742357254534800739" allowfullscreen="true" flashvars="fs=true">'),
	(595, 'Slipknot - Disasterpieces (2002)', '&quot;Featuring the band in their element - the live arena - this full-length live show is a stunning mix of visual mayhem and brutal, extreme heavy metal. No band around can top the Slipknot experience, with concussion bombs, flames, lasers, rotating drum risers and a whole lot more going on, you\'re simply not going to be able to take your eyes off the on-screen carnage. All of Slipknot\'s music videos are also presented, including the never-before-seen animated promo for \'Wait &amp; Bleed.\'&quot;', NULL, 0, 0, NULL, '<embed src="http://player.youku.com/player.php/sid/XMTE3NzEwNDQ4/v.swf" quality="high" width="580" height="476" align="middle" allowscriptaccess="sameDomain" type="application/x-shockwave-flash">'),
	(596, 'Slipknot - Rock In Rio', '&quot;Slipknots Full Set @ The Rock In Rio Festival In Portugal&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-192638441509759690" allowfullscreen="true" flashvars="fs=true">'),
	(597, 'Stone Sour - Rock Am Ring 06', '&quot;Stone Sour - Rock Am Ring 06 Full Set&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-511251325352324715" allowfullscreen="true" flashvars="fs=true">'),
	(598, 'U2 on YouTube - Live from the Rose Bowl (2009)', '&quot;The world\'s greatest band on the world\'s largest stage - U2 on YouTube. Watch the rebroadcast of the full live streaming performance from the Rose Bowl. Recorded on Sunday, October 25th.&quot;', NULL, 0, 0, NULL, '<object width="580" height="476"><param name="movie" value="http://www.youclubvideo.com/req/swf/player.swf"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><param name="flashvars" value="config=http://www.youclubvideo.com/embedCfg.js?mid=85823"></param><embed src="http://www.youclubvideo.com/req/swf/player.swf" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="580" height="476" flashvars="config=http://www.youclubvideo.com/embedCfg.js?mid=85823"></embed></object>'),
	(599, 'Wizard of Oz - Dark Side of the Moon', '&quot;Pink Floyd\'s Dark Side of the Moon dubed over The Wizard of OZ. You\'ve heard the rumors, now watch for yourself! Unbelievable.&quot;', NULL, 0, 0, NULL, '<embed style="width:580px; height:476px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-76123313707631450" allowfullscreen="true" flashvars="fs=true">'),
	(600, 'Wolfmother on JTV Live', '&quot;Wolfmother\'s preview of new album released May 2.  &quot;', NULL, 0, 0, NULL, '<embed style="width:560px; height:456px;" id="VideoPlayback" type="application/x-shockwave-flash" src="http://video.google.com/googleplayer.swf?docId=-4319514797047210444" allowfullscreen="true" flashvars="fs=true">'),
	(628, 'VLC Media Player', 'VLC media player is a free and open source media player and multimedia framework written\r\n      by the VideoLAN project. VLC is a portable multimedia player, encoder, and streamer\r\n      supporting many audio and video codecs and file formats as well as DVDs, VCDs, and\r\n      various streaming protocols. It is able to stream over networks and to transcode multimedia\r\n      files and save them into various formats. VLC used to stand for VideoLAN Client, but since\r\n      VLC is no longer simply a client, that initialism no longer applies.\r\n      \r\n      Windows: Download VLC Media Player \r\n        Mac OSX:  Download VLC Media Player \r\n        ', '20090624181539!VLC_icon.png', 0, 0, 'http://sourceforge.net/projects/vlc/files/1.1.4/win32/vlc-1.1.4-win32.exe/download', NULL),
	(629, 'Apple Quicktime Player', 'QuickTime is an extensible proprietary multimedia framework developed by Apple Inc.,\r\n      capable of handling various formats of digital video, picture, sound, panoramic images, and\r\n      interactivity. It is available for Mac OS classic (System 7 onwards), Mac OS X and Microsoft\r\n      Windows operating systems. The latest version is QuickTime X (10.0) and is currently only\r\n      available on Mac OS X v10.6.\r\n      \r\n      Windows: Download Apple QuickTime Player\r\n      Mac OSX: Download Apple QuickTime Player', 'quickTime_icon.png', 0, 0, 'https://swdlp.apple.com/cgi-bin/WebObjects/SoftwareDownloadApp.woa/1979/wo/IybkkMB0hXedBxFlOYeZQ0/2.5', NULL),
	(630, 'Adobe Flash Player', 'The Adobe Flash Player is software for viewing animations and movies using computer\r\nprograms such as a web browser. Flash Player is a widely distributed proprietary multimedia\r\nand application player created by Macromedia and now developed and distributed by Adobe\r\nafter its acquisition. Flash Player runs SWF files that can be created by the Adobe Flash\r\nauthoring tool, by Adobe Flex or by a number of other Macromedia and third party tool. \r\n\r\nWindows:Download Adobe Flash Player\r\nMac OSX: Download Adobe Flash Player', 'icon_flash.png', 0, 0, 'http://get.adobe.com/nl/flashplayer/', NULL),
	(631, 'DivX Player', 'DivX is a brand name of products created by DivX, Inc. (formerly DivXNetworks, Inc.),\r\n          including the DivX Codec which has become popular due to its ability to compress lengthy\r\n          video segments into small sizes while maintaining relatively high visual quality.\r\n          There are two DivX codecs; the regular MPEG-4 Part 2 DivX codec and the H.264/MPEG-\r\n          4 AVC DivX Plus HD codec. It is one of several codecs commonly associated with "ripping",\r\n          whereby audio and video multimedia are transferred to a hard disk and transcoded.\r\n          \r\n          Windows: Download DivX Player\r\n            Mac OSX: Download DivX Player\r\n          ', 'divx-icon.gif', 0, 0, 'http://dist.divx.com/divx/DivXInstaller.exe', NULL),
	(632, 'Windows Media Player', 'Windows Media Player (abbreviated WMP) is a proprietary digital media player and media\r\nlibrary application developed by Microsoft that is used for playing audio, video and viewing\r\nimages on personal computers running the Microsoft Windows operating system, as well as\r\non Pocket PC and Windows Mobile-based devices. Editions of Windows Media Player were\r\nalso released for Mac OS, Mac OS X and Solaris but development of these has since been\r\ndiscontinued.\r\n\r\nWindows:Download Windows Media Player', 'WMP_copy_11-09-2008_23_01.jpg', 0, 0, 'http://www.microsoft.com/downloads/MozillaValidation.aspx?familyid=b446ae53-3759-40cf-80d5-cde4bbe07999&displaylang=en', NULL),
	(633, 'BS Player', 'BS.Player ™ is used by more than 70 million multi media users throughout the world and it has been translated into more than 90 languages worldwide. All downloaded versions of our FREE version exceed the sum of all downloads of competitive media players and payable DivX or DVD players. Because it does not use much of the CPU processing resources for multimedia playback it is suitable for all those who use slightly less capable computers. Now, you can finally enjoy the playback of HD DVD and AVCHD movies of the highest quality with minimal system requirements. BS.Player can playback any YouTube movie directly from the internet and save it to local disk. \r\n        \r\n        Windows:Download BS Player', 'bs_player-60594.png', 0, 0, 'http://bsplayer.en.softonic.com/download', NULL),
	(634, 'Real Media (RM) Alternative', 'An alternate way of watching RM files without having to install the Real Media player, which\r\ncan be slow and bulky to load. This tool will play video using a light-weight player you\r\nprobably already have on your system, like Media Player Classic.\r\n\r\nWindows: Download Real Media (RM) Alternative ', 'real-alternative.jpg', 0, 0, 'http://nl.afterdawn.com/downloads/algemeen/download_splash.cfm/real_alternative', NULL),
	(635, 'Elecard MPEG Player', 'Experience for yourself, download and install Elecard MPEG Player today! Elecard MPEG\r\nPlayer is DirectShow® compatible software providing high resolution, full quality decoding\r\nof MPEG-1, MPEG-2, MPEG-4 SP/ASP, AVC/H.264*, 3GP. With its decoder optimized for\r\nthe most efficient CPU usage, Elecard MPEG Player is a great choice for those who strive for\r\nhigh performance and robustness using low power hardware. Reliable support of a number\r\nof common multimedia formats such as AVI, WAV, MP3, MOV, and others greatly benefits\r\nall Elecard MPEG Player consumers by bringing all the richness and excitement of HD DVD\r\ninto their homes.\r\n\r\nWindows: Download Elecard MPEG Player', '1946505172.jpeg', 0, 0, 'http://dl-zone.info/Elecard MPEG Player', NULL),
	(636, 'GOM Media Player', 'GOM Player includes many codecs (XviD, DivX, FLV1, AC3, OGG, MP4, H263 and more)\r\nso you won\'t need to install separate codecs for most videos. For those videos that require a\r\nseparate codec, GOM Player will find one and direct you to a place where you can download\r\nan open source version of the codec. That way, you won\'t get stuck with unnecessary codecs\r\non your system.\r\n\r\nWindows: Download Gom Media Player', '678905669614785255.png', 0, 0, 'http://dl-zone.info/GOM Media Player', NULL),
	(637, 'WinAmp Media Player  ', 'The free customizable Winamp media player that plays mp3 + other audio files, syncs your\r\n        iPod, subscribes to Podcasts and more. Winamp is a media player for Windows-based PCs, written by Nullsoft, now a subsidiary\r\n        of AOL. It is proprietary freeware/shareware, multi-format, extensible with plug-ins and\r\n        skins, and is noted for its graphical sound visualization, playlist, and media library features.\r\n        Winamp was released by Justin Frankel in 1997, and its popularity grew quickly, along with\r\n        the developing trend of MP3 file-sharing.\r\n        \r\n        Windows: Download Winamp Media Player        \r\n        ', 'Winamp_dock_icon_by_furiousfelinefuries.png', 0, 0, 'http://winamp.en.softonic.com/download', NULL),
	(638, 'RealPlayer', 'RealPlayer is a closed source cross-platform media player by RealNetworks that plays a\r\nnumber of multimedia formats including MP3, MPEG-4, QuickTime, Windows Media, and\r\nmultiple versions of proprietary RealAudio and RealVideo formats.\r\n\r\nWindows: Download RealPlayer', 'RealPlayer-icon.jpg', 0, 0, 'http://client-software.real.com/free/windows/installer/stubinst/stub/rp15/R71UKD/RealPlayer.exe', NULL),
	(639, 'Veoh TV', 'Veoh, an Internet Television company based in San Diego, California, allows users to find\r\nand watch major studio content, independent productions and user-generated material.\r\nContent is significantly restricted to access just within the United States.[3][4]. The company\r\nis a subsidiary of Israeli start-up Qlipso.The company received media attention[5] after\r\nMichael Eisner, a former Disney chairman, joined the board. In April 2006, he was one of\r\nthe investors (along with Time Warner) in the US$12.5 million second round of financing\r\nfor Veoh and re-affirmed his status in August 2007 as an investor in the company\'s US$25\r\nmillion Series C financing round.\r\n\r\nWindows: Download Veoh TV', 'veoh_11.jpg', 0, 0, 'http://ll-appserver.veoh.com/static/downloads/client/VeohWebPlayerSetup_eng.exe', NULL),
	(655, 'VideoDownloadX\r\n', 'YouTube.com is an excellent website that allows you to view saved videos on their servers.\r\nUnfortuneatly YouTube doesn\'t allow you to download these videos. videodownloadx.com allows\r\nyou to save videodownloadx videos and download videodownloadx videos easily using only your\r\nIE or firefox browser. \r\n\r\nVisit VideoDownloadX', 'vdx.jpg', 0, 0, 'http://www.videodownloadx.com/', NULL),
	(656, 'ZamZar  ', 'Zamzar supports conversion between a wide variety of different file formats. We\'re\r\nadding support for new formats all the time. Online file conversion, covering a wide\r\nrange of different image, document, music, video and compression formats. \r\n\r\nVisit ZamZar', 'ZamzarIcon.jpg', 0, 0, 'http://www.zamzar.com/', NULL),
	(657, 'YouTubia', 'YouTubia.com is a YouTube clone that lets you download and save YouTube videos (as FLV\r\nformat) easily using your IE or Firefox browser. Downloaded FLV videos can be viewed\r\noffline for unlimited consumption. YouTube videos are downloaded in the new .FLV (flash\r\nvideo) format, and you will need a FLV Player to watch them. You might have to rename the\r\nfile extension of the downloaded video file to be ".flv" before you can play it. \r\n\r\nVisit Youtubia', 'youtubia.gif', 0, 0, 'http://www.youtubia.com/', NULL),
	(658, 'VideoDownloader    ', 'Video DownloadHelper is an extension for the Mozilla Firefox web browser. It allows the\r\nuser to download videos from sites that use a Flash video player, such as YouTube. The\r\nextension was developed by mig. The current stable release of Video DownloadHelper is\r\nversion 4.8, released on July 26, 2010. \r\n\r\nDownload VideoDownloader', '', 0, 0, 'https://addons.mozilla.org/nl/firefox/addon/video-downloadhelper/', NULL),
	(659, 'HeatSeek (Adult content browser)', 'HeatSeek is an Adult content Browser, Downloader, Media Player, and Organizer. Totally\r\nprivate, secure, built-in popup blocker, safely browse any website. \r\n\r\nDownload HeatSeek', 'heatseek.jpg', 0, 0, 'http://www.heatseek.com/download.php', NULL),
	(660, 'KeepVid', 'Download and save videos directly from Youtube, Google, Metacafe, Putfile and more.\r\nSimply copy and paste. \r\n\r\nDownload KeepVid', 'keepvid_logo76.gif', 0, 0, 'http://keepvid.com/', NULL),
	(661, 'K-Lite Codec Pack', 'K-Lite (Mega) Codec Pack is a collection of audio and video components for Microsoft\r\nWindows that enables the operating system and its software to play back various audio and\r\nvideo formats generally not supported by the operating system itself. K-Lite Codec Pack also\r\nincludes several related tools, including Media Player Classic, GSpot Codec Information\r\nAppliance and Codec Tweak Tool.\r\n\r\nWindows: Download K-Lite Codec Pack\r\n', 'k-lite_codec_pack-75069-1244617317.jpeg', 0, 0, 'http://files1.freesoft.ru/mm-mm/K-Lite_Codec_Pack_640_Basic.exe', NULL),
	(662, 'Xvid Codec Pack', 'XviD is a free codec and video compression utility. XviD is a free codec and video\r\n          compression utility. It allows even the most demanding user to delve deep into the\r\n          customisation of a video stream. XviD offers a sharper image than it\'s direct competitors and\r\n          offers advanced features like encoding according to file size. If you want a video, that doesn´t\r\n          need to much of space, install Xvid and convert them to this format.\r\n          \r\n          Windows: Download Media Xvid Codec Pack\r\n            Mac OSX: Download Media Xvid Codec Pack\r\n          ', 'fichiers-xvid-icon.png', 0, 0, 'http://download.divxmovies.com/XviD-1.2.2-07062009.exe', NULL),
	(663, 'XP Codec Pack', 'XP Codec Pack: is one of the most complete codec pack which helps you to play all major\r\naudio and video formats.\r\n\r\nWindows: Download XP Codec Pack', 'XP-Codec-Pack.png', 0, 0, 'https://swdlp.apple.com/cgi-bin/WebObjects/SoftwareDownloadApp.woa/1979/wo/IybkkMB0hXedBxFlOYeZQ0/2.5', NULL),
	(664, 'Codec Pack All-in-1', 'Codec Pack All in 1 is a collection of codecs that will help you play almost any DivX movie.\r\nAll you need to see DivX movies: DivX, XviD, AC3.\r\n\r\nWindows :Download Codec Pack All-in-1', 'codecs-megapack-january-2009.jpg', 0, 0, 'http://filedl.com/download.php?id=56&file=Codecs6030_allin1.exe', NULL),
	(665, 'Media Player Codec Pack', 'The Media Player Codec Pack is a simple to install package of codecs/filters/splitters used for\r\nplaying back music and movie files. After installation you will be able to play 99.9% of files\r\nthrough your media player, along with XCD\'s, VCD\'s, SVCD\'s and DVD\'s. Also included in\r\nthe package are a number of encoder codec\'s, allowing you to encode files in formats such\r\nas DivX. XviD, x264 and many more in your favourite encoding application. Compression\r\ntypes supported include DivX, XviD, x264, h.264 and many more in AVI, MKV, OGM,\r\nMP4 files. Video file types supported include 3GPP, AVI, MKV, OGM, MP4, MPG, MPEG,\r\nVOB, DAT, FLV, PS, TS, NUV. Audio file types supported include AC3, DTS, AAC, APE,\r\nFLAC, TTA, WV, OGG, Vorbis, MO3, IT, XM, S3M, MTM, MOD, UMX. Please note that\r\nprotected formats may require a specific player. All versions of Windows Media Player are\r\nsupported as well as most other players. The package supports 32bit and 64bit versions of\r\nWindows.\r\n\r\nWindows: Download Media Player Codec Pack ', '30jrayt.jpg', 0, 0, 'http://dl-zone.info/media-codec-pack', NULL),
	(666, 'Fantasy Codec Pack\r\n    ', 'Fantasy Codec Pack download free: Good codec pack and some video utilities. If you usually\r\nhave problems when playing multimedia files due to compatibility problems.\r\n\r\nWindows: Download Fantasy Codec Pack', '', 0, 0, 'http://dutch.ircfast.com/lv/software/download/kl47883.htm', NULL),
	(667, 'Cabos ', 'Cabos is a stripped down lightweight peer-to-peer file sharing application based on Limewire, which uses the Gnutella network (currently the 3rd biggest).\r\n        Cabos\' interface will be instantly recognizable to anyone who\'s used Limewire before - you have your networks, downloads and uploads easy accessible on the left sidebar, above which sits the search bar and your current searches. The retouched Cabos interfaced looks simple yet modern, certainly an improvement over the aging appearance of earlier versions.\r\n        \r\n        Windows: Download now\r\n        Mac: Download now\r\n        ', '36x36_0.png', 0, 0, 'http://sourceforge.jp/projects/cabos/downloads/45889/Cabos-0.8.2-Windows.msi/', NULL),
	(668, 'Alliance ', 'Alliance takes the best from BitTorrent, Direct Connect and Waste and creates a decentralized and secure p2p network. It is a private and secure environment to share files and communicate with people you know. Alliance works on Windows, Linux and Mac.\r\n        \r\n        Windows: Download now\r\n        Mac: Download now \r\n        ', 'logo.gif', 0, 0, 'https://swdlp.apple.com/cgi-bin/WebObjects/SoftwareDownloadApp.woa/1979/wo/IybkkMB0hXedBxFlOYeZQ0/2.5', NULL),
	(669, 'FrostWire ', 'FrostWire is a peer-to-peer file sharing program for the gnutella and BitTorrent protocols. FrostWire is written in Java, and is a fork of LimeWire, another popular gnutella client from which it was originally born.[1][2] Released under the GNU General Public License, \r\n        \r\n        Windows: Download now\r\n        Mac: Download now \r\n        ', 'For.png', 0, 0, 'http://www.frostwire.com/downloads/?from=404', NULL),
	(670, 'Bittorrent ', 'BitTorrent is a peer to peer program. The BitTorrent client enables a user to search for and download torrent files using a built-in search box (“Search for torrents”) in the main window, which opens the BitTorrent torrent search engine page with the search results in the user’s default web browser.\r\n        The current client includes a range of features, including multiple parallel downloads. BitTorrent has several statistical, tabular and graphical views that allow a user to see what events are happening in the background. A host of views offer information on the peers and seeds to which the user is connected, including how much data is being downloaded from each and to how much data is being uploaded ftera . It has an automatic recovery system that checks all data that has been handled ftera n improper shutdown. It also intermediates peering between itself, source file servers (“trackers”) and other clients, thereby yielding distribution efficiencies. The client also enables users to create and share torrent files. Download BitTorrent\r\n          \r\n          Windows: Download now\r\n            Mac OSX: Download now\r\n          ', 'bittorrent.png', 0, 0, 'https://swdlp.apple.com/cgi-bin/WebObjects/SoftwareDownloadApp.woa/1979/wo/IybkkMB0hXedBxFlOYeZQ0/2.5', NULL),
	(671, 'uTorrent ', 'BitTorrent (often abbreviated to \'BT\') is a protocol that allows you to download files quickly and efficiently. It is a peer to peer protocol, which means you download and upload to other people downloading the same file. BitTorrent is often used for distribution of very large files, very popular files and files available for free, as it is a cheap, fast, efficient way to distribute files to users like you.\r\n        \r\n        Windows: Download now\r\nMac: Download now        \r\n        ', 'utorrent.png', 0, 0, 'https://swdlp.apple.com/cgi-bin/WebObjects/SoftwareDownloadApp.woa/1979/wo/IybkkMB0hXedBxFlOYeZQ0/2.5', NULL),
	(672, 'Vuze ', 'Vuze (previously Azureus) is a BitTorrent client used to transfer files via the BitTorrent protocol. Vuze is written in Java, and uses the Azureus Engine. In addition to downloading data linked to by .torrent files, Azureus allows users to view, publish and share original DVD and HD quality video content.[2] Content is presented through channels and categories containing TV shows, music videos, movies, video games and others. Additionally, if users prefer to publish their original content, they may earn money from it.\r\n        \r\n        Windows : Download now\r\n        Mac : Download now \r\n        ', 'vuze.png', 0, 0, 'http://cf1.vuze.com/files/Vuze_Installer.exe', NULL),
	(673, 'Shareaza ', 'Shareaza is a peer-to-peer file sharing client running under Microsoft Windows which supports the gnutella, Gnutella2 (G2), eDonkey, BitTorrent, FTP and HTTP network protocols and handles magnet links,[3] ed2k links, and the now deprecated gnutella and Piolet links.[4] It is available in 30 languages.\r\n          \r\n          Windows: Download now\r\n          ', 'shareaza_logo.png', 0, 0, 'https://swdlp.apple.com/cgi-bin/WebObjects/SoftwareDownloadApp.woa/1979/wo/IybkkMB0hXedBxFlOYeZQ0/2.5', NULL),
	(674, 'aMule ', 'aMule stands for all-platform eMule file-sharing program. It is affiliated with the eMule project and was forked from xMule on 08/2003. It connects to the eDonkey2000 network, supports Linux, Mac, Solaris, *BSD platforms, and nearly every processor arch.\r\n        \r\n        win: : Download now', 'amule.png', 0, 0, 'http://sourceforge.net/projects/amule/files/aMule/2.2.6/aMule-2.2.6-installer.exe/download', NULL),
	(675, 'Rapidshare ', 'RapidShare is a Swiss German-owned one-click hosting pay- and free-service (with certain restrictions and limitations) website that operates from Switzerland and is financed by the subscriptions of paying users. RapidShare is one of the world\'s largest file-hosting sites, with 10 petabytes of files on its servers, and handling up to three million users simultaneously. \r\n        \r\n        Visit Rapid Share\r\n        ', 'rapid.png', 0, 0, 'https://www.rapidshare.com/', NULL),
	(676, 'iMesh  ', 'iMesh is a media and file sharing client with online social network features, available in 9 languages. It uses a proprietary, centralized, P2P network (IM2Net) operating on ports 80, 443 and 1863. iMesh is owned by an American company iMesh, Inc. and maintains a development center in Israel. It is the 3rd most popular music subscription service in the US. iMesh operates the first "RIAA-approved" P2P service, allowing users residing in United States and Canada to download music content of choice for a monthly fee in the form of either a Premium subscription or a "ToGo" subscription. A third option is also available for users (residing in either country) to permanently purchase tracks for 0.99 USD each, without a subscription. In addition to the paid content, iMesh allows all users (regardless of origin country) access to "non-copyrighted" music and video files. A legalized ringtone download service provided by Thumbplay is also available, allowing users to purchase ringtones for their cellphones.\r\n\r\nWindows: Download now', 'imesh-logo.png', 0, 0, 'http://download.cdn.imesh.com/r/cdn/0/iMeshV11.exe', NULL),
	(677, 'BearShare\r\n  ', 'BearShare is a peer-to-peer file sharing application originally created by Free Peers, Inc. for Microsoft Windows, and now sold by MusicLab, LLC (iMesh).\r\n        Bearshare was a Gnutella-based peer-to-peer file sharing application, with a support forum. The original operators of Free Peers, Inc. were Vincent Falco and Louis Tatta. Download Bearshare.\r\n\r\nWindows: Download now', 'Bearshare.png', 0, 0, 'https://swdlp.apple.com/cgi-bin/WebObjects/SoftwareDownloadApp.woa/1979/wo/IybkkMB0hXedBxFlOYeZQ0/2.5', NULL),
	(678, 'ModSecurity', 'ModSecurity is a web application firewall that can work either embedded or as a reverse proxy. It provides protection from a range of attacks against web applications and allows for HTTP traffic monitoring, logging and real-time analysis.', '', 0, 0, 'http://sourceforge.net/projects/mod-security/files/latest/download?source=directory', ''),
	(679, 'wipfw', 'wipfw - IPv4 packet filter and traffic shaper for Windows based on IPFW(FreeBSD firewall).', '137.jpg', 0, 0, 'http://sourceforge.net/projects/wipfw/files/latest/download?source=directory', ''),
	(680, 'PeerBlock', 'Blocks "known bad" IP-addresses from accessing your machine, especially corporate/governmental agencies. This is a fork of PeerGuardian 2, fixing various Vista/Win7 problems.', '', 0, 0, 'http://sourceforge.net/projects/peerblock/files/latest/download?source=directory', ''),
	(681, 'XantiMalware', 'This is software to destroy common some types of common spy-ware, ad-ware, scare-ware, Mal-ware, and other viruses.', '', 0, 0, 'http://sourceforge.net/projects/xantimalware/?source=directory', ''),
	(682, 'Registry Alert', 'This is small security software for registry. It will give you alert for those software or spy-wares which start on startup and slow your computer.you can also create your alert and watch your registry. It run in background and take very less memory.', '137 (1).jpg', 0, 0, 'http://sourceforge.net/projects/registryalert/?source=directory', ''),
	(683, 'Webtourist Web Browser', 'Webtourist is based on Mozilla Firefox.It was designed for the services provided by an independent application. Webtourist browser is not spyware, do not collect any information users. Totally free, you can rest assured that use.', 'sf.png', 0, 0, 'http://sourceforge.net/projects/webtourist/?source=directory', ''),
	(684, 'sBoost', 'Cleans the following: Internet Explorer, Firefox, Google Chrome, Opera, Safari, Windows Optimize System Restore Network Restore 100% Spyware FREE - This software does NOT contain any Spyware, Adware or Viruses.', '', 0, 0, 'http://sourceforge.net/projects/sboost/?source=directory', '');
