INSERT INTO `slide` (`id`, `order`, `title`, `link`, `text`, `image`) VALUES
	(1, 1, 'Welcome', '/home/index', 'Welcome to Media Toolbox Online, the most comprehensive and updated media source in the web, keeping you on top and up to date with your online media. Browse and get access to the latest media sources, cool software, media tools, featured and bonus content and much more.', 'A_Welcome.JPG'),
	(7, 2, 'Media', '/channel/index/1', ' Get access to Legal media Sources, Stream Movies and music to enjoy online or download them to your computer. Enjoy promotional offers and featured media, updating constantly.', 'A_Media.JPG'),
	(8, 3, 'Software', '/channel/index/17', 'Download the software you need from numerous sources, Get access and enjoy featured software, developed and optimized in order to improve your online media consuming and protect your privacy.', 'A_Software.JPG'),
	(9, 4, 'Index', '/channel/index/9', 'Browse the web and get access to the most extensive content and media sources data base, all there to help you find what you are looking for.', 'Index_01.JPG'),
	(10, 5, 'Tools', '/channel/index/17', 'Get access, and download cool and useful media tools to enhance your online experience, enjoy promotional offers, social tools and even coupons which will save you money!', 'A_Tools.JPG');
